ges','s:38:\"de:Seit längerem unbearbeitete Seiten\";'),('de','messages:ancientpages-summary','s:3:\"en:\";'),('de','messages:and','s:11:\"de:&#32;und\";'),('de','messages:anoncontribs','s:12:\"de:Beiträge\";'),('de','messages:anoneditwarning','s:329:\"de:<strong>Warnung:</strong> Du bist nicht angemeldet. Deine IP-Adresse wird bei Bearbeitungen öffentlich sichtbar. <strong>[$1 Melde dich an]</strong> oder <strong>[$2 erstelle ein Benutzerkonto]</strong>, damit Bearbeitungen deinem Benutzernamen zugeordnet werden. Ein eigenes Benutzerkonto hat eine ganze Reihe von Vorteilen.\";'),('de','messages:anonnotice','s:4:\"en:-\";'),('de','messages:anononlyblock','s:14:\"de:nur Anonyme\";'),('de','messages:anonpreviewwarning','s:122:\"de:<em>Du bist nicht angemeldet. Beim Veröffentlichen wird deine IP-Adresse in der Versionsgeschichte aufgezeichnet.</em>\";'),('de','messages:anontalk','s:19:\"de:Diskussionsseite\";'),('de','messages:anontalkpagetext','s:589:\"de:----\n<em>Diese Seite dient dazu, einem nicht angemeldeten Benutzer Nachrichten zu hinterlassen.</em>\nEs wird seine IP-Adresse zur Identifizierung verwendet.\nIP-Adressen können von mehreren Benutzern gemeinsam verwendet werden.\nWenn du mit den Kommentaren auf dieser Seite nichts anfangen kannst, richten sie sich vermutlich an einen früheren Inhaber deiner IP-Adresse und du kannst sie ignorieren.\nDu kannst dir auch ein [[Special:CreateAccount|Benutzerkonto erstellen]] oder dich [[Special:UserLogin|anmelden]], um künftig Verwechslungen mit anderen anonymen Benutzern zu vermeiden.\";'),('de','messages:anonuser','s:36:\"de:Anonymer {{SITENAME}}-Benutzer $1\";'),('de','messages:anonusers','s:82:\"de:{{PLURAL:$2|unangemeldetem|unangemeldeten}} {{PLURAL:$2|Benutzer|Benutzern}} $1\";'),('de','messages:anonymous','s:80:\"de:{{PLURAL:$1|Unangemeldeter Benutzer|Unangemeldete Benutzer}} auf {{SITENAME}}\";'),('de','messages:api-clientside-error-aborted','s:33:\"de:Die Anfrage wurde abgebrochen.\";'),('de','messages:api-clientside-error-http','s:55:\"de:Der Server hat einen Fehler zurückgegeben: HTTP $1.\";'),('de','messages:api-clientside-error-invalidresponse','s:33:\"de:Ungültige Antwort vom Server.\";'),('de','messages:api-clientside-error-noconnect','s:153:\"de:Es konnte keine Verbindung zum Server hergestellt werden. Stelle sicher, dass du eine funktionierende Internetverbindung hast, und versuche es erneut.\";'),('de','messages:api-clientside-error-timeout','s:63:\"de:Der Server hat nicht innerhalb der erwarteten Zeit reagiert.\";'),('de','messages:api-credits','s:425:\"de:API-Entwickler:\n* Yuri Astrakhan (Autor, Hauptentwickler von September 2006 bis September 2007)\n* Roan Kattouw (Hauptentwickler von September 2007 bis September 2009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Brad Jorsch (Hauptentwickler 2013-2020)\n\nBitte sende deine Kommentare, Vorschläge und Fragen an mediawiki-api@lists.wikimedia.org\noder reiche einen Fehlerbericht auf https://phabricator.wikimedia.org/ ein.\";'),('de','messages:api-credits-header','s:15:\"de:Danksagungen\";'),('de','messages:api-error-badtoken','s:45:\"de:Interner Fehler: Der Token ist fehlerhaft.\";'),('de','messages:api-error-emptypage','s:56:\"de:Es ist nicht erlaubt, neue leere Seiten zu erstellen.\";'),('de','messages:api-error-publishfailed','s:82:\"de:Interner Fehler: Der Server konnte die temporäre Datei nicht veröffentlichen.\";'),('de','messages:api-error-stashfailed','s:71:\"de:Interner Fehler: Der Server konnte keine temporäre Datei speichern.\";'),('de','messages:api-error-unknown-warning','s:32:\"de:Unbekannte Warnung: „$1“.\";'),('de','messages:api-error-unknownerror','s:31:\"de:Unbekannter Fehler: „$1“\";'),('de','messages:api-exception-trace','s:19:\"de:$1 bei $2($3)\n$4\";'),('de','messages:api-feed-error-title','s:14:\"de:Fehler ($1)\";'),('de','messages:api-format-prettyprint-header','s:472:\"de:Dies ist die Darstellung des $1-Formats in HTML. HTML ist gut zur Fehlerbehebung geeignet, aber unpassend für die Nutzung durch Anwendungen.\n\nGib den Parameter <var>format</var> an, um das Ausgabeformat zu ändern. Lege <kbd>format=$2</kbd> fest, um die von HTML abweichende Darstellung des $1-Formats zu erhalten.\n\nSiehe auch die [[mw:Special:MyLanguage/API|vollständige Dokumentation der API]] oder die [[Special:ApiHelp/main|API-Hilfe]] für weitere Informationen.\";'),('de','messages:api-format-prettyprint-header-hyperlinked','s:380:\"en:This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set [$3 <kbd>format=$2</kbd>].\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('de','messages:api-format-prettyprint-header-only-html','s:222:\"en:This is an HTML representation intended for debugging, and is unsuitable for application use.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('de','messages:api-format-prettyprint-status','s:63:\"de:Diese Antwort wird mit dem HTTP-Status $1 $2 zurückgegeben.\";'),('de','messages:api-format-title','s:25:\"de:MediaWiki-API-Ergebnis\";'),('de','messages:api-help-authmanager-general-usage','s:1254:\"en:The general procedure to use this module is:\n# Fetch the fields available from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$4</kbd>, and a <kbd>$5</kbd> token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Present the fields to the user, and obtain their submission.\n# Post to this module, supplying <var>$1returnurl</var> and any relevant fields.\n# Check the <samp>status</samp> in the response.\n#* If you received <samp>PASS</samp> or <samp>FAIL</samp>, you\'re done. The operation either succeeded or it didn\'t.\n#* If you received <samp>UI</samp>, present the new fields to the user and obtain their submission. Then post to this module with <var>$1continue</var> and the relevant fields set, and repeat step 4.\n#* If you received <samp>REDIRECT</samp>, direct the user to the <samp>redirecttarget</samp> and wait for the return to <var>$1returnurl</var>. Then post to this module with <var>$1continue</var> and any fields passed to the return URL, and repeat step 4.\n#* If you received <samp>RESTART</samp>, that means the authentication worked but we don\'t have a linked user account. You might treat this as <samp>UI</samp> or as <samp>FAIL</samp>.\";'),('de','messages:api-help-authmanagerhelper-additional-params','s:344:\"en:This module accepts additional parameters depending on the available authentication requests. Use <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> (or a previous response from this module, if applicable) to determine the requests available and the fields that they use.\";'),('de','messages:api-help-authmanagerhelper-continue','s:152:\"en:This request is a continuation after an earlier <samp>UI</samp> or <samp>REDIRECT</samp> response. Either this or <var>$1returnurl</var> is required.\";'),('de','messages:api-help-authmanagerhelper-mergerequestfields','s:74:\"en:Merge field information for all authentication requests into one array.\";'),('de','messages:api-help-authmanagerhelper-messageformat','s:56:\"de:Zu verwendendes Format zur Rückgabe von Nachrichten.\";'),('de','messages:api-help-authmanagerhelper-preservestate','s:68:\"en:Preserve state from a previous failed login attempt, if possible.\";'),('de','messages:api-help-authmanagerhelper-request','s:194:\"en:Use this authentication request, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd>.\";'),('de','messages:api-help-authmanagerhelper-requests','s:246:\"en:Only use these authentication requests, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> or from a previous response from this module.\";'),('de','messages:api-help-authmanagerhelper-returnurl','s:517:\"en:Return URL for third-party authentication flows, must be absolute. Either this or <var>$1continue</var> is required.\n\nUpon receiving a <samp>REDIRECT</samp> response, you will typically open a browser or web view to the specified <samp>redirecttarget</samp> URL for a third-party authentication flow. When that completes, the third party will send the browser or web view to this URL. You should extract any query or POST parameters from the URL and pass them as a <var>$1continue</var> request to this API module.\";'),('de','messages:api-help-datatype-boolean','s:171:\"en:Boolean parameters work like HTML checkboxes: if the parameter is specified, regardless of value, it is considered true. For a false value, omit the parameter entirely.\";'),('de','messages:api-help-datatype-expiry','s:259:\"de:Ablaufwerte können relativ (z. B. <kbd>5 months</kbd> oder <kbd>2 weeks</kbd>) oder absolut (z. B. <kbd>2014-09-18T12:34:56Z</kbd>) sein. Verwende für kein Ablaufdatum <kbd>infinite</kbd>, <kbd>indefinity</kbd>, <kbd>infinity</kbd> oder <kbd>never</kbd>.\";'),('de','messages:api-help-datatype-timestamp','s:391:\"en:Timestamps may be specified in several formats, see [[mw:Special:MyLanguage/Timestamp|the Timestamp library input formats documented on mediawiki.org]] for details. ISO 8601 date and time is recommended: <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd>. Additionally, the string <kbd>now</kbd> may be used to specify the current timestamp.\";'),('de','messages:api-help-datatypes-header','s:13:\"de:Datentypen\";'),('de','messages:api-help-datatypes-top','s:619:\"en:Input to MediaWiki should be NFC-normalized UTF-8. MediaWiki may attempt to convert other input, but this may cause some operations (such as [[Special:ApiHelp/edit|edits]] with MD5 checks) to fail.\n\nParameters that take multiple values are normally submitted with the values separated using the pipe character, e.g. <kbd>param=value1|value2</kbd> or <kbd>param=value1%7Cvalue2</kbd>. If a value must contain the pipe character, use U+001F (Unit Separator) as the separator \'\'and\'\' prefix the value with U+001F, e.g. <kbd>param=%1Fvalue1%1Fvalue2</kbd>.\n\nSome parameter types in API requests need further explanation:\";'),('de','messages:api-help-examples','s:36:\"de:{{PLURAL:$1|Beispiel|Beispiele}}:\";'),('de','messages:api-help-flag-deprecated','s:29:\"de:Dieses Modul ist veraltet.\";'),('de','messages:api-help-flag-generator','s:52:\"de:Dieses Modul kann als Generator verwendet werden.\";'),('de','messages:api-help-flag-internal','s:113:\"de:<strong>Dieses Modul ist intern oder instabil.</strong> Seine Operationen werden ohne Kenntnisnahme geändert.\";'),('de','messages:api-help-flag-mustbeposted','s:45:\"de:Dieses Modul akzeptiert nur POST-Anfragen.\";'),('de','messages:api-help-flag-readrights','s:37:\"de:Dieses Modul erfordert Leserechte.\";'),('de','messages:api-help-flag-writerights','s:40:\"de:Dieses Modul erfordert Schreibrechte.\";'),('de','messages:api-help-flags','s:3:\"en:\";'),('de','messages:api-help-help-urls','s:3:\"en:\";'),('de','messages:api-help-lead','s:168:\"de:Dies ist eine automatisch generierte MediaWiki-API-Dokumentationsseite.\n\nDokumentation und Beispiele: https://www.mediawiki.org/wiki/Special:MyLanguage/API:Main_page\";'),('de','messages:api-help-license','s:20:\"de:Lizenz: [[$1|$2]]\";'),('de','messages:api-help-license-noname','s:28:\"de:Lizenz: [[$1|Siehe Link]]\";'),('de','messages:api-help-license-unknown','s:57:\"de:Lizenz: <span class=\"apihelp-unknown\">unbekannt</span>\";'),('de','messages:api-help-main-header','s:13:\"de:Hauptmodul\";'),('de','messages:api-help-no-extended-description','s:3:\"en:\";'),('de','messages:api-help-open-in-apisandbox','s:41:\"de:<small>[in Spielwiese öffnen]</small>\";'),('de','messages:api-help-param-continue','s:205:\"de:Falls weitere Ergebnisse verfügbar sind, dies zum Fortfahren verwenden. Ausführlichere Informationen zum Fortsetzen von Abfragen [[mw:Special:MyLanguage/API:Continue|befinden sich auf mediawiki.org]].\";'),('de','messages:api-help-param-default-empty','s:54:\"de:Standard: <span class=\"apihelp-empty\">(leer)</span>\";'),('de','messages:api-help-param-deprecated','s:12:\"de:Veraltet.\";'),('de','messages:api-help-param-deprecated-label','s:11:\"de:veraltet\";'),('de','messages:api-help-param-direction','s:35:\"en:In which direction to enumerate:\";'),('de','messages:api-help-param-disabled-in-miser-mode','s:86:\"de:Deaktiviert aufgrund des [[mw:Special:MyLanguage/Manual:$wgMiserMode|Miser-Modus]].\";'),('de','messages:api-help-param-internal','s:10:\"de:Intern.\";'),('de','messages:api-help-param-internal-label','s:9:\"de:Intern\";'),('de','messages:api-help-param-limited-in-miser-mode','s:229:\"en:<strong>Note:</strong> Due to [[mw:Special:MyLanguage/Manual:$wgMiserMode|miser mode]], using this may result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases, zero results may be returned.\";'),('de','messages:api-help-param-multi-all','s:51:\"de:Um alle Werte anzugeben, verwende <kbd>$1</kbd>.\";'),('de','messages:api-help-param-multi-separate','s:91:\"de:Werte mit <kbd>|</kbd> trennen oder [[Special:ApiHelp/main#main/datatypes|Alternative]].\";'),('de','messages:api-help-param-no-description','s:58:\"de:<span class=\"apihelp-empty\">(keine Beschreibung)</span>\";'),('de','messages:api-help-param-templated','s:115:\"de:Dies ist ein [[Special:ApiHelp/main#main/templatedparams|Vorlagenparameter]]. Bei der Erstellung der Anfrage $2.\";'),('de','messages:api-help-param-templated-var','s:57:\"de:<var>&#x7B;$1&#x7D;</var> mit Werten von <var>$2</var>\";'),('de','messages:api-help-param-templated-var-first','s:97:\"de:<var>&#x7B;$1&#x7D;</var> im Parameternamen sollte mit Werten von <var>$2</var> ersetzt werden\";'),('de','messages:api-help-param-token','s:93:\"de:Ein „$1“-Token abgerufen von [[Special:ApiHelp/query+tokens|action=query&meta=tokens]]\";'),('de','messages:api-help-param-token-webui','s:101:\"de:Aus Kompatibilitätsgründen wird der in der Weboberfläche verwendete Token ebenfalls akzeptiert.\";'),('de','messages:api-help-param-type-enum','s:144:\"de:{{PLURAL:$1|1=Einer der folgenden Werte|2=Werte (mit <kbd>{{!}}</kbd> trennen oder [[Special:ApiHelp/main#main/datatypes|Alternative]])}}: $2\";'),('de','messages:api-help-param-type-expiry','s:106:\"en:Type: {{PLURAL:$1|1=expiry|2=list of expiries}} ([[Special:ApiHelp/main#main/datatype/expiry|details]])\";'),('de','messages:api-help-param-type-limit','s:36:\"de:Typ: Ganzzahl oder <kbd>max</kbd>\";'),('de','messages:api-help-param-type-presenceboolean','s:73:\"en:Type: boolean ([[Special:ApiHelp/main#main/datatype/boolean|details]])\";'),('de','messages:api-help-param-type-timestamp','s:128:\"de:Typ: {{PLURAL:$1|1=Zeitstempel|2=Liste von Zeitstempeln}} ([[Special:ApiHelp/main#main/datatype/timestamp|erlaubte Formate]])\";'),('de','messages:api-help-parameters','s:62:\"de:{{PLURAL:$1|Spezifischer Parameter|Spezifische Parameter}}:\";'),('de','messages:api-help-parameters-note','s:48:\"de:Weitere allgemeine Parameter sind verfügbar.\";'),('de','messages:api-help-paramvalue-direction-newer','s:59:\"en:List oldest first. Note: $1start has to be before $1end.\";'),('de','messages:api-help-paramvalue-direction-older','s:73:\"en:List newest first (default). Note: $1start has to be later than $1end.\";'),('de','messages:api-help-permissions','s:45:\"de:{{PLURAL:$1|Berechtigung|Berechtigungen}}:\";'),('de','messages:api-help-permissions-granted-to','s:32:\"de:{{PLURAL:$1|Gewährt an}}: $2\";'),('de','messages:api-help-right-apihighlimits','s:188:\"de:Höhere Beschränkungen in API-Anfragen verwenden (langsame Anfragen: $1; schnelle Anfragen: $2). Die Beschränkungen für langsame Anfragen werden auch auf Mehrwertparameter angewandt.\";'),('de','messages:api-help-source','s:13:\"de:Quelle: $1\";'),('de','messages:api-help-source-unknown','s:57:\"de:Quelle: <span class=\"apihelp-unknown\">unbekannt</span>\";'),('de','messages:api-help-templatedparams','s:563:\"en:Templated parameters support cases where an API module needs a value for each value of some other parameter. For example, if there were an API module to request fruit, it might have a parameter <var>fruits</var> to specify which fruits are being requested and a templated parameter <var>{fruit}-quantity</var> to specify how many of each fruit to request. An API client that wants 1 apple, 5 bananas, and 20 strawberries could then make a request like <kbd>fruits=apples|bananas|strawberries&apples-quantity=1&bananas-quantity=5&strawberries-quantity=20</kbd>.\";'),('de','messages:api-help-templatedparams-header','s:20:\"de:Vorlagenparameter\";'),('de','messages:api-help-title','s:22:\"de:MediaWiki-API-Hilfe\";'),('de','messages:api-help-undocumented-module','s:47:\"de:Keine Dokumentation für das Modul „$1“.\";'),('de','messages:api-login-fail-aborted','s:280:\"en:Authentication requires user interaction, which is not supported by <kbd>action=login</kbd>. To be able to login with <kbd>action=login</kbd>, see [[Special:BotPasswords]]. To continue using main-account login, see <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('de','messages:api-login-fail-aborted-nobotpw','s:173:\"en:Authentication requires user interaction, which is not supported by <kbd>action=login</kbd>. To log in, see <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('de','messages:api-login-fail-badsessionprovider','s:31:\"en:Cannot log in when using $1.\";'),('de','messages:api-login-fail-sameorigin','s:60:\"en:Cannot log in when the same-origin policy is not applied.\";'),('de','messages:api-pageset-param-converttitles','s:174:\"en:Convert titles to other variants if necessary. Only works if the wiki\'s content language supports variant conversion. Languages that support variant conversion include $1.\";'),('de','messages:api-pageset-param-generator','s:169:\"en:Get the list of pages to work on by executing the specified query module.\n\n<strong>Note:</strong> Generator parameter names must be prefixed with a \"g\", see examples.\";'),('de','messages:api-pageset-param-pageids','s:67:\"de:Eine Liste der Seitenkennungen, an denen gearbeitet werden soll.\";'),('de','messages:api-pageset-param-redirects-generator','s:154:\"en:Automatically resolve redirects in <var>$1titles</var>, <var>$1pageids</var>, and <var>$1revids</var>, and in pages returned by <var>$1generator</var>.\";'),('de','messages:api-pageset-param-redirects-nogenerator','s:105:\"en:Automatically resolve redirects in <var>$1titles</var>, <var>$1pageids</var>, and <var>$1revids</var>.\";'),('de','messages:api-pageset-param-revids','s:271:\"de:Eine Liste der zu bearbeitenden Versions-IDs. Beachte, dass fast alle Abfragemodule Versions-IDs in die entsprechende Seiten-ID konvertieren und stattdessen mit der neuesten Version arbeiten. Nur <kbd>prop=revisions</kbd> verwendet exakte Versionen für seine Antwort.\";'),('de','messages:api-pageset-param-titles','s:57:\"de:Eine Liste der Titel, an denen gearbeitet werden soll.\";'),('de','messages:api-usage-docref','s:35:\"de:Siehe $1 zur Verwendung der API.\";'),('de','messages:api-usage-mailinglist-ref','s:224:\"de:Abonniere die Mailingliste „mediawiki-api-announce“ auf &lt;https://lists.wikimedia.org/postorius/lists/mediawiki-api-announce.lists.wikimedia.org/&gt; zum Feststellen von API-Veralterungen und „Breaking Changes“.\";'),('de','messages:apierror-allimages-redirect','s:125:\"en:Use <kbd>gaifilterredir=nonredirects</kbd> instead of <var>redirects</var> when using <kbd>allimages</kbd> as a generator.\";'),('de','messages:apierror-allpages-generator-redirects','s:124:\"en:Use <kbd>gapfilterredir=nonredirects</kbd> instead of <var>redirects</var> when using <kbd>allpages</kbd> as a generator.\";'),('de','messages:apierror-alreadyregistered','s:35:\"en:You already have a user account.\";'),('de','messages:apierror-appendnotsupported','s:48:\"en:Can\'t append to pages using content model $1.\";'),('de','messages:apierror-articleexists','s:60:\"en:The article you tried to create has been created already.\";'),('de','messages:apierror-assertanonfailed','s:70:\"en:You are no longer logged out, so the action could not be completed.\";'),('de','messages:apierror-assertbotfailed','s:84:\"en:You do not have the <code>bot</code> right, so the action could not be completed.\";'),('de','messages:apierror-assertnameduserfailed','s:77:\"en:You are no longer logged in as \"$1\", so the action could not be completed.\";'),('de','messages:apierror-assertuserfailed','s:69:\"en:You are no longer logged in, so the action could not be completed.\";'),('de','messages:apierror-autoblocked','s:89:\"en:Your IP address has been blocked automatically, because it was used by a blocked user.\";'),('de','messages:apierror-bad-badfilecontexttitle','s:67:\"de:Ungültiger Titel im Parameter <var>$1badfilecontexttitle</var>.\";'),('de','messages:apierror-bad-watchlist-token','s:93:\"en:Incorrect watchlist token provided. Please set a correct token in [[Special:Preferences]].\";'),('de','messages:apierror-badconfig-resulttoosmall','s:108:\"en:The value of <code>$wgAPIMaxResultSize</code> on this wiki is too small to hold basic result information.\";'),('de','messages:apierror-badcontinue','s:93:\"en:Invalid continue param. You should pass the original value returned by the previous query.\";'),('de','messages:apierror-baddiff','s:111:\"en:The diff cannot be retrieved. One or both revisions do not exist or you do not have permission to view them.\";'),('de','messages:apierror-baddiffto','s:112:\"en:<var>$1diffto</var> must be set to a non-negative number, <kbd>prev</kbd>, <kbd>next</kbd> or <kbd>cur</kbd>.\";'),('de','messages:apierror-badformat','s:76:\"en:The requested format $1 is not supported for content model $2 used by $3.\";'),('de','messages:apierror-badformat-generic','s:65:\"en:The requested format $1 is not supported for content model $2.\";'),('de','messages:apierror-badgenerator-notgenerator','s:54:\"en:Module <kbd>$1</kbd> cannot be used as a generator.\";'),('de','messages:apierror-badgenerator-unknown','s:37:\"de:<kbd>generator=$1</kbd> unbekannt.\";'),('de','messages:apierror-badip','s:38:\"de:Der IP-Parameter ist nicht gültig.\";'),('de','messages:apierror-badmd5','s:44:\"de:Die angegebene MD5-Prüfsumme war falsch.\";'),('de','messages:apierror-badmodule-badsubmodule','s:63:\"de:Das Modul <kbd>$1</kbd> hat kein Untermodul namens „$2“.\";'),('de','messages:apierror-badmodule-nosubmodules','s:49:\"de:Das Modul <kbd>$1</kbd> hat keine Untermodule.\";'),('de','messages:apierror-badparameter','s:53:\"de:Ungültiger Wert für den Parameter <var>$1</var>.\";'),('de','messages:apierror-badquery','s:22:\"de:Ungültige Abfrage.\";'),('de','messages:apierror-badtimestamp','s:60:\"en:Invalid value \"$2\" for timestamp parameter <var>$1</var>.\";'),('de','messages:apierror-badtoken','s:22:\"en:Invalid CSRF token.\";'),('de','messages:apierror-badupload','s:193:\"en:File upload parameter <var>$1</var> is not a file upload; be sure to use <code>multipart/form-data</code> for your POST and include a filename in the <code>Content-Disposition</code> header.\";'),('de','messages:apierror-badurl','s:54:\"en:Invalid value \"$2\" for URL parameter <var>$1</var>.\";'),('de','messages:apierror-baduser','s:55:\"en:Invalid value \"$2\" for user parameter <var>$1</var>.\";'),('de','messages:apierror-badvalue-notmultivalue','s:78:\"en:U+001F multi-value separation may only be used for multi-valued parameters.\";'),('de','messages:apierror-blocked','s:38:\"en:You have bee