nicht sichtbar.\";'),('de','messages:apihelp-acquiretempusername-summary','s:262:\"de:Erfassen eines temporären Benutzernamens und Speichern dieses in der aktuellen Sitzung, wenn die Erstellung temporärer Konten aktiviert ist und der aktuelle Benutzer abgemeldet ist. Wenn ein Name bereits gespeichert wurde, wird derselbe Name zurückgegeben.\";'),('de','messages:apihelp-block-example-ip-simple','s:84:\"de:Sperren der IP-Adresse <kbd>192.0.2.5</kbd> für drei Tage mit einer Begründung.\";'),('de','messages:apihelp-block-example-user-complex','s:155:\"de:Benutzer <kbd>Vandal</kbd> unbeschränkt mit einer Begründung sperren und die Erstellung neuer Benutzerkonten sowie den Versand von E-Mails verhindern.\";'),('de','messages:apihelp-block-param-actionrestrictions','s:124:\"de:Liste der Aktionen, die der Benutzer nicht ausführen darf. Nur zutreffend, wenn <var>partial</var> auf true gesetzt ist.\";'),('de','messages:apihelp-block-param-allowusertalk','s:172:\"de:Dem Benutzer erlauben, seine eigene Diskussionsseite zu bearbeiten (abhängig von <var>[[mw:Special:MyLanguage/Manual:$wgBlockAllowsUTEdit|$wgBlockAllowsUTEdit]]</var>).\";'),('de','messages:apihelp-block-param-anononly','s:151:\"de:Nur anonyme Benutzer sperren (z.&nbsp;B. anonyme Bearbeitungen für diese IP deaktivieren, inklusive Bearbeitungen durch temporäre Benutzerkonten).\";'),('de','messages:apihelp-block-param-autoblock','s:125:\"de:Die zuletzt verwendete IP-Adresse automatisch sperren und alle darauffolgenden IP-Adressen, die versuchen sich anzumelden.\";'),('de','messages:apihelp-block-param-expiry','s:258:\"de:Sperrdauer. Kann relativ (z.&nbsp;B. <kbd>5 months</kbd> oder <kbd>2 weeks</kbd>) oder absolut (z.&nbsp;B. <kbd>2014-09-18T12:34:56Z</kbd>) sein. Wenn auf <kbd>infinite</kbd>, <kbd>indefinite</kbd> oder <kbd>never</kbd> gesetzt, ist die Sperre unbegrenzt.\";'),('de','messages:apihelp-block-param-hidename','s:93:\"de:Den Benutzernamen im Sperr-Logbuch verstecken (erfordert das <code>hideuser</code>-Recht).\";'),('de','messages:apihelp-block-param-namespacerestrictions','s:142:\"de:Listet Namensraumkennungen zum Sperren des Benutzers für das Bearbeiten auf. Nur zutreffend, wenn <var>partial</var> auf true gesetzt ist.\";'),('de','messages:apihelp-block-param-nocreate','s:39:\"de:Benutzerkontenerstellung verhindern.\";'),('de','messages:apihelp-block-param-noemail','s:108:\"de:Benutzer davon abhalten, E-Mails auf dem Wiki zu versenden (erfordert das <code>blockemail</code>-Recht).\";'),('de','messages:apihelp-block-param-pagerestrictions','s:138:\"de:Listet die für den Benutzer zu sperrenden Titel für das Bearbeiten auf. Nur zutreffend, wenn <var>partial</var> auf true gesetzt ist.\";'),('de','messages:apihelp-block-param-partial','s:98:\"de:Sperrt den Benutzer für spezielle Seiten oder Namensräume und nicht für die gesamte Website.\";'),('de','messages:apihelp-block-param-reason','s:20:\"de:Sperrbegründung.\";'),('de','messages:apihelp-block-param-reblock','s:81:\"de:Falls der Benutzer bereits gesperrt ist, die vorhandene Sperre überschreiben.\";'),('de','messages:apihelp-block-param-tags','s:72:\"de:Auf den Eintrag im Sperr-Logbuch anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-block-param-user','s:37:\"de:Benutzer, der gesperrt werden soll\";'),('de','messages:apihelp-block-param-userid','s:56:\"de:Stattdessen <kbd>$1user=#<var>ID</var></kbd> angeben.\";'),('de','messages:apihelp-block-param-watchlistexpiry','s:132:\"de:Ablaufzeitstempel der Beobachtungsliste. Lasse diesen Parameter vollständig weg, um den aktuellen Ablauf unverändert zu lassen.\";'),('de','messages:apihelp-block-param-watchuser','s:80:\"de:Benutzer- und Diskussionsseiten des Benutzers oder der IP-Adresse beobachten.\";'),('de','messages:apihelp-block-summary','s:25:\"de:Sperrt einen Benutzer.\";'),('de','messages:apihelp-changeauthenticationdata-example-password','s:91:\"de:Versucht, das Passwort des aktuellen Benutzers in <kbd>ExamplePassword</kbd> zu ändern.\";'),('de','mes