n Benutzer löschen\";'),('de','messages:apihelp-clearhasmsg-summary','s:99:\"de:Löschen des <code>hasmsg</code>-Flags („hat Nachrichten“-Flag) für den aktuellen Benutzer.\";'),('de','messages:apihelp-clientlogin-example-login','s:125:\"de:Startet den Prozess der Anmeldung in dem Wiki als Benutzer <kbd>Example</kbd> mit dem Passwort <kbd>ExamplePassword</kbd>.\";'),('de','messages:apihelp-clientlogin-example-login2','s:132:\"en:Continue logging in after a <samp>UI</samp> response for two-factor auth, supplying an <var>OATHToken</var> of <kbd>987654</kbd>.\";'),('de','messages:apihelp-clientlogin-summary','s:58:\"de:Melde dich bei dem Wiki mit dem interaktiven Ablauf an.\";'),('de','messages:apihelp-compare-example-1','s:47:\"de:Unterschied zwischen Version 1 und 2 abrufen\";'),('de','messages:apihelp-compare-extended-description','s:116:\"de:Du musst eine Versionsnummer, einen Seitentitel oder eine Seitennummer für „from“ als auch „to“ angeben.\";'),('de','messages:apihelp-compare-param-difftype','s:57:\"de:Rückgabe des als Inline-HTML formatierten Vergleichs.\";'),('de','messages:apihelp-compare-param-fromcontentformat','s:100:\"de:Präzisiere <kbd>fromslots=main</kbd> und verwende stattdessen <var>fromcontentformat-main</var>.\";'),('de','messages:apihelp-compare-param-fromcontentformat-{slot}','s:69:\"de:Inhalts-Serialisierungsformat von <var>fromtext-&#x7B;slot}</var>.\";'),('de','messages:apihelp-compare-param-fromcontentmodel','s:99:\"de:Präzisiere <kbd>fromslots=main</kbd> und verwende stattdessen <var>fromcontentmodel-main</var>.\";'),('de','messages:apihelp-compare-param-fromcontentmodel-{slot}','s:134:\"de:Inhaltsmodell von <var>totext-&#x7B;slot}</var>. Falls nicht angegeben, wird es auf der Grundlage der anderen Parameter geschätzt.\";'),('de','messages:apihelp-compare-param-fromid','s:39:\"de:Erste zu vergleichende Seitennummer.\";'),('de','messages:apihelp-compare-param-frompst','s:82:\"de:Führt eine Vorspeicherungsumwandlung für <var>fromtext-&#x7B;slot}</var> aus.\";'),('de','messages:apihelp-compare-param-fromrev','s:34:\"de:Erste zu vergleichende Version.\";'),('de','messages:apihelp-compare-param-fromsection','s:78:\"de:Nur den angegebenen Abschnitt des angegebenen „from“-Inhalts verwenden.\";'),('de','messages:apihelp-compare-param-fromsection-{slot}','s:266:\"de:Wenn <var>fromtext-&#x7B;slot}</var> der Inhalt eines einzelnen Abschnitts ist, ist dies die Abschnittskennung. Es wird wie bei einer Abschnittsbearbeitung in die durch <var>fromtitle</var>, <var>fromid</var> oder <var>fromrev</var> angegebene Version eingefügt.\";'),('de','messages:apihelp-compare-param-fromslots','s:344:\"de:Überschreibe den Inhalt der durch <var>fromtitle</var> , <var>fromid</var> oder <var>fromrev</var> angegebenen Version.\n\nDieser Parameter gibt die Slots an, die geändert werden sollen. Verwende <var>fromtext-{slot}</var> , <var>fromcontentmodel-{slot}</var> und <var>fromcontentformat-{slot}</var>, um den Inhalt für jeden Slot anzugeben.\";'),('de','messages:apihelp-compare-param-fromtext','s:91:\"de:Präzisiere <kbd>fromslots=main</kbd> und verwende stattdessen <var>fromtext-main</var>.\";'),('de','messages:apihelp-compare-param-fromtext-{slot}','s:96:\"de:Text des angegebenen Slots. Wenn er weggelassen wird, wird der Slot aus der Version entfernt.\";'),('de','messages:apihelp-compare-param-fromtitle','s:34:\"de:Erster zu vergleichender Titel.\";'),('de','messages:apihelp-compare-param-prop','s:48:\"de:Welche Informationen abgerufen werden sollen.\";'),('de','messages:apihelp-compare-param-slots','s:92:\"de:Rückgabe einzelner Diffs für diese Slots statt eines kombinierten Diff für alle Slots.\";'),('de','messages:apihelp-compare-param-tocontentformat','s:96:\"de:Spezifiziere <kbd>toslots=main</kbd> und verwende stattdessen <var>tocontentmodel-main</var>.\";'),('de','messages:apihelp-compare-param-tocontentformat-{slot}','s:81:\"de:Format für die Serialisierung von Inhalten von <var>totext-&#x7B;slot}</var>.\";'),('de','messages:apihelp-compare-param-tocontentmodel','s:96:\"de:Spezifiziere <kbd>toslots=main</kbd> und verwende stattdessen <var>tocontentmodel-main</var>.\";'),('de','messages:apihelp-compare-param-tocontentmodel-{slot}','s:134:\"de:Inhaltsmodell von <var>totext-&#x7B;slot}</var>. Falls nicht angegeben, wird es auf der Grundlage der anderen Parameter geschätzt.\";'),('de','messages:apihelp-compare-param-toid','s:40:\"de:Zweite zu vergleichende Seitennummer.\";'),('de','messages:apihelp-compare-param-topst','s:68:\"de:Führt eine Vorspeicherungsumwandlung für <var>totext</var> aus.\";'),('de','messages:apihelp-compare-param-torelative','s:187:\"de:Verwenden einer Version relativ zu der Version, die aus <var>fromtitle</var>, <var>fromid</var> oder <var>fromrev</var> ermittelt wird. Alle anderen „to“-Optionen werden ignoriert.\";'),('de','messages:apihelp-compare-param-torev','s:35:\"de:Zweite zu vergleichende Version.\";'),('de','messages:apihelp-compare-param-tosection','s:71:\"de:Verwende nur den angegebenen Abschnitt des angegebenen \'to\'-Inhalts.\";'),('de','messages:apihelp-compare-param-tosection-{slot}','s:258:\"de:Wenn <var>totext-&#x7B;slot}</var> der Inhalt eines einzelnen Abschnitts ist, ist dies die Abschnittskennung. Es wird wie bei einer Abschnittsbearbeitung in die durch <var>totitle</var>, <var>toid</var> oder <var>torev</var> angegebene Version eingefügt.\";'),('de','messages:apihelp-compare-param-toslots','s:317:\"en:Override content of the revision specified by <var>totitle</var>, <var>toid</var> or <var>torev</var>.\n\nThis parameter specifies the slots that are to be modified. Use <var>totext-&#x7B;slot}</var>, <var>tocontentmodel-&#x7B;slot}</var>, and <var>tocontentformat-&#x7B;slot}</var> to specify content for each slot.\";'),('de','messages:apihelp-compare-param-totext','s:88:\"de:Spezifiziere <kbd>toslots=main</kbd> und verwende stattdessen <var>totext-main</var>.\";'),('de','messages:apihelp-compare-param-totext-{slot}','s:96:\"de:Text des angegebenen Slots. Wenn er weggelassen wird, wird der Slot aus der Version entfernt.\";'),('de','messages:apihelp-compare-param-totitle','s:35:\"de:Zweiter zu vergleichender Titel.\";'),('de','messages:apihelp-compare-paramvalue-prop-comment','s:205:\"de:Der Kommentar zu den „from“- und „to“-Versionen. Wenn der Kommentar versionsgelöscht wurde, wird die Eigenschaft <samp>fromcommenthidden</samp> oder <samp>tocommenthidden</samp> zurückgegeben.\";'),('de','messages:apihelp-compare-paramvalue-prop-diff','s:25:\"de:Das Unterschieds-HTML.\";'),('de','messages:apihelp-compare-paramvalue-prop-diffsize','s:46:\"de:Die Größe des Unterschieds-HTML in Bytes.\";'),('de','messages:apihelp-compare-paramvalue-prop-ids','s:60:\"de:Die Seite und Version-IDs der \"from\"- und \"to\"-Versionen.\";'),('de','messages:apihelp-compare-paramvalue-prop-parsedcomment','s:214:\"de:Der geparste Kommentar zu den „from“- und „to“-Versionen. Wenn der Kommentar versionsgelöscht wurde, wird die Eigenschaft <samp>fromcommenthidden</samp> oder <samp>tocommenthidden</samp> zurückgegeben.\";'),('de','messages:apihelp-compare-paramvalue-prop-rel','s:76:\"de:Die Versions-IDs der Versionen vor \'from\' und nach \'to\', falls vorhanden.\";'),('de','messages:apihelp-compare-paramvalue-prop-size','s:53:\"de:Die Größe der Versionen „from“ und „to“.\";'),('de','messages:apihelp-compare-paramvalue-prop-timestamp','s:58:\"de:Der Zeitstempel der „from“- und „to“-Versionen.\";'),('de','messages:apihelp-compare-paramvalue-prop-title','s:58:\"de:Die Seitentitel der Versionen „Von“ und „Nach“.\";'),('de','messages:apihelp-compare-paramvalue-prop-user','s:215:\"de:Der Benutzername und die -kennung der „from“- und „to“-Versionen. Wenn der Benutzer versionsgelöscht wurde, wird die Eigenschaft <samp>fromuserhidden</samp> oder <samp>touserhidden</samp> zurückgegeben.\";'),('de','messages:apihelp-compare-summary','s:48:\"de:Ruft den Unterschied zwischen zwei Seiten ab.\";'),('de','messages:apihelp-createaccount-example-create','s:113:\"de:Start des Prozesses der Erstellung des Benutzers <kbd>Example<kbd> mit dem Passwort <kbd>ExamplePassword<kbd>.\";'),('de','messages:apihelp-createaccount-param-preservestate','s:420:\"de:Falls <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> für <samp>hasprimarypreservedstate</samp> wahr ausgegeben hat, sollten Anfragen, die als <samp>primary-required</samp> markiert wurden, ausgelassen werden. Falls ein nicht-leerer Wert für <samp>preservedusername</samp> zurückgegeben wurde, muss dieser Benutzername für den Parameter <var>username</var> verwendet werden.\";'),('de','messages:apihelp-createaccount-summary','s:36:\"de:Erstellt ein neues Benutzerkonto.\";'),('de','messages:apihelp-cspreport-param-reportonly','s:120:\"de:Kennzeichnen eines Berichts als einen Bericht aus einer Überwachungsrichtlinie, nicht als eine erzwungene Richtlinie\";'),('de','messages:apihelp-cspreport-param-source','s:69:\"de:Was der CSP-Header erzeugt hat, der diesen Bericht ausgelöst hat.\";'),('de','messages:apihelp-cspreport-summary','s:214:\"de:Wird von Browsern verwendet, um Verstöße gegen die Content Security Policy zu melden. Dieses Modul sollte niemals verwendet werden, außer wenn es automatisch von einem CSP-konformen Webbrowser verwendet wird.\";'),('de','messages:apihelp-delete-example-reason','s:89:\"de:[[{{MediaWiki:Mainpage}}]] löschen mit der Begründung <kbd>Preparing for move</kbd>.\";'),('de','messages:apihelp-delete-example-simple','s:39:\"de:[[{{MediaWiki:Mainpage}}]] löschen.\";'),('de','messages:apihelp-delete-param-deletetalk','s:50:\"de:Löschen der Diskussionsseite, falls vorhanden.\";'),('de','messages:apihelp-delete-param-oldimage','s:142:\"de:Name des alten zu löschenden Bildes, wie von [[Special:ApiHelp/query+imageinfo|action=query&prop=imageinfo&iiprop=archivename]] angegeben.\";'),('de','messages:apihelp-delete-param-pageid','s:114:\"de:Seitennummer der Seite, die gelöscht werden soll. Kann nicht zusammen mit <var>$1title</var> verwendet werden.\";'),('de','messages:apihelp-delete-param-reason','s:101:\"de:Löschbegründung. Falls nicht festgelegt, wird eine automatisch generierte Begründung verwendet.\";'),('de','messages:apihelp-delete-param-tags','s:83:\"de:Ändert die Markierungen, die auf den Eintrag im Lösch-Logbuch anzuwenden sind.\";'),('de','messages:apihelp-delete-param-title','s:108:\"de:Titel der Seite, die gelöscht werden soll. Kann nicht zusammen mit <var>$1pageid</var> verwendet werden.\";'),('de','messages:apihelp-delete-param-unwatch','s:45:\"de:Seite von der Beobachtungsliste entfernen.\";'),('de','messages:apihelp-delete-param-watch','s:66:\"de:Seite auf die Beobachtungsliste des aktuellen Benutzers setzen.\";'),('de','messages:apihelp-delete-param-watchlist','s:205:\"de:Bedingungslos die Seite zur Beobachtungsliste des aktuellen Benutzers hinzufügen oder von dieser entfernen, Benutzereinstellungen verwenden (für Bot-Benutzer ignoriert) oder Beobachtung nicht ändern.\";'),('de','messages:apihelp-delete-param-watchlistexpiry','s:142:\"de:Zeitstempel für den Ablauf der Beobachtungsliste. Diesen Parameter vollständig weglassen, um den aktuellen Ablauf unverändert zu lassen.\";'),('de','messages:apihelp-delete-summary','s:22:\"de:Löscht eine Seite.\";'),('de','messages:apihelp-disabled-summary','s:34:\"de:Dieses Modul wurde deaktiviert.\";'),('de','messages:apihelp-edit-example-edit','s:24:\"de:Eine Seite bearbeiten\";'),('de','messages:apihelp-edit-example-prepend','s:60:\"de:<kbd>_&#95;NOTOC_&#95;</kbd> bei einer Seite voranstellen\";'),('de','messages:apihelp-edit-example-undo','s:82:\"de:Versionen 13579 bis 13585 mit automatischer Zusammenfassung rückgängig machen\";'),('de','messages:apihelp-edit-param-appendtext','s:177:\"de:Diesen Text an das Ende der Seite oder des Abschnitts hinzufügen. Überschreibt $1text.\n\nVerwende statt dieses Parameters $1section=new zum Anhängen eines neuen Abschnitts.\";'),('de','messages:apihelp-edit-param-baserevid','s:282:\"de:ID der Basisversion, die zum Erkennen von Bearbeitungskonflikten verwendet wird. Kann über [[Special:ApiHelp/query+revisions|action=query&prop=revisions]] bezogen werden. Selbstkonflikte führen dazu, dass die Bearbeitung fehlschlägt, es sei denn, basetimestamp ist festgelegt.\";'),('de','messages:apihelp-edit-param-basetimestamp','s:233:\"de:Zeitstempel der Basisversion, wird verwendet zum Aufspüren von Bearbeitungskonflikten. Kann abgerufen werden durch [[Special:ApiHelp/query+revisions|action=query&prop=revisions&rvprop=timestamp]]. Eigenkonflikte werden ignoriert.\";'),('de','messages:apihelp-edit-param-bot','s:51:\"de:Diese Bearbeitung als Bot-Bearbeitung markieren.\";'),('de','messages:apihelp-edit-param-contentformat','s:65:\"de:Für den Eingabetext verwendetes Inhaltsserialisierungsformat.\";'),('de','messages:apihelp-edit-param-contentmodel','s:35:\"de:Inhaltsmodell des neuen Inhalts.\";'),('de','messages:apihelp-edit-param-createonly','s:59:\"de:Seite nicht bearbeiten, falls sie bereits vorhanden ist.\";'),('de','messages:apihelp-edit-param-md5','s:198:\"de:Der MD5-Hash des Parameters $1text oder der aneinandergehängten Parameter $1prependtext und $1appendtext. Wenn angegeben, wird die Bearbeitung nicht ausgeführt, wenn der Hash nicht korrekt ist.\";'),('de','messages:apihelp-edit-param-minor','s:47:\"de:Markiert diese Bearbeitung als geringfügig.\";'),('de','messages:apihelp-edit-param-nocreate','s:66:\"de:Einen Fehler zurückgeben, falls die Seite nicht vorhanden ist.\";'),('de','messages:apihelp-edit-param-notminor','s:135:\"de:Diese Bearbeitung nicht als geringfügig markieren, auch wenn die Benutzereinstellung „{{int:tog-minordefault}}“ festgelegt ist.\";'),('de','messages:apihelp-edit-param-pageid','s:115:\"de:Seitennummer der Seite, die bearbeitet werden soll. Kann nicht zusammen mit <var>$1title</var> verwendet werden.\";'),('de','messages:apihelp-edit-param-prependtext','s:88:\"de:Diesen Text an den Anfang der Seite oder des Abschnitts setzen. Überschreibt $1text.\";'),('de','messages:apihelp-edit-param-recreate','s:82:\"de:Keinen Fehler zurückgeben, wenn die Seite in der Zwischenzeit gelöscht wurde.\";'),('de','messages:apihelp-edit-param-redirect','s:41:\"de:Weiterleitungen automatisch auflösen.\";'),('de','messages:apihelp-edit-param-returnto','s:342:\"de:Seitentitel. Wenn durch das Speichern der Bearbeitung ein temporäres Konto erstellt wurde, antwortet die API möglicherweise mit einer URL, die der Client besuchen sollte, um die Anmeldung abzuschließen. Wenn dieser Parameter angegeben wird, wird die URL auf die angegebene Seite umgeleitet und nicht auf die Seite, die bearbeitet wurde.\";'),('de','messages:apihelp-edit-param-returntoanchor','s:265:\"en:URL fragment (with leading <kbd>#</kbd>). If saving the edit created a temporary account, the API may respond with an URL that the client should visit to complete logging in. If this parameter is provided, the URL will redirect to a page with the given fragment.\";'),('de','messages:apihelp-edit-param-returntoquery','s:281:\"en:URL query parameters (with leading <kbd>?</kbd>). If saving the edit created a temporary account, the API may respond with an URL that the client should visit to complete logging in. If this parameter is provided, the URL will redirect to a page with the given query parameters.\";'),('de','messages:apihelp-edit-param-section','s:171:\"de:Abschnittskennzeichen. <kbd>0</kbd> für die Einleitung, <kbd>new</kbd> für einen neuen Abschnitt. Meist eine positive ganze Zahl, kann aber auch nicht-numerisch sein.\";'),('de','messages:apihelp-edit-param-sectiontitle','s:93:\"de:Die Überschrift für einen neuen Abschnitt, wenn <var>$1section=new</var> verwendet wird.\";'),('de','messages:apihelp-edit-param-starttimestamp','s:323:\"de:Zeitstempel, an dem der Bearbeitungsprozess begonnen wurde. Er wird zum Aufspüren von Bearbeitungskonflikten verwendet. Ein geeigneter Wert kann mithilfe von <var>[[Special:ApiHelp/main|curtimestamp]]</var> beim Beginn des Bearbeitungsprozesses (z.&nbsp;B. beim Laden des Seiteninhalts zum Bearbeiten) abgerufen werden.\";'),('de','messages:apihelp-edit-param-summary','s:431:\"de:Bearbeitungszusammenfassung.\n\nWird dieser Parameter nicht angegeben oder ist er leer, wird [[mw:Special:MyLanguage/Autosummary|automatisch eine Bearbeitungszusammenfassung erstellt]].\n\nWenn <var>$1section=new</var> angegeben und <var>$1sectiontitle</var> nicht angegeben wird, wird stattdessen der Wert dieses Parameters für den Titel des Abschnitts verwendet, und es wird automatisch eine Bearbeitungszusammenfassung erstellt.\";'),('de','messages:apihelp-edit-param-tags','s:55:\"de:Auf die Version anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-edit-param-text','s:16:\"de:Seiteninhalt.\";'),('de','messages:apihelp-edit-param-title','s:109:\"de:Titel der Seite, die bearbeitet werden soll. Kann nicht zusammen mit <var>$1pageid</var> verwendet werden.\";'),('de','messages:apihelp-edit-param-token','s:106:\"de:Der Token sollte immer als letzter Parameter gesendet werden, zumindest aber nach dem $1text-Parameter.\";'),('de','messages:apihelp-edit-param-undo','s:91:\"de:Diese Version rückgängig machen. Überschreibt $1text, $1prependtext und $1appendtext.\";'),('de','messages:apihelp-edit-param-undoafter','s:124:\"de:Alle Versionen von $1undo bis zu dieser rückgängig machen. Falls nicht angegeben, nur eine Version rückgängig machen.\";'),('de','messages:apihelp-edit-param-unwatch','s:45:\"de:Seite von der Beobachtungsliste entfernen.\";'),('de','messages:apihelp-edit-param-watch','s:43:\"de:Seite der Beobachtungsliste hinzufügen.\";'),('de','messages:apihelp-edit-param-watchlist','s:203:\"de:Die Seite zur Beobachtungsliste des aktuellen Benutzers hinzufügen oder von ihr entfernen, die Standardeinstellungen (werden für Bot-Benutzer ignoriert) verwenden oder die Beobachtung nicht ändern.\";'),('de','messages:apihelp-edit-param-watchlistexpiry','s:140:\"de:Zeitstempel des Ablaufs der Beobachtungsliste. Lasse diesen Parameter ganz weg, damit der aktuelle Verfallszeitpunkt unverändert bleibt.\";'),('de','messages:apihelp-edit-summary','s:39:\"de:Erstellen und Bearbeiten von Seiten.\";'),('de','messages:apihelp-emailuser-example-email','s:91:\"de:Eine E-Mail an den Benutzer <kbd>WikiSysop</kbd> mit dem Text <kbd>Content</kbd> senden.\";'),('de','messages:apihelp-emailuser-param-ccme','s:43:\"de:Eine Kopie dieser E-Mail an mich senden.\";'),('de','messages:apihelp-emailuser-param-subject','s:16:\"de:Betreffzeile.\";'),('de','messages:apihelp-emailuser-param-target','s:52:\"de:Benutzer, an den die E-Mail gesendet werden soll.\";'),('de','messages:apihelp-emailuser-param-text','s:17:\"de:E-Mail-Inhalt.\";'),('de','messages:apihelp-emailuser-summary','s:35:\"de:E-Mail an einen Benutzer senden.\";'),('de','messages:apihelp-expandtemplates-example-simple','s:76:\"de:Den Wikitext <kbd><nowiki>{{Project:Sandbox}}</nowiki></kbd> expandieren.\";'),('de','messages:apihelp-expandtemplates-param-generatexml','s:60:\"de:XML-Parserbaum erzeugen (ersetzt durch $1prop=parsetree).\";'),('de','messages:apihelp-expandtemplates-param-includecomments','s:66:\"de:Ob HTML-Kommentare in der Ausgabe eingeschlossen werden sollen.\";'),('de','messages:apihelp-expandtemplates-param-prop','s:186:\"de:Welche Informationen abgerufen werden sollen.\n\nBeachte bitte, dass das Ergebnis Wikitext enthält, aber die Ausgabe in einem veralteten Format ist, falls keine Werte ausgewählt sind.\";'),('de','messages:apihelp-expandtemplates-param-revid','s:129:\"de:Versionsnummer, die für die Anzeige von <code><nowiki>{{REVISIONID}}</nowiki></code> und ähnlichen Variablen verwendet wird.\";'),('de','messages:apihelp-expandtemplates-param-showstrategykeys','s:104:\"de:Soll die Information über die interne Zusammenführungsstrategie in jsconfigvars aufgenommen werden?\";'),('de','messages:apihelp-expandtemplates-param-text','s:31:\"de:Zu konvertierender Wikitext.\";'),('de','messages:apihelp-expandtemplates-param-title','s:19:\"de:Titel der Seite.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-categories','s:95:\"de:Kategorien in der Eingabe vorhanden, die nicht in der Ausgabe des Wikitextes vertreten sind.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-encodedjsconfigvars','s:97:\"de:Gibt die JavaScript-Konfigurationsvariablen speziell für die Seite als JSON-Zeichenfolge aus.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-jsconfigvars','s:75:\"de:Gibt die JavaScript-Konfigurationsvariablen speziell für die Seite aus.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-modules','s:238:\"de:Etwaige Ressourcen-Lader-Module, die Parserfunktionen angefordert haben, werden zur Ausgabe hinzugefügt. Entweder <kbd>jsconfigvars</kbd> oder <kbd>encodedjsconfigvars</kbd> müssen gemeinsam mit <kbd>modules</kbd> angefordert werden.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-parsetree','s:34:\"de:Der XML-Parserbaum der Eingabe.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-properties','s:90:\"de:Seiteneigenschaften, die durch expandierte magische Wörter im Wikitext definiert sind.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-ttl','s:65:\"de:Die maximale Zeit, nach der der Ergebnis-Cache ungültig wird.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-volatile','s:104:\"de:Ob die Ausgabe flüchtig ist und nicht an anderer Stelle auf der Seite wiederverwendet werden sollte.\";'),('de','messages:apihelp-expandtemplates-paramvalue-prop-wikitext','s:28:\"de:Der expandierte Wikitext.\";'),('de','messages:apihelp-expandtemplates-summary','s:54:\"de:Alle Vorlagen innerhalb des Wikitextes expandieren.\";'),('de','messages:apihelp-feedcontributions-example-simple','s:62:\"de:Beiträge für die Benutzer <kbd>Beispiel<kbd> zurückgeben\";'),('de','messages:apihelp-feedcontributions-param-deletedonly','s:37:\"de:Nur gelöschte Beiträge anzeigen.\";'),('de','messages:apihelp-feedcontributions-param-feed