:\"de:Das Format des Feeds.\";'),('de','messages:apihelp-feedwatchlist-param-hours','s:87:\"de:Seiten auflisten, die innerhalb dieser Anzahl von Stunden ab jetzt geändert wurden.\";'),('de','messages:apihelp-feedwatchlist-param-linktosections','s:61:\"de:Verlinke direkt zum veränderten Abschnitt, wenn möglich.\";'),('de','messages:apihelp-feedwatchlist-summary','s:46:\"de:Gibt einen Beobachtungslisten-Feed zurück.\";'),('de','messages:apihelp-filerevert-example-revert','s:89:\"de:<kbd>Wiki.png</kbd> auf die Version vom <kbd>2011-03-05T15:27:40Z</kbd> zurücksetzen.\";'),('de','messages:apihelp-filerevert-param-archivename','s:72:\"de:Archivname der Version, auf die die Datei zurückgesetzt werden soll.\";'),('de','messages:apihelp-filerevert-param-comment','s:21:\"de:Hochladekommentar.\";'),('de','messages:apihelp-filerevert-param-filename','s:39:\"de:Ziel-Datei, ohne das Datei:-Präfix.\";'),('de','messages:apihelp-filerevert-summary','s:50:\"de:Eine Datei auf eine alte Version zurücksetzen.\";'),('de','messages:apihelp-format-example-generic','s:45:\"de:Das Abfrageergebnis im $1-Format ausgeben.\";'),('de','messages:apihelp-format-param-wrappedhtml','s:89:\"en:Return the pretty-printed HTML and associated ResourceLoader modules as a JSON object.\";'),('de','messages:apihelp-help-example-help','s:35:\"de:Hilfe für das Hilfemodul selbst\";'),('de','messages:apihelp-help-example-main','s:28:\"de:Hilfe für das Hauptmodul\";'),('de','messages:apihelp-help-example-query','s:36:\"de:Hilfe für zwei Abfrage-Submodule\";'),('de','messages:apihelp-help-example-recursive','s:29:\"de:Alle Hilfen in einer Seite\";'),('de','messages:apihelp-help-example-submodules','s:64:\"de:Hilfe für <kbd>action=query</kbd> und all seine Untermodule.\";'),('de','messages:apihelp-help-param-helpformat','s:28:\"de:Format der Hilfe-Ausgabe.\";'),('de','messages:apihelp-help-param-modules','s:183:\"de:Module, zu denen eine Hilfe angezeigt werden soll (Werte der Parameter <var>action</var> und <var>format</var> oder <kbd>main</kbd>). Kann Submodule mit einem <kbd>+</kbd> angeben.\";'),('de','messages:apihelp-help-param-recursivesubmodules','s:47:\"de:Hilfe für Submodule rekursiv einschließen.\";'),('de','messages:apihelp-help-param-submodules','s:59:\"de:Hilfe für Submodule des benannten Moduls einschließen.\";'),('de','messages:apihelp-help-param-toc','s:60:\"de:Ein Inhaltsverzeichnis in der HTML-Ausgabe einschließen.\";'),('de','messages:apihelp-help-param-wrap','s:67:\"de:Die Ausgabe in eine Standard-API-Antwort-Struktur einschließen.\";'),('de','messages:apihelp-help-summary','s:46:\"de:Hilfe für die angegebenen Module anzeigen.\";'),('de','messages:apihelp-imagerotate-example-generator','s:78:\"de:Alle Bilder in der <kbd>Kategorie:Flip</kbd> um <kbd>180</kbd> Grad drehen.\";'),('de','messages:apihelp-imagerotate-example-simple','s:62:\"de:<kbd>Datei:Beispiel.png</kbd> um <kbd>90</kbd> Grad drehen.\";'),('de','messages:apihelp-imagerotate-param-rotation','s:73:\"de:Anzahl der Grad, um die das Bild im Uhrzeigersinn gedreht werden soll.\";'),('de','messages:apihelp-imagerotate-param-tags','s:61:\"de:Auf den Eintrag im Datei-Logbuch anzuwendende Markierungen\";'),('de','messages:apihelp-imagerotate-summary','s:34:\"de:Ein oder mehrere Bilder drehen.\";'),('de','messages:apihelp-import-example-import','s:104:\"de:Importiere [[meta:Help:ParserFunctions]] mit der kompletten Versionsgeschichte in den Namensraum 100.\";'),('de','messages:apihelp-import-extended-description','s:180:\"de:Bitte beachte, dass der HTTP-POST-Vorgang als Dateiupload ausgeführt werden muss (z. B. durch multipart/form-data), um eine Datei über den <var>xml</var>-Parameter zu senden.\";'),('de','messages:apihelp-import-param-assignknownusers','s:90:\"de:Weist Bearbeitungen lokalen Benutzern zu, wo der benannte Benutzer lokal vorhanden ist.\";'),('de','messages:apihelp-import-param-fullhistory','s:103:\"de:Für Interwiki-Importe: Importiere die komplette Versionsgeschichte, nicht nur die aktuelle Version.\";'),('de','messages:apihelp-import-param-interwikipage','s:50:\"de:Für Interwiki-Importe: zu importierende Seite.\";'),('de','messages:apihelp-import-param-interwikiprefix','s:167:\"de:Für hochgeladene Importe: auf unbekannte Benutzernamen anzuwendendes Interwiki-Präfix (und bekannte Benutzer, falls <var>$1assignknownusers</var> festgelegt ist).\";'),('de','messages:apihelp-import-param-interwikisource','s:64:\"de:Für Interwiki-Importe: Wiki, von dem importiert werden soll.\";'),('de','messages:apihelp-import-param-namespace','s:100:\"de:In diesen Namensraum importieren. Kann nicht zusammen mit <var>$1rootpage</var> verwendet werden.\";'),('de','messages:apihelp-import-param-rootpage','s:108:\"de:Als Unterseite dieser Seite importieren. Kann nicht zusammen mit <var>$1namespace</var> verwendet werden.\";'),('de','messages:apihelp-import-param-summary','s:45:\"de:Importzusammenfassung des Logbucheintrags.\";'),('de','messages:apihelp-import-param-tags','s:121:\"de:Auf den Eintrag im Import-Logbuch und die Nullversion bei den importierten Seiten anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-import-param-templates','s:71:\"de:Für Interwiki-Importe: Importiere auch alle eingebundenen Vorlagen.\";'),('de','messages:apihelp-import-param-xml','s:26:\"de:Hochgeladene XML-Datei.\";'),('de','messages:apihelp-import-summary','s:73:\"de:Importiert eine Seite aus einem anderen Wiki oder von einer XML-Datei.\";'),('de','messages:apihelp-json-param-ascii','s:129:\"en:If specified, encodes all non-ASCII using hexadecimal escape sequences. Default when <var>formatversion</var> is <kbd>1</kbd>.\";'),('de','messages:apihelp-json-param-callback','s:157:\"de:Falls angegeben, wird die Ausgabe in einen angegebenen Funktionsaufruf eingeschlossen. Aus Sicherheitsgründen sind benutzerspezifische Daten beschränkt.\";'),('de','messages:apihelp-json-param-formatversion','s:22:\"de:Ausgabeformatierung\";'),('de','messages:apihelp-json-param-utf8','s:214:\"de:Kodiert, falls angegeben, die meisten (aber nicht alle) Nicht-ASCII-Zeichen als UTF-8, anstatt sie durch hexadezimale Escape-Sequenzen zu ersetzen. Standard, wenn <var>formatversion</var> nicht <kbd>1</kbd> ist.\";'),('de','messages:apihelp-json-paramvalue-formatversion-1','s:111:\"de:Abwärtskompatibles Format (Boolesche Werte im XML-Stil, <samp>*</samp>-Schlüssel für Inhaltsknoten usw.).\";'),('de','messages:apihelp-json-paramvalue-formatversion-2','s:19:\"de:Modernes Format.\";'),('de','messages:apihelp-json-paramvalue-formatversion-latest','s:92:\"de:Verwenden des neuesten Formats (derzeit <kbd>2</kbd>), kann sich ohne Vorwarnung ändern.\";'),('de','messages:apihelp-json-summary','s:33:\"de:Daten im JSON-Format ausgeben.\";'),('de','messages:apihelp-jsonfm-summary','s:58:\"de:Daten im JSON-Format ausgeben (schöngedruckt in HTML).\";'),('de','messages:apihelp-link','s:28:\"en:[[Special:ApiHelp/$1|$2]]\";'),('de','messages:apihelp-linkaccount-example-link','s:79:\"de:Startet den Prozess der Verknüpfung mit einem Konto von <kbd>Example</kbd>.\";'),('de','messages:apihelp-linkaccount-summary','s:82:\"de:Verbindet ein Benutzerkonto von einem Drittanbieter mit dem aktuellen Benutzer.\";'),('de','messages:apihelp-login-example-login','s:11:\"de:Anmelden\";'),('de','messages:apihelp-login-extended-description','s:302:\"de:Diese Aktion sollte nur in Kombination mit [[Special:BotPasswords]] verwendet werden. Die Verwendung für die Anmeldung beim Hauptkonto ist veraltet und kann ohne Warnung fehlschlagen. Um sich sicher beim Hauptkonto anzumelden, verwende <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('de','messages:apihelp-login-extended-description-nobotpasswords','s:166:\"de:Diese Aktion ist veraltet und kann ohne Vorwarnung fehlschlagen. Um dich sicher anzumelden, verwende <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('de','messages:apihelp-login-param-domain','s:21:\"de:Domain (optional).\";'),('de','messages:apihelp-login-param-name','s:16:\"de:Benutzername.\";'),('de','messages:apihelp-login-param-password','s:12:\"de:Passwort.\";'),('de','messages:apihelp-login-param-token','s:60:\"de:Anmeldetoken, den du in der ersten Anfrage erhalten hast.\";'),('de','messages:apihelp-login-summary','s:52:\"de:Anmelden und Authentifizierungs-Cookies beziehen.\";'),('de','messages:apihelp-logout-example-logout','s:35:\"de:Meldet den aktuellen Benutzer ab\";'),('de','messages:apihelp-logout-summary','s:44:\"de:Abmelden und alle Sitzungsdaten löschen.\";'),('de','messages:apihelp-main-extended-description','s:1442:\"de:<div class=\"hlist plainlinks api-main-links\">\n* [[mw:Special:MyLanguage/API:Main_page|Dokumentation]]\n* [[mw:Special:MyLanguage/API:Etiquette|Etikette & Nutzungsrichtlinien]]\n* [[mw:Special:MyLanguage/API:FAQ|Häufig gestellte Fragen]]\n* [https://lists.wikimedia.org/postorius/lists/mediawiki-api.lists.wikimedia.org/ Mailingliste]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce API-Ankündigungen]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Fehlerberichte und Anfragen]\n</div>\n<strong>Status:</strong> Die MediaWiki-API ist eine ausgereifte und stabile Schnittstelle, die aktiv unterstützt und verbessert wird. Während wir versuchen, dies zu vermeiden, können wir gelegentlich Breaking Changes erforderlich machen. Abonniere die [https://lists.wikimedia.org/hyperkitty/list/mediawiki-api-announce@lists.wikimedia.org/ MediaWiki-API-Ankündigungs-Mailingliste] für Mitteilungen zu Aktualisierungen.\n\n<strong>Fehlerhafte Anfragen:</strong> Wenn fehlerhafte Anfragen an die API gesendet werden, wird ein HTTP-Header mit dem Schlüssel „MediaWiki-API-Error“ gesendet. Der Wert des Headers und der Fehlercode werden auf den gleichen Wert gesetzt. Für weitere Informationen siehe [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Fehler und Warnungen]].\n\n<p class=\"mw-apisandbox-link\"><strong>Testen:</strong> Zum einfachen Testen von API-Anfragen, siehe [[Special:ApiSandbox]].</p>\";'),('de','messages:apihelp-main-param-action','s:25:\"de:Auszuführende Aktion.\";'),('de','messages:apihelp-main-param-assert','s:207:\"de:Sicherstellen, dass der Benutzer eingeloggt ist, wenn <kbd>user</kbd> gesetzt, <em>nicht</em> angemeldet, wenn auf <kbd>anon</kbd> gesetzt, oder das Bot-Benutzerrecht hat, wenn auf <kbd>bot</kbd> gesetzt.\";'),('de','messages:apihelp-main-param-assertuser','s:67:\"de:Überprüft, ob der aktuelle Benutzer der benannte Benutzer ist.\";'),('de','messages:apihelp-main-param-curtimestamp','s:42:\"de:Aktuellen Zeitstempel mit zurückgeben.\";'),('de','messages:apihelp-main-param-errorformat','s:68:\"de:Zu verwendendes Format zur Ausgabe von Warnungen und Fehlertexten\";'),('de','messages:apihelp-main-param-errorlang','s:389:\"de:Zu verwendende Sprache für Warnungen und Fehler. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> mit <kbd>siprop=languages</kbd> gibt eine Liste von Sprachcodes zurück, oder spezifiziere <kbd>content</kbd>, um die Inhaltssprache des Wikis zu verwenden, oder spezifiziere <kbd>uselang</kbd>, um denselben Wert wie der <var>uselang</var>-Parameter zu verwenden.\";'),('de','messages:apihelp-main-param-errorsuselocal','s:103:\"de:Falls angegeben, verwenden Fehlertexte lokalisierte Nachrichten aus dem {{ns:MediaWiki}}-Namensraum.\";'),('de','messages:apihelp-main-param-format','s:22:\"de:Format der Ausgabe.\";'),('de','messages:apihelp-main-param-maxage','s:121:\"de:Den <code>max-age</code>-HTTP-Cache-Control-Header auf diese Anzahl Sekunden festlegen. Fehler werden niemals gecacht.\";'),('de','messages:apihelp-main-param-maxlag','s:560:\"de:maxlag kann verwendet werden, wenn MediaWiki auf einem datenbankreplizierten Cluster installiert ist. Um weitere Replikationsrückstände zu verhindern, lässt dieser Parameter den Client warten, bis der Replikationsrückstand kleiner als der angegebene Wert (in Sekunden) ist. Bei einem größerem Rückstand wird der Fehlercode <samp>maxlag</samp> zurückgegeben mit einer Nachricht wie <samp>Waiting for $host: $lag seconds lagged</samp>.<br />Siehe [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Handbuch: Maxlag parameter]] für weitere Informationen.\";'),('de','messages:apihelp-main-param-origin','s:1130:\"de:Beim Zugriff auf die API mit einer Kreuz-Domain-AJAX-Anfrage (CORS) muss dies als entstehende Domäne festgelegt werden. Dies muss in jeder Vorfluganfrage mit eingeschlossen werden und deshalb ein Teil der Anfragen-URI sein (nicht des POST-Körpers).\n\nFür authentifizierte Anfragen muss dies exakt einem der Ursprünge im Header <code>Origin</code> entsprechen, so dass es auf etwas wie <kbd>https://de.wikipedia.org</kbd> oder <kbd>https://meta.wikimedia.org</kbd> festgelegt werden muss. Falls dieser Parameter nicht mit dem Header <code>Origin</code> übereinstimmt, wird eine 403-Antwort zurückgegeben. Falls dieser Parameter mit dem Header <code>Origin</code> übereinstimmt und der Ursprung erlaubt ist, werden die Header <code>Access-Control-Allow-Origin</code> und <code>Access-Control-Allow-Credentials</code> festgelegt.\n\nGib für nicht authentifizierte Anfragen den Wert <kbd>*</kbd> an. Dies verursacht, dass der Header <code>Access-Control-Allow-Origin</code> festgelegt wird, aber <code>Access-Control-Allow-Credentials</code> wird <code>false</code> sein und alle benutzerspezifischen Daten werden beschränkt.\";'),('de','messages:apihelp-main-param-requestid','s:117:\"de:Der angegebene Wert wird mit in die Antwort aufgenommen und kann zur Unterscheidung von Anfragen verwendet werden.\";'),('de','messages:apihelp-main-param-responselanginfo','s:105:\"de:Bezieht die für <var>uselang</var> und <var>errorlang</var> verwendeten Sprachen im Ergebnis mit ein.\";'),('de','messages:apihelp-main-param-servedby','s:50:\"de:Namen des bearbeitenden Hosts mit zurückgeben.\";'),('de','messages:apihelp-main-param-smaxage','s:124:\"de:Den <code>s-maxage</code>-HTTP-Cache-Control-Header auf diese Anzahl Sekunden festlegen. Fehler werden niemals gepuffert.\";'),('de','messages:apihelp-main-param-uselang','s:351:\"de:Zu verwendende Sprache für Nachrichtenübersetzungen. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> mit <kbd>siprop=languages</kbd> gibt eine Liste der Sprachcodes zurück. Gib <kbd>user</kbd> zum Verwenden der aktuellen Benutzerspracheinstellung oder <kbd>content</kbd> an, um die Inhaltssprache des Wikis zu verwenden.\";'),('de','messages:apihelp-main-param-variant','s:105:\"de:Variante der Sprache. Funktioniert nur, wenn die Basissprache die Variantenkonvertierung unterstützt.\";'),('de','messages:apihelp-main-paramvalue-errorformat-bc','s:118:\"de:Format, das vor MediaWiki 1.29 verwendet wurde. <var>errorlang</var> und <var>erroruselocal</var> werden ignoriert.\";'),('de','messages:apihelp-main-paramvalue-errorformat-html','s:7:\"en:HTML\";'),('de','messages:apihelp-main-paramvalue-errorformat-none','s:42:\"de:Keine Textausgabe, nur die Fehlercodes.\";'),('de','messages:apihelp-main-paramvalue-errorformat-plaintext','s:62:\"de:Wikitext mit entfernten HTML-Tags und ersetzten Entitäten.\";'),('de','messages:apihelp-main-paramvalue-errorformat-raw','s:39:\"de:Nachrichtenschlüssel und Parameter.\";'),('de','messages:apihelp-main-paramvalue-errorformat-wikitext','s:24:\"de:Ungeparster Wikitext.\";'),('de','messages:apihelp-main-summary','s:3:\"en:\";'),('de','messages:apihelp-managetags-example-activate','s:139:\"de:Aktiviert eine Markierung namens <kbd>spam</kbd> mit der Begründung <kbd>For use in edit patrolling</kbd> (für die Eingangskontrolle).\";'),('de','messages:apihelp-managetags-example-create','s:138:\"de:Erstellt eine Markierung namens <kbd>spam</kbd> mit der Begründung <kbd>For use in edit patrolling</kbd> (für die Eingangskontrolle).\";'),('de','messages:apihelp-managetags-example-deactivate','s:127:\"de:Deaktiviert eine Markierung namens <kbd>spam</kbd> mit der Begründung <kbd>No longer required</kbd> (nicht mehr benötigt).\";'),('de','messages:apihelp-managetags-example-delete','s:87:\"de:Löscht die <kbd>vandlaism</kbd>-Markierung mit der Begründung <kbd>Misspelt</kbd>.\";'),('de','messages:apihelp-managetags-param-ignorewarnings','s:46:\"de:Warnungen während des Vorgangs ignorieren.\";'),('de','messages:apihelp-managetags-param-operation','s:43:\"de:Welcher Vorgang soll ausgeführt werden:\";'),('de','messages:apihelp-managetags-param-reason','s:99:\"de:optionale Begründung für das Erstellen, Löschen, Aktivieren oder Deaktivieren der Markierung.\";'),('de','messages:apihelp-managetags-param-tag','s:372:\"de:Schlagwort zum Erstellen, Löschen, Aktivieren oder Deaktivieren. Zum Erstellen darf das Schlagwort noch nicht vorhanden sein. Zur Löschung muss das Schlagwort vorhanden sein. Zur Aktivierung muss das Schlagwort vorhanden sein, darf aber nicht von einer Erweiterung in Gebrauch sein. Zur Deaktivierung muss das Schlagwort gegenwärtig aktiv und manuell definiert sein.\";'),('de','messages:apihelp-managetags-param-tags','s:90:\"de:Auf den Eintrag im Markierungs-Verwaltungs-Logbuch anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-managetags-paramvalue-operation-activate','s:90:\"de:Ein Änderungsschlagwort aktivieren und damit Benutzern erlauben es manuell anzuwenden.\";'),('de','messages:apihelp-managetags-paramvalue-operation-create','s:67:\"de:Ein neues Änderungsschlagwort zum manuellen Gebrauch erstellen.\";'),('de','messages:apihelp-managetags-paramvalue-operation-deactivate','s:102:\"de:Ein Änderungsschlagwort deaktivieren und damit die manuelle Verwendung durch Benutzer unterbinden.\";'),('de','messages:apihelp-managetags-paramvalue-operation-delete','s:213:\"de:Ein Änderungsschlagwort aus der Datenbank entfernen. Einschließlich dem Entfernen des Schlagworts von allen Überarbeitungen, kürzlichen Änderungseinträgen und Logbuch-Einträgen, in denen es genutzt wird.\";'),('de','messages:apihelp-managetags-summary','s:61:\"de:Ermöglicht Verwaltungsaufgaben zu Änderungsmarkierungen.\";'),('de','messages:apihelp-mergehistory-example-merge','s:99:\"de:Fügt alle Versionen von <kbd>Oldpage</kbd> der Versionsgeschichte von <kbd>Newpage</kbd> hinzu.\";'),('de','messages:apihelp-mergehistory-example-merge-timestamp','s:119:\"en:Merge the page revisions of <kbd>Oldpage</kbd> dating up to <kbd>2015-12-31T04:37:41Z</kbd> into <kbd>Newpage</kbd>.\";'),('de','messages:apihelp-mergehistory-param-from','s:128:\"de:Titel der Seite, von der aus der Verlauf zusammengeführt wird. Kann nicht zusammen mit <var>$1fromid</var> verwendet werden.\";'),('de','messages:apihelp-mergehistory-param-fromid','s:141:\"de:Seiten-ID der Seite, von der aus die Versionsgeschichte zusammengeführt wird. Kann nicht zusammen mit <var>$1from</var> verwendet werden.\";'),('de','messages:apihelp-mergehistory-param-reason','s:58:\"de:Grund für die Zusammenführung der Versionsgeschichten\";'),('de','messages:apihelp-mergehistory-param-timestamp','s:211:\"en:Timestamp up to which revisions will be moved from the source page\'s history to the destination page\'s history. If omitted, the entire page history of the source page will be merged into the destination page.\";'),('de','messages:apihelp-mergehistory-param-to','s:101:\"en:Title of the page to which history will be merged. Cannot be used together with <var>$1toid</var>.\";'),('de','messages:apihelp-mergehistory-param-toid','s:101:\"en:Page ID of the page to which history will be merged. Cannot be used together with <var>$1to</var>.\";'),('de','messages:apihelp-mergehistory-summary','s:50:\"de:Führt Versionsgeschichten von Seiten zusammen.\";'),('de','messages:apihelp-move-example-move','s:99:\"de:<kbd>Badtitle</kbd> nach <kbd>Goodtitle</kbd> verschieben, ohne eine Weiterleitung zu erstellen.\";'),('de','messages:apihelp-move-param-from','s:99:\"de:Titel der zu verschiebenden Seite. Kann nicht zusammen mit <var>$1fromid</var> verwendet werden.\";'),('de','messages:apihelp-move-param-fromid','s:105:\"de:Seitenkennung der zu verschiebenden Seite. Kann nicht zusammen mit <var>$1from</var> verwendet werden.\";'),('de','messages:apihelp-move-param-ignorewarnings','s:29:\"de:Alle Warnungen ignorieren.\";'),('de','messages:apihelp-move-param-movesubpages','s:43:\"de:Unterseiten verschieben, falls möglich.\";'),('de','messages:apihelp-move-param-movetalk','s:52:\"de:Verschiebt die Diskussionsseite, falls vorhanden.\";'),('de','messages:apihelp-move-param-noredirect','s:33:\"de:Keine Weiterleitung erstellen.\";'),('de','messages:apihelp-move-param-reason','s:30:\"de:Grund für die Umbenennung.\";'),('de','messages:apihelp-move-param-tags','s:114:\"de:Auf den Eintrag im Verschiebungs-Logbuch und die Nullversion der Zielseite anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-move-param-to','s:49:\"de:Titel, zu dem die Seite umbenannt werden soll.\";'),('de','messages:apihelp-move-param-unwatch','s:83:\"de:Die Seite und die entstandene Weiterleitung von der Beobachtungsliste entfernen.\";'),('de','messages:apihelp-move-param-watch','s:81:\"de:Die Seite und die entstandene Weiterleitung zur Beobachtungsliste hinzufügen.\";'),('de','messages:apihelp-move-param-watchlist','s:194:\"de:Die Seite in jedem Fall zur Beobachtungsliste hinzufügen oder davon entfernen, die Benutzereinstellugen (für Bot-Benutzer ignoriert) dafür nutzen oder den Beobachtungsstatus nicht ändern.\";'),('de','messages:apihelp-move-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('de','messages:apihelp-move-summary','s:26:\"de:Eine Seite verschieben.\";'),('de','messages:apihelp-no-such-module','s:33:\"de:Modul „$1“ nicht gefunden.\";'),('de','messages:apihelp-none-summary','s:19:\"de:Nichts ausgeben.\";'),('de','messages:apihelp-opensearch-example-te','s:49:\"de:Seiten finden, die mit <kbd>Te</kbd> beginnen.\";'),('de','messages:apihelp-opensearch-param-format','s:26:\"de:Das Format der Ausgabe.\";'),('de','messages:apihelp-opensearch-param-limit','s:48:\"de:Maximale Anzahl zurückzugebender Ergebnisse.\";'),('de','messages:apihelp-opensearch-param-namespace','s:122:\"de:Zu durchsuchende Namensräume. Wird ignoriert, falls <var>$1search</var> mit einem gültigen Namensraumpräfix beginnt.\";'),('de','messages:apihelp-opensearch-param-redirects','s:50:\"de:Wie mit Weiterleitungen umgegangen werden soll:\";'),('de','messages:apihelp-opensearch-param-redirects-append','s:124:\"de:Aus Kompatibilitätsgründen ist für $1format=json die Vorgabe „return“ und „resolve“ für alle anderen Formate.\";'),('de','messages:apihelp-opensearch-param-search','s:21:\"de:Such-Zeichenfolge.\";'),('de','messages:apihelp-opensearch-param-suggest','s:26:\"de:Nicht länger verwendet\";'),('de','messages:apihelp-opensearch-param-warningsaserror','s:112:\"de:Wenn Warnungen mit <kbd>format=json</kbd> auftreten, gib einen API-Fehler zurück, anstatt ihn zu ignorieren.\";'),('de','messages:apihelp-opensearch-paramvalue-redirects-resolve','s:80:\"de:Gibt die Zielseite zurück. Kann weniger als $1limit Ergebnisse zurückgeben.\";'),('de','messages:apihelp-opensearch-paramvalue-redirects-return','s:41:\"de:Gibt die Weiterleitung selbst zurück.\";'),('de','messages:apihelp-opensearch-summary','s:59:\"de:Das Wiki mithilfe des OpenSearch-Protokolls durchsuchen.\";'),('de','messages:apihelp-options-example-change','s:70:\"de:Ändert die Einstellungen <kbd>skin</kbd> und <kbd>hideminor</kbd>.\";'),('de','messages:apihelp-options-example-complex','s:92:\"de:Setzt alle Einstellungen zurück, dann <kbd>skin</kbd> und <kbd>nickname</kbd> festlegen.\";'),('de','messages:apihelp-options-example-reset','s:35:\"de:Alle Einstellungen zurücksetzen\";'),('de','messages:apihelp-options-extended-description','s:239:\"de:Es können nur Optionen festgelegt werden, die im Kern oder in einer der installierten Erweiterungen registriert sind, oder Optionen mit Schlüsseln mit dem Präfix <code>userjs-</code> (zur Verwendung durch Benutzerskripte vorgesehen).\";'),('de','messages:apihelp-options-param-change','s:420:\"de:Liste von Änderungen, die mit name=wert formatiert sind (z.&nbsp;B. skin=vector). Falls kein Wert angegeben wurde (ohne Gleichheitszeichen), z.&nbsp;B. Optionname|AndereOption|…, wird die Option auf ihren Standardwert zurückgesetzt. Falls ein übergebener Wert ein Trennzeichen enthält (<kbd>|</kbd>), verwende den [[Special:ApiHelp/main#main/datatypes|alternativen Mehrfachwerttrenner]] zur korrekten Bedienung.\";'),('de','messages:apihelp-options-param-optionname','s:91:\"de:Der Name der Option, die auf den Wert von <var>$1optionvalue gesetzt werden soll</var> .\";'),('de','messages:apihelp-options-param-optionvalue','s:77:\"de:Der Wert für die Option, die durch <var>$1optionname</var> angegeben ist.\";'),('de','messages:apihelp-options-param-reset','s:56:\"de:Setzt die Einstellungen auf Websitestandards zurück.\";'),('de','messages:apihelp-options-param-resetkinds','s:97:\"de:Liste von zurückzusetzenden Optionstypen, wenn die <var>$1reset</var>-Option ausgewählt ist.\";'),('de','messages:apihelp-options-summary','s:61:\"de:Die Voreinstellungen des gegenwärtigen Benutzers ändern.\";'),('de','messages:apihelp-paraminfo-example-1','s:274:\"de:Zeige Info für <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, und <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('de','messages:apihelp-paraminfo-example-2','s:99:\"de:Zeigt Informationen für alle Untermodule von <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),('de','messages:apihelp-paraminfo-param-formatmodules','s:114:\"de:Liste von Formatmodulnamen (Wert des Parameters <var>format</var>). Stattdessen <var>$1modules</var> verwenden.\";'),('de','messages:apihelp-paraminfo-param-helpformat','s:34:\"de:Format der Hilfe-Zeichenfolgen.\";'),('de','messages:apihelp-paraminfo-param-mainmodule','s:112:\"de:Auch Informationen über die Hauptmodule (top-level) erhalten. Benutze <kbd>$1modules=main</kbd> stattdessen.\";'),('de','messages:apihelp-paraminfo-param-modules','s:248:\"de:Liste von Modulnamen (Werte der Parameter <var>action</var> und <var>format</var> oder <kbd>main</kbd>). Kann Untermodule mit einem <kbd>+</kbd> oder alle Untermodule mit <kbd>+*</kbd> oder alle Untermodule rekursiv mit <kbd>+**</kbd> bestimmen.\";'),('de','messages:apihelp-paraminfo-param-pagesetmodule','s:100:\"de:Abrufen von Informationen über das pageset-Modul (Bereitstellung von titles= und friends) sowie.\";'),('de','messages:apihelp-paraminfo-param-querymodules','s:187:\"de:Liste von Abfragemodulnamen (Werte von <var>prop</var>-, <var>meta</var>- oder <var>list</var>-Parameter). Benutze <kbd>$1modules=query+foo</kbd> anstatt <kbd>$1querymodules=foo</kbd>.\";'),('de','messages:apihelp-paraminfo-summary','s:42:\"de:Ruft Informationen über API-Module ab.\";'),('de','messages:apihelp-parse-example-page','s:21:\"de:Eine Seite parsen.\";'),('de','messages:apihelp-parse-example-summary','s:30:\"de:Parst eine Zusammenfassung.\";'),('de','messages:apihelp-parse-example-text','s:19:\"de:Wikitext parsen.\";'),('de','messages:apihelp-parse-example-texttitle','s:57:\"de:Parst den Wikitext über die Eingabe des Seitentitels.\";'),('de','messages:apihelp-parse-extended-description','s:503:\"en:See the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, <var>$1revid</var>, and <var>$1contentmodel</var>.\n# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.\";'),('de','messages:apihelp-parse-param-contentformat','s:117:\"de:Serialisierungsformat des Inhalts, das für den Eingabetext verwendet wird. Nur gültig bei Verwendung mit $1text.\";'),('de','messages:apihelp-parse-param-contentmodel','s:190:\"de:Inhaltsmodell des eingegebenen Textes. Fall ausgelassen, muss $1title angegeben werden und Standardwert wird das Modell des angegebenen Titels. Ist nur gültig im Zusammenhang mit $1text.\";'),('de','messages:apihelp-parse-param-disableeditsection','s:63:\"de:Lässt Abschnittsbearbeitungslinks in der Parserausgabe weg.\";'),('de','messages:apihelp-parse-param-disablelimitreport','s:84:\"de:Weglassen des Grenzwertberichts („NewPP limit report“) in der Parser-Ausgabe.\";'),('de','messages:apihelp-parse-param-disablepp','s:55:\"de:Benutze <var>$1disablelimitreport</var> stattdessen.\";'),('de','messages:apihelp-parse-param-disablestylededuplication','s:64:\"de:Inline-Stylesheets in der Parser-Ausgabe nicht deduplizieren.\";'),('de','messages:apihelp-parse-param-disabletoc','s:47:\"de:Inhaltsverzeichnis in der Ausgabe weglassen.\";'),('de','messages:apihelp-parse-param-effectivelanglinks','s:93:\"en:Includes language links supplied by extensions (for use with <kbd>$1prop=langlinks</kbd>).\";'),('de','messages:apihelp-parse-param-generatexml','s:109:\"en:Generate XML parse tree (requires content model <code>$1</code>; replaced by <kbd>$2prop=parsetree</kbd>).\";'),('de','messages:apihelp-parse-param-oldid','s:92:\"de:Parst den Inhalt dieser Version. Überschreibt <var>$1page</var> und <var>$1pageid</var>.\";'),('de','messages:apihelp-parse-param-onlypst','s:168:\"en:Do a pre-save transform (PST) on the input, but don\'t parse it. Returns the same wikitext, after a PST has been applied. Only valid when used with <var>$1text</var>.\";'),('de','messages:apihelp-parse-param-page','s:116:\"de:Parst den Inhalt dieser Seite. Kann nicht zusammen mit <var>$1text</var> und <var>$1title</var> verwendet werden.\";'),('de','messages:apihelp-parse-param-pageid','s:66:\"de:Parst den Inhalt dieser Seite. Überschreibt <var>$1page</var>.\";'),('de','messages:apihelp-parse-param-parsoid','s:105:\"de:Erzeugt HTML gemäß der [[mw:Specs/HTML|MediaWiki-DOM-Spezifikation]] mittels [[mw:Parsoid|Parsoid]].\";'),('de','messages:apihelp-parse-param-preview','s:27:\"de:Im Vorschaumodus parsen.\";'),('de','messages:apihelp-parse-param-prop','s:46:\"de:Welche Informationen bezogen werden sollen:\";'),('de','messages:apihelp-parse-param-pst','s:90:\"en:Do a pre-save transform on the input before parsing it. Only valid when used with text.\";'),('de','messages:apihelp-parse-param-redirects','s:107:\"de:Falls <var>$1page</var> oder <var>$1pageid</var> als eine Weiterleitung festgelegt ist, diese auflösen.\";'),('de','messages:apihelp-parse-param-revid','s:94:\"de:Versionskennung, für <code><nowiki>{{REVISIONID}}</nowiki></code> und ähnliche Variablen.\";'),('de','messages:apihelp-parse-param-section','s:259:\"de:Parst nur den Inhalt des Abschnitts mit diesem Bezeichner.\n\nFalls <kbd>new</kbd>, parst <var>$1text</var> und <var>$1sectiontitle</var>, als ob ein neuer Abschnitt der Seite hinzugefügt wird.\n\n<kbd>new</kbd> ist nur erlaubt mit der Angabe <var>text</var>.\";'),('de','messages:apihelp-parse-param-sectionpreview','s:78:\"de:Im Abschnitt Vorschau-Modus parsen (aktiviert ebenfalls den Vorschau-Modus)\";'),('de','messages:apihelp-parse-param-sectiontitle','s:220:\"de:Überschrift des neuen Abschnittes, wenn <var>section</var> = <kbd>new</kbd> ist.\n\nAnders als beim Bearbeiten der Seite wird der Parameter nicht durch die <var>summary</var> ersetzt, wenn er weggelassen oder leer ist.\";'),('de','messages:apihelp-parse-param-showstrategykeys','s:104:\"de:Soll die Information über die interne Zusammenführungsstrategie in jsconfigvars aufgenommen werden?\";'),('de','messages:apihelp-parse-param-summary','s:31:\"de:Zu parsende Zusammenfassung.\";'),('de','messages:apihelp-parse-param-text','s:115:\"de:Zu parsender Text. <var>$1title</var> oder <var>$1contentmodel</var> verwenden, um das Inhaltsmodell zu steuern.\";'),('de','messages:apihelp-parse-param-title','s:149:\"de:Titel der Seite, zu der der Text gehört. Falls ausgelassen, muss <var>$1contentmodel</var> angegeben werden und [[API]] wird als Titel verwendet.\";'),('de','messages:apihelp-parse-param-useskin','s:257:\"de:Wendet die ausgewählte Benutzeroberfläche auf die Parserausgabe an. Kann Auswirkungen auf die folgenden Eigenschaften haben: <kbd>text</kbd>, kbd>langlinks</kbd>, <kbd>headitems</kbd>, <kbd>modules</kbd>, <kbd>jsconfigvars</kbd>, <kbd>indicators</kbd>.\";'),('de','messages:apihelp-parse-param-wrapoutputclass','s:76:\"de:Zu verwendende CSS-Klasse, in der die Parserausgabe verpackt werden soll.\";'),('de','messages:apihelp-parse-paramvalue-prop-categories','s:53:\"de:Gibt die Kategorien im geparsten Wikitext zurück.\";'),('de','messages:apihelp-parse-paramvalue-prop-categorieshtml','s:48:\"de:Gibt die HTML-Version der Kategorien zurück.\";'),('de','messages:apihelp-parse-paramvalue-prop-displaytitle','s:47:\"de:Ergänzt den Titel des geparsten Wikitextes.\";'),('de','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars','s:97:\"de:Gibt die JavaScript-Konfigurationsvariablen speziell für die Seite als JSON-Zeichenfolge aus.\";'),('de','messages:apihelp-parse-paramvalue-prop-externallinks','s:57:\"de:Gibt die externen Links im geparsten Wikitext zurück.\";'),('de','messages:apihelp-parse-paramvalue-prop-headhtml','s:152:\"de:Gibt geparsten doctype, offenes <code>&lt;html&gt;</code>, das Element <code>&lt;head&gt;</code> und offenes <code>&lt;body&gt;</code> der Seite aus.\";'),('de','messages:apihelp-parse-paramvalue-prop-headitems','s:67:\"en:Gives items to put in the <code>&lt;head&gt;</code> of the page.\";'),('de','messages:apihelp-parse-paramvalue-prop-images','s:49:\"de:Gibt die Bilder im geparsten Wikitext zurück.\";'),('de','messages:apihelp-parse-paramvalue-prop-indicators','s:89:\"de:Gibt das HTML der Seitenstatusindikatoren zurück, die auf der Seite verwendet werden.\";'),('de','messages:apihelp-parse-paramvalue-prop-iwlinks','s:57:\"de:Gibt Interwiki-Links des geparsten Wikitextes zurück.\";'),('de','messages:apihelp-parse-paramvalue-prop-jsconfigvars','s:128:\"de:Gibt die JavaScript-Konfigurationsvariablen speziell für die Seite aus. Zur Anwendung verwende <code>mw.config.set()</code>.\";'),('de','messages:apihelp-parse-paramvalue-prop-langlinks','s:54:\"de:Gibt die Sprachlinks im geparsten Wikitext zurück.\";'),('de','messages:apihelp-parse-paramvalue-prop-limitreportdata','s:106:\"en:Gives the limit report in a structured way. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('de','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:106:\"en:Gives the HTML version of the limit report. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('de','messages:apihelp-parse-paramvalue-prop-links','s:57:\"de:Gibt die internen Links im geparsten Wikitext zurück.\";'),('de','messages:apihelp-parse-paramvalue-prop-modules','s:214:\"en:Gives the ResourceLoader modules used on the page. To load, use <code>mw.loader.using()</code>. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('de','messages:apihelp-parse-paramvalue-prop-parsetree','s:82:\"en:The XML parse tree of revision content (requires content model <code>$1</code>)\";'),('de','messages:apihelp-parse-paramvalue-prop-parsewarnings','s:87:\"de:Gibt die Warnungen aus, die beim Parsen des Inhalts aufgetreten sind (als Wikitext).\";'),('de','messages:apihelp-parse-paramvalue-prop-parsewarningshtml','s:83:\"de:Gibt die Warnungen aus, die beim Parsen des Inhalts aufgetreten sind (als HTML).\";'),('de','messages:apihelp-parse-paramvalue-prop-properties','s:85:\"de:Gibt verschiedene Eigenschaften zurück, die im geparsten Wikitext definiert sind.\";'),('de','messages:apihelp-parse-paramvalue-prop-revid','s:52:\"de:Ergänzt die Versionskennung der geparsten Seite.\";'),('de','messages:apihelp-parse-paramvalue-prop-sections','s:53:\"de:Gibt die Abschnitte im geparsten Wikitext zurück.\";'),('de','messages:apihelp-parse-paramvalue-prop-subtitle','s:61:\"de:Fügt den Seiten-Untertitel für die geparste Seite hinzu.\";'),('de','messages:apihelp-parse-paramvalue-prop-templates','s:51:\"de:Gibt die Vorlagen im geparsten Wikitext zurück.\";'),('de','messages:apihelp-parse-paramvalue-prop-text','s:50:\"de:Gibt den geparsten Text des Wikitextes zurück.\";'),('de','messages:apihelp-parse-paramvalue-prop-wikitext','s:59:\"de:Gibt den originalen Wikitext zurück, der geparst wurde.\";'),('de','messages:apihelp-parse-summary','s:55:\"de:Parst den Inhalt und gibt die Parserausgabe zurück.\";'),('de','messages:apihelp-patrol-example-rcid','s:52:\"de:Kontrolliert eine kürzlich getätigte Änderung.\";'),('de','messages:apihelp-patrol-example-revid','s:28:\"de:Kontrolliert eine Version\";'),('de','messages:apihelp-patrol-param-rcid','s:60:\"de:Letzte-Änderungen-Kennung, die kontrolliert werden soll.\";'),('de','messages:apihelp-patrol-param-revid','s:49:\"de:Versionskennung, die kontrolliert werden soll.\";'),('de','messages:apihelp-patrol-param-tags','s:72:\"de:Auf den Kontroll-Logbuch-Eintrag anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-patrol-summary','s:40:\"de:Kontrolliert eine Seite oder Version.\";'),('de','messages:apihelp-php-param-formatversion','s:22:\"de:Ausgabeformatierung\";'),('de','messages:apihelp-php-paramvalue-formatversion-1','s:111:\"de:Abwärtskompatibles Format (Boolesche Werte im XML-Stil, <samp>*</samp>-Schlüssel für Inhaltsknoten usw.).\";'),('de','messages:apihelp-php-paramvalue-formatversion-2','s:19:\"de:Modernes Format.\";'),('de','messages:apihelp-php-paramvalue-formatversion-latest','s:93:\"de:Verwenden des neuesten Formats (derzeit <kbd>2</kbd> ), kann sich ohne Vorwarnung ändern.\";'),('de','messages:apihelp-php-summary','s:47:\"de:Daten im serialisierten PHP-Format ausgeben.\";'),('de','messages:apihelp-phpfm-summary','s:72:\"de:Daten im serialisierten PHP-Format ausgeben (schöngedruckt in HTML).\";'),('de','messages:apihelp-protect-example-protect','s:22:\"de:Schützt eine Seite\";'),('de','messages:apihelp-protect-example-unprotect','s:150:\"de:Entsperrt eine Seite, indem die Einschränkungen durch den Schutz auf <kbd>all</kbd> gestellt werden (z.&nbsp;B. darf jeder die Aktion ausführen).\";'),('de','messages:apihelp-protect-example-unprotect2','s:72:\"de:Eine Seite entsperren, indem keine Einschränkungen übergeben werden\";'),('de','messages:apihelp-protect-param-cascade','s:192:\"de:Aktiviert den Kaskadenschutz (d.&nbsp;h. in dieser Seite eingebundene Vorlagen und Bilder werden geschützt). Wird ignoriert, falls keine der angegebenen Schutzebenen Kaskaden unterstützt.\";'),('de','messages:apihelp-protect-param-expiry','s:281:\"de:Zeitstempel des Schutzablaufs. Wenn nur ein Zeitstempel übergeben wird, ist dieser für alle Seitenschutze gültig. Um eine unendliche Schutzdauer festzulegen, kannst du die Werte <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> oder <kbd>never</kbd> übergeben.\";'),('de','messages:apihelp-protect-param-pageid','s:109:\"de:Seitenkennung der Seite, die du (ent-)sperren möchtest. Kann nicht zusammen mit $1title verwendet werden.\";'),('de','messages:apihelp-protect-param-protections','s:306:\"de:Listet die Schutzebenen nach dem Format <kbd>Aktion=Ebene</kbd> (z.&nbsp;B. <kbd>edit=sysop</kbd>) auf. Die Ebene <kbd>all</kbd> bedeutet, dass jeder die Aktion ausführen darf, z.&nbsp;B. keine Beschränkung.\n\n<strong>HINWEIS:</strong> Wenn eine Aktion nicht angegeben wird, wird deren Schutz entfernt.\";'),('de','messages:apihelp-protect-param-reason','s:53:\"de:Grund für den Seitenschutz oder dessen Aufhebung.\";'),('de','messages:apihelp-protect-param-tags','s:76:\"de:Auf den Seitenschutz-Logbuch-Eintrag anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-protect-param-title','s:102:\"de:Titel der Seite, die du (ent-)sperren möchtest. Kann nicht zusammen mit $1pageid verwendet werden.