ang','s:45:\"de:Gib Nachrichten in dieser Sprache zurück.\";'),('de','messages:apihelp-query+allmessages-param-messages','s:97:\"de:Welche Nachrichten ausgegeben werden sollen. <kbd>*</kbd> (Vorgabe) bedeutet alle Nachrichten.\";'),('de','messages:apihelp-query+allmessages-param-nocontent','s:72:\"de:Wenn gesetzt, füge nicht den Inhalt der Nachricht der Ausgabe hinzu.\";'),('de','messages:apihelp-query+allmessages-param-prefix','s:46:\"de:Gib Nachrichten mit diesem Präfix zurück.\";'),('de','messages:apihelp-query+allmessages-param-prop','s:34:\"de:Zurückzugebende Eigenschaften.\";'),('de','messages:apihelp-query+allmessages-param-title','s:120:\"de:Seitenname, der als Kontext verwendet werden soll, wenn eine Nachricht geparst wird (für die $1enableparser-Option).\";'),('de','messages:apihelp-query+allmessages-param-to','s:55:\"de:Gib Nachrichten bei dieser Nachricht endend zurück.\";'),('de','messages:apihelp-query+allmessages-summary','s:47:\"de:Gibt Nachrichten von dieser Website zurück.\";'),('de','messages:apihelp-query+allpages-example-b','s:79:\"de:Bezieht eine Liste von Seiten, die mit dem Buchstaben <kbd>B</kbd> beginnen.\";'),('de','messages:apihelp-query+allpages-example-generator','s:87:\"de:Gibt Informationen über vier Seiten mit dem Anfangsbuchstaben <kbd>T</kbd> zurück.\";'),('de','messages:apihelp-query+allpages-example-generator-revisions','s:115:\"de:Übermittelt den Inhalt der ersten beiden Seiten, die mit <kbd>Re</kbd> beginnen und keine Weiterleitungen sind.\";'),('de','messages:apihelp-query+allpages-param-dir','s:24:\"de:Aufzählungsrichtung.\";'),('de','messages:apihelp-query+allpages-param-filterlanglinks','s:139:\"de:Nur Seiten auflisten, die Sprachlinks haben. Beachte, dass von Erweiterungen gesetzte Sprachlinks möglicherweise nicht beachtet werden.\";'),('de','messages:apihelp-query+allpages-param-filterredir','s:43:\"de:Welche Seiten aufgelistet werden sollen.\";'),('de','messages:apihelp-query+allpages-param-from','s:53:\"de:Seitentitel, 