).\";'),('de','messages:apihelp-query+blocks-param-ip','s:264:\"de:Abrufen aller Blöcke, die für diese IP-Adresse oder diesen CIDR-Bereich gelten, einschließlich der Bereichsblöcke.\nKann nicht zusammen mit <var>$3users<var> verwendet werden. CIDR-Bereiche, die breiter als IPv4/$1 oder IPv6/$2 sind, werden nicht akzeptiert.\";'),('de','messages:apihelp-query+blocks-param-limit','s:48:\"de:Die maximale Zahl der aufzulistenden Sperren.\";'),('de','messages:apihelp-query+blocks-param-prop','s:34:\"de:Zurückzugebende Eigenschaften:\";'),('de','messages:apihelp-query+blocks-param-show','s:150:\"de:Zeige nur Elemente, die diese Kriterien erfüllen. Um zum Beispiel unbestimmte Sperren von IP-Adressen zu sehen, setzte <kbd>$1show=ip|!temp</kbd>.\";'),('de','messages:apihelp-query+blocks-param-start','s:58:\"de:Der Zeitstempel, bei dem die Aufzählung beginnen soll.\";'),('de','messages:apihelp-query+blocks-param-users','s:66:\"de:Liste von Benutzern, nach denen gesucht werden soll (optional).\";'),('de','messages:apihelp-query+blocks-paramvalue-prop-by','s:58:\"de:Fügt den Benutzernamen des sperrenden Benutzers hinzu.\";'),('de','messages:apihelp-query+blocks-paramvalue-prop-byid','s:56:\"de:Fügt die Benutzer-ID des sperrenden Benutzers hinzu.\";'),('de','messages:apihelp-query+blocks-paramvalue-prop-expiry','s:58:\"de:Fügt den Zeitstempel, wann die Sperre abläuft, hinzu.\";'),('de','messages:apihelp-query+blocks-paramvalue-prop-flags','s:55:\"de:Markiert die Sperre mit (autoblock, anononly, etc.).\";'),('de','messages:apihelp-query+blocks-paramvalue-prop-id','s:33:\"de:Fügt die ID der Sperre hinzu.\";'),('de','messages:apihelp-query+blocks-paramvalue-prop-range','s:72:\"de:Fügt den von der Sperrung betroffenen Bereich von IP-Adressen hinzu.\";'),('de','messages:apihelp-query+blocks-paramvalue-prop-reason','s:55:\"de:Fügt den angegebenen Grund für die Sperrung hinzu.\";'),('de','messages:apihelp-query+blocks-paramvalue-prop-restrictions','s:103:\"de:Ergänzt die Beschränkungen