ry+categories-paramvalue-prop-timestamp','s:69:\"de:Fügt einen Zeitstempel, wann die Kategorie angelegt wurde, hinzu.\";'),('de','messages:apihelp-query+categories-summary','s:59:\"de:Liste alle Kategorien auf, zu denen die Seiten gehören.\";'),('de','messages:apihelp-query+categoryinfo-example-simple','s:83:\"de:Erhalte Informationen über <kbd>Category:Foo</kbd> und <kbd>Category:Bar</kbd>.\";'),('de','messages:apihelp-query+categoryinfo-summary','s:60:\"de:Gibt Informationen zu den angegebenen Kategorien zurück.\";'),('de','messages:apihelp-query+categorymembers-example-generator','s:90:\"de:Rufe die Seiteninformationen zu den ersten 10 Seiten von<kbd>Category:Physics</kbd> ab.\";'),('de','messages:apihelp-query+categorymembers-example-simple','s:64:\"de:Rufe die ersten 10 Seiten von <kbd>Category:Physics</kbd> ab.\";'),('de','messages:apihelp-query+categorymembers-param-dir','s:23:\"de:Sortierungsrichtung.\";'),('de','messages:apihelp-query+categorymembers-param-end','s:116:\"de:Zeitstempel, bei dem die Auflistung enden soll. Darf nur zusammen mit <kbd>$1sort=timestamp</kbd> benutzt werden.\";'),('de','messages:apihelp-query+categorymembers-param-endhexsortkey','s:169:\"de:Suchschlüssel, bei dem die Auflistung enden soll, wie von <kbd>$1prop=sortkey</kbd> zurückgegeben. Darf nur zusammen mit <kbd>$1sort=sortkey</kbd> verwendet werden.\";'),('de','messages:apihelp-query+categorymembers-param-endsortkey','s:41:\"de:Stattdessen $1endhexsortkey verwenden.\";'),('de','messages:apihelp-query+categorymembers-param-endsortkeyprefix','s:195:\"en:Sortkey prefix to end listing <strong>before</strong> (not <strong>at</strong>; if this value occurs it will not be included!). Can only be used with $1sort=sortkey. Overrides $1endhexsortkey.\";'),('de','messages:apihelp-query+categorymembers-param-limit','s:52:\"de:Die maximale Anzahl der zurückzugebenden Seiten.\";'),('de','messages:apihelp-query+categorymembers-param-namespace','s:169:\"en:Only include pages in these namespace