s:apihelp-query+filerepoinfo-paramvalue-prop-apiurl','s:81:\"de:URL zur Repositoriums-API. Nützlich zum Abruf von Bildinformationen vom Host.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-articlepath','s:109:\"en:Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgArticlePath|$wgArticlePath]]</var> or equivalent.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-canUpload','s:93:\"en:Whether files can be uploaded to this repository, e.g. via CORS and shared authentication.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-displayname','s:50:\"de:Der menschenlesbare Name des Repositoriumwikis.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-favicon','s:105:\"en:Repository wiki\'s favicon URL, from <var>[[mw:Special:MyLanguage/Manual:$wgFavicon|$wgFavicon]]</var>.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-fetchDescription','s:109:\"en:Whether file description pages are fetched from this repository when viewing local file description pages.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-initialCapital','s:61:\"de:Ob Dateinamen implizit mit einem Großbuchstaben beginnen.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-local','s:52:\"de:Ob dieses Repositorium das lokale ist oder nicht.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-name','s:192:\"en:The key of the repository - used in e.g. <var>[[mw:Special:MyLanguage/Manual:$wgForeignFileRepos|$wgForeignFileRepos]]</var> and [[Special:ApiHelp/query+imageinfo|imageinfo]] return values.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-rootUrl','s:34:\"de:Wurzel-URL-Pfad für Bildpfade.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-scriptDirUrl','s:73:\"de:Wurzel-URL-Pfad für die MediaWiki-Installation des Repositoriumwikis.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-server','s:99:\"en:Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgServer|$wgServer]]</var> or equivalent.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-thumbUrl','s:42:\"de:Wurzel-URL-Pfad für Vorschaubildpfade.\";'),('de','messages:apihelp-query+filerepoinfo-paramvalue-prop-url','s:35:\"de:URL-Pfad der öffentlichen Zone.\";'),('de','messages:apihelp-query+filerepoinfo-summary','s:88:\"de:Gib Metainformationen über Bild-Repositorien zurück, die im Wiki eingerichtet sind.\";'),('de','messages:apihelp-query+fileusage-example-generator','s:73:\"de:Zeige Informationen über Seiten, die [[:File:Example.jpg]] verwenden.\";'),('de','messages:apihelp-query+fileusage-example-simple','s:68:\"de:Zeige eine Liste von Seiten, die [[:File:Example.jpg]] verwenden.\";'),('de','messages:apihelp-query+fileusage-param-limit','s:39:\"de:Wie viel zurückgegeben werden soll.\";'),('de','messages:apihelp-query+fileusage-param-namespace','s:44:\"de:Nur Seiten dieser Namensräume einbinden.\";'),('de','messages:apihelp-query+fileusage-param-prop','s:34:\"de:Zurückzugebende Eigenschaften:\";'),('de','messages:apihelp-query+fileusage-param-show','s:44:\"en:Show only items that meet these criteria:\";'),('de','messages:apihelp-query+fileusage-paramvalue-prop-pageid','s:29:\"de:Seitenkennung jeder Seite.\";'),('de','messages:apihelp-query+fileusage-paramvalue-prop-redirect','s:53:\"de:Markieren, falls die Seite eine Weiterleitung ist.\";'),('de','messages:apihelp-query+fileusage-paramvalue-prop-title','s:21:\"de:Titel jeder Seite.\";'),('de','messages:apihelp-query+fileusage-paramvalue-show-!redirect','s:38:\"de:Nur Nicht-Weiterleitungen anzeigen.\";'),('de','messages:apihelp-query+fileusage-paramvalue-show-redirect','s:32:\"de:Nur Weiterleitungen anzeigen.\";'),('de','messages:apihelp-query+fileusage-summary','s:61:\"de:Alle Seiten finden, die die angegebenen Dateien verwenden.\";'),('de','messages:apihelp-query+imageinfo-example-dated','s:85:\"de:Rufe Informationen über Versionen von [[:File:Test.jpg]] von 2008 und später ab.\";'),('de','messages:apihelp-query+imageinfo-example-simple','s:91:\"de:Rufe Informationen über die aktuelle Version von [[:File:Albert Einstein Head.jpg]] ab.\";'),('de','messages:apihelp-query+imageinfo-param-badfilecontexttitle','s:135:\"de:Falls <kbd>$2prop=badfile</kbd> festgelegt ist, ist dies der verwendete Seitentitel beim Auswerten der [[MediaWiki:Bad image list]].\";'),('de','messages:apihelp-query+imageinfo-param-end','s:44:\"de:Zeitstempel, an dem die Liste enden soll.\";'),('de','messages:apihelp-query+imageinfo-param-extmetadatafilter','s:87:\"en:If specified and non-empty, only these keys will be returned for $1prop=extmetadata.\";'),('de','messages:apihelp-query+imageinfo-param-extmetadatalanguage','s:183:\"en:What language to fetch extmetadata in. This affects both which translation to fetch, if multiple are available, as well as how things like numbers and various values are formatted.\";'),('de','messages:apihelp-query+imageinfo-param-extmetadatamultilang','s:77:\"en:If translations for extmetadata property are available, fetch all of them.\";'),('de','messages:apihelp-query+imageinfo-param-limit','s:67:\"de:Wie viele Dateiversionen pro Datei zurückgegeben werden sollen.\";'),('de','messages:apihelp-query+imageinfo-param-localonly','s:50:\"de:Suche nur nach Dateien im lokalen Repositorium.\";'),('de','messages:apihelp-query+imageinfo-param-metadataversion','s:139:\"en:Version of metadata to use. If <kbd>latest</kbd> is specified, use latest version. Defaults to <kbd>1</kbd> for backwards compatibility.\";'),('de','messages:apihelp-query+imageinfo-param-prop','s:53:\"de:Welche Dateiinformationen abgerufen werden sollen:\";'),('de','messages:apihelp-query+imageinfo-param-start','s:48:\"de:Zeitstempel, von dem die Liste beginnen soll.\";'),('de','messages:apihelp-query+imageinfo-param-urlheight','s:27:\"de:Ähnlich wie $1urlwidth.\";'),('de','messages:apihelp-query+imageinfo-param-urlparam','s:173:\"en:A handler specific parameter string. For example, PDFs might use <kbd>page15-100px</kbd>. <var>$1urlwidth</var> must be used and be consistent with <var>$1urlparam</var>.\";'),('de','messages:apihelp-query+imageinfo-param-urlwidth','s:177:\"en:If $2prop=url is set, a URL to an image scaled to this width will be returned.\nFor performance reasons if this option is used, no more than $1 scaled images will be returned.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-archivename','s:182:\"de:Fügt den Dateinamen der Archivversion für die nicht-letzten Versionen hinzu. Wenn die Datei versionsgelöscht wurde, wird die Eigenschaft <samp>filehidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-badfile','s:67:\"de:Ergänzt, ob die Datei auf der [[MediaWiki:Bad image list]] ist.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-bitdepth','s:141:\"de:Fügt die Bittiefe der Version hinzu. Wenn die Datei versionsgelöscht wurde, wird die Eigenschaft <samp>filehidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-canonicaltitle','s:150:\"de:Ergänzt den kanonischen Titel für die Datei. Wenn die Datei versionsgelöscht wurde, wird die Eigenschaft <samp>filehidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-comment','s:136:\"de:Kommentar zu der Version. Wenn der Kommentar versionsgelöscht wurde, wird die Eigenschaft <samp>commenthidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-commonmetadata','s:173:\"de:Listet allgemeine Metadaten des Dateiformats dieser Dateiversion auf. Wenn die Datei versionsgelöscht wurde, wird die Eigenschaft <samp>filehidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-dimensions','s:26:\"de:Alias für die Größe.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-extmetadata','s:205:\"de:Listet formatierte Metadaten kombiniert aus mehreren Quellen auf. Die Ergebnisse sind im HTML-Format. Wenn die Datei versionsgelöscht wurde, wird die Eigenschaft <samp>filehidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-mediatype','s:143:\"de:Fügt den Medientyp dieser Datei hinzu. Wenn die Datei versionsgelöscht wurde, wird die Eigenschaft <samp>filehidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-metadata','s:154:\"de:Listet die Exif-Metadaten dieser Dateiversion auf. Wenn die Datei versionsgelöscht wurde, wird die Eigenschaft <samp>filehidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-mime','s:142:\"de:Fügt den MIME-Typ dieser Datei hinzu. Wenn die Datei versionsgelöscht wurde, wird die Eigenschaft <samp>filehidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-parsedcomment','s:152:\"de:Analysiere den Kommentar zu dieser Version. Wenn die Version versionsgelöscht wurde, wird die Eigenschaft <samp>commenthidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-sha1','s:152:\"de:Fügt die SHA-1-Prüfsumme für die Datei hinzu. Wenn die Datei versionsgelöscht wurde, wird die Eigenschaft <samp>filehidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-size','s:101:\"de:Fügt die Größe der Datei in Bytes und (falls zutreffend) in Höhe, Breite und Seitenzahl hinzu.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-thumbmime','s:202:\"de:Fügt den MIME-Typ der Miniaturansicht des Bildes hinzu (erfordert URL und Parameter $1urlwidth). Wenn die Datei versionsgelöscht wurde, wird eine <samp>filehidden</samp>-Eigenschaft zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-timestamp','s:63:\"de:Fügt einen Zeitstempel für die hochgeladene Version hinzu.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-uploadwarning','s:174:\"de:Wird von der Seite Spezial:Hochladen verwendet, um Informationen zu einer vorhandenen Datei abzurufen. Nicht für die Verwendung außerhalb des MediaWiki-Cores vorgesehen.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-url','s:159:\"de:Gibt die URL zur Datei- und Beschreibungsseite zurück. Wenn die Datei versionsgelöscht wurde, wird die Eigenschaft <samp>filehidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-user','s:168:\"de:Fügt den Benutzer zu jeder hochgeladenen Dateiversion hinzu. Wenn der Benutzer versionsgelöscht wurde, wird die Eigenschaft <samp>userhidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-paramvalue-prop-userid','s:176:\"de:Füge die ID des Benutzers zu jeder hochgeladenen Dateiversion hinzu. Wenn der Benutzer versionsgelöscht wurde, wird die Eigenschaft <samp>userhidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+imageinfo-summary','s:59:\"de:Gibt Informationen und alle Versionen der Datei zurück.\";'),('de','messages:apihelp-query+images-example-generator','s:107:\"de:Rufe Informationen über alle Dateien ab, die auf der Seite [[{{MediaWiki:Mainpage}}]] verwendet werden.\";'),('de','messages:apihelp-query+images-example-simple','s:97:\"de:Rufe eine Liste von Dateien ab, die auf der Seite [[{{MediaWiki:Mainpage}}]] verwendet werden.\";'),('de','messages:apihelp-query+images-param-dir','s:27:\"de:Die Auflistungsrichtung.\";'),('de','messages:apihelp-query+images-param-images','s:112:\"de:Nur diese Dateien auflisten. Nützlich, um zu prüfen, ob eine bestimmte Seite eine bestimmte Datei enthält.\";'),('de','messages:apihelp-query+images-param-limit','s:50:\"de:Wie viele Dateien zurückgegeben werden sollen.\";'),('de','messages:apihelp-query+images-summary','s:75:\"de:Gibt alle Dateien zurück, die in den angegebenen Seiten enthalten sind.\";'),('de','messages:apihelp-query+imageusage-example-generator','s:77:\"de:Rufe Informationen über Seiten mit [[:File:Albert Einstein Head.jpg]] ab.\";'),('de','messages:apihelp-query+imageusage-example-simple','s:66:\"de:Zeige Seiten, die [[:File:Albert Einstein Head.jpg]] verwenden.\";'),('de','messages:apihelp-query+imageusage-param-dir','s:27:\"de:Die Auflistungsrichtung.\";'),('de','messages:apihelp-query+imageusage-param-filterredir','s:124:\"en:How to filter for redirects. If set to nonredirects when $1redirect is enabled, this is only applied to the second level.\";'),('de','messages:apihelp-query+imageusage-param-limit','s:182:\"en:How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('de','messages:apihelp-query+imageusage-param-namespace','s:32:\"de:Der aufzulistende Namensraum.\";'),('de','messages:apihelp-query+imageusage-param-pageid','s:97:\"de:Seitenkennung, nach der gesucht werden soll. Darf nicht zusammen mit $1title verwendet werden.\";'),('de','messages:apihelp-query+imageusage-param-redirect','s:157:\"de:Falls die verweisende Seite eine Weiterleitung ist, finde alle Seiten, die ebenfalls auf diese Weiterleitung verweisen. Die maximale Grenze wird halbiert.\";'),('de','messages:apihelp-query+imageusage-param-title','s:90:\"de:Titel, nach dem gesucht werden soll. Darf nicht zusammen mit $1pageid verwendet werden.\";'),('de','messages:apihelp-query+imageusage-summary','s:62:\"de:Finde alle Seiten, die den angegebenen Bildtitel verwenden.\";'),('de','messages:apihelp-query+info-example-protection','s:84:\"en:Get general and protection information about the page [[{{MediaWiki:Mainpage}}]].\";'),('de','messages:apihelp-query+info-example-simple','s:68:\"de:Ruft Informationen über die Seite [[{{MediaWiki:Mainpage}}]] ab.\";'),('de','messages:apihelp-query+info-param-editintrocustom','s:64:\"en:Title of a custom page to use as an additional intro message.\";'),('de','messages:apihelp-query+info-param-editintroskip','s:169:\"en:List of intro messages to remove from the response. Use this if a specific message is not relevant to your tool, or if the information is conveyed in a different way.\";'),('de','messages:apihelp-query+info-param-editintrostyle','s:138:\"en:Some intro messages come with optional wrapper frames. Use <kbd>moreframes</kbd> to include them or <kbd>lessframes</kbd> to omit them.\";'),('de','messages:apihelp-query+info-param-linkcontext','s:165:\"de:Der Kontexttitel, der bei der Ermittlung von zusätzlichen CSS-Klassen (z. B. Link-Farben) verwendet wird, wenn <var>$1prop</var> <var>linkclasses</var> enthält.\";'),('de','messages:apihelp-query+info-param-preloadcustom','s:54:\"en:Title of a custom page to use as preloaded content.\";'),('de','messages:apihelp-query+info-param-preloadnewsection','s:82:\"en:Return preloaded content for a new section on the page, rather than a new page.\";'),('de','messages:apihelp-query+info-param-preloadparams','s:66:\"en:Parameters for the custom page being used as preloaded content.\";'),('de','messages:apihelp-query+info-param-prop','s:46:\"de:Zusätzlich zurückzugebende Eigenschaften:\";'),('de','messages:apihelp-query+info-param-testactions','s:88:\"de:Überprüft, ob der aktuelle Benutzer gewisse Aktionen auf der Seite ausführen kann.\";'),('de','messages:apihelp-query+info-param-testactionsautocreate','s:113:\"de:Prüfen, ob die Durchführung von <var>$1testactions</var> automatisch ein temporäres Konto erstellen würde.\";'),('de','messages:apihelp-query+info-param-testactionsdetail','s:199:\"en:Detail level for <var>$1testactions</var>. Use the [[Special:ApiHelp/main|main module]]\'s <var>errorformat</var> and <var>errorlang</var> parameters to control the format of the messages returned.\";'),('de','messages:apihelp-query+info-paraminfo-editintroonly','s:76:\"de:Wird nur verwendet, wenn <var>$3prop</var> <var>editintro</var> enthält.\";'),('de','messages:apihelp-query+info-paraminfo-preloadcontentonly','s:81:\"de:Wird nur verwendet, wenn <var>$3prop</var> <var>preloadcontent</var> enthält.\";'),('de','messages:apihelp-query+info-paramvalue-prop-associatedpage','s:124:\"de:Der Titel mit Präfix des [[:mw:Special:MyLanguage/Help:Associated_pages|assoziierten Themas oder der Diskussionsseite]].\";'),('de','messages:apihelp-query+info-paramvalue-prop-displaytitle','s:81:\"de:Gibt die Art und Weise an, in der der Seitentitel tatsächlich angezeigt wird.\";'),('de','messages:apihelp-query+info-paramvalue-prop-editintro','s:106:\"en:Gives the intro messages that should be shown to the user while editing this page or revision, as HTML.\";'),('de','messages:apihelp-query+info-paramvalue-prop-linkclasses','s:194:\"de:Gibt die zusätzlichen CSS-Klassen (z. B. Link-Farben) an, die für Links auf diese Seite verwendet werden, wenn sie auf der durch <var>$1linkcontext</var> benannten Seite erscheinen würden.\";'),('de','messages:apihelp-query+info-paramvalue-prop-notificationtimestamp','s:68:\"de:Der Beobachtungslisten-Benachrichtigungs-Zeitstempel jeder Seite.\";'),('de','messages:apihelp-query+info-paramvalue-prop-preload','s:175:\"de:Gibt den Text aus, der von EditFormPreloadText zurückgegeben wurde. Verwende lieber <kbd>preloadcontent</kbd>, das auch andere Arten von vorab geladenem Text unterstützt.\";'),('de','messages:apihelp-query+info-paramvalue-prop-preloadcontent','s:143:\"de:Gibt den Inhalt an, der im Editor angezeigt werden soll, wenn die Seite nicht existiert oder während ein neuer Abschnitt hinzugefügt wird.\";'),('de','messages:apihelp-query+info-paramvalue-prop-protection','s:41:\"de:Liste die Schutzstufe jeder Seite auf.\";'),('de','messages:apihelp-query+info-paramvalue-prop-readable','s:95:\"de:Ob der Benutzer diese Seite lesen kann. Stattdessen <kbd>intestactions=read</kbd> verwenden.\";'),('de','messages:apihelp-query+info-paramvalue-prop-subjectid','s:60:\"de:Die Seitenkennung der Elternseite jeder Diskussionsseite.\";'),('de','messages:apihelp-query+info-paramvalue-prop-talkid','s:75:\"de:Die Seitenkennung der Diskussionsseite für jede Nicht-Diskussionsseite.\";'),('de','messages:apihelp-query+info-paramvalue-prop-url','s:95:\"de:Gibt eine vollständige URL, eine bearbeitete URL und die kanonische URL für jede Seite an.\";'),('de','messages:apihelp-query+info-paramvalue-prop-varianttitles','s:79:\"de:Gibt den Anzeigetitel in allen Varianten der Sprache des Websiteinhalts aus.\";'),('de','messages:apihelp-query+info-paramvalue-prop-visitingwatchers','s:118:\"de:Die Anzahl der Beobachter jeder Seite, die die letzten Änderungen an dieser Seite besucht haben, sofern zulässig.\";'),('de','messages:apihelp-query+info-paramvalue-prop-watched','s:50:\"de:Liste den Überwachungszustand jeder Seite auf.\";'),('de','messages:apihelp-query+info-paramvalue-prop-watchers','s:44:\"de:Die Anzahl der Beobachter, falls erlaubt.\";'),('de','messages:apihelp-query+info-paramvalue-testactionsdetail-boolean','s:55:\"de:Gibt einen booleschen Wert für jede Aktion zurück.\";'),('de','messages:apihelp-query+info-paramvalue-testactionsdetail-full','s:124:\"de:Gibt Meldungen zurück, die beschreiben, warum die Aktion nicht erlaubt ist, oder ein leeres Array, wenn sie erlaubt ist.\";'),('de','messages:apihelp-query+info-paramvalue-testactionsdetail-quick','s:75:\"de:Wie <kbd>full</kbd>, aber mit Überspringen von Aufwandsüberprüfungen.\";'),('de','messages:apihelp-query+info-summary','s:46:\"de:Ruft Basisinformationen über die Seite ab.\";'),('de','messages:apihelp-query+iwbacklinks-example-generator','s:61:\"en:Get information about pages linking to [[wikibooks:Test]].\";'),('de','messages:apihelp-query+iwbacklinks-example-simple','s:56:\"de:Ruft Seiten ab, die auf [[wikibooks:Test]] verlinken.\";'),('de','messages:apihelp-query+iwbacklinks-extended-description','s:156:\"en:Can be used to find all links with a prefix, or all links to a title (with a given prefix). Using neither parameter is effectively \"all interwiki links\".\";'),('de','messages:apihelp-query+iwbacklinks-param-dir','s:27:\"de:Die Auflistungsrichtung.\";'),('de','messages:apihelp-query+iwbacklinks-param-limit','s:59:\"de:Wie viele Sei