elp-query+pageswithprop-param-prop','s:42:\"en:Which pieces of information to include:\";'),('de','messages:apihelp-query+pageswithprop-param-propname','s:166:\"en:Page property for which to enumerate pages (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use).\";'),('de','messages:apihelp-query+pageswithprop-paramvalue-prop-ids','s:33:\"de:Fügt die Seitenkennung hinzu.\";'),('de','messages:apihelp-query+pageswithprop-paramvalue-prop-title','s:58:\"de:Ergänzt den Titel und die Namensraumkennung der Seite.\";'),('de','messages:apihelp-query+pageswithprop-paramvalue-prop-value','s:43:\"de:Ergänzt den Wert der Seiteneigenschaft.\";'),('de','messages:apihelp-query+pageswithprop-summary','s:46:\"en:List all pages using a given page property.\";'),('de','messages:apihelp-query+prefixsearch-example-simple','s:66:\"de:Suche nach Seitentiteln, die mit <kbd>Bedeutung</kbd> beginnen.\";'),('de','messages:apihelp-query+prefixsearch-extended-description','s:511:\"en:Despite the similarity in names, this module is not intended to be equivalent to [[Special:PrefixIndex]]; for that, see <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd> with the <kbd>apprefix</kbd> parameter. The purpose of this module is similar to <kbd>[[Special:ApiHelp/opensearch|action=opensearch]]</kbd>: to take user input and provide the best-matching titles. Depending on the search engine backend, this might include typo correction, redirect avoidance, or other heuristics.\";'),('de','messages:apihelp-query+prefixsearch-param-limit','s:48:\"de:Maximale Anzahl zurückzugebender Ergebnisse.\";'),('de','messages:apihelp-query+prefixsearch-param-namespace','s:137:\"de:Welche Namensräume durchsucht werden sollen. Wird ignoriert, falls <var>$1search</var> mit einem gültigen Namensraumpräfix beginnt.\";'),('de','messages:apihelp-query+prefixsearch-param-offset','s:45:\"de:Anzahl der zu überspringenden Ergebnisse.\";'),('de','messages:apihelp-query+prefixsearch-param-profile','s:30:\"de:Zu verwendendes Suchprofil.\";'),('de','messages:apihelp-query+prefixsearch-param-search','s:21:\"de:Such-Zeichenfolge.\";'),('de','messages:apihelp-query+prefixsearch-summary','s:43:\"en:Perform a prefix search for page titles.\";'),('de','messages:apihelp-query+protectedtitles-example-generator','s:62:\"de:Suche nach Links zu geschützten Titeln im Hauptnamensraum.\";'),('de','messages:apihelp-query+protectedtitles-example-simple','s:32:\"de:Listet geschützte Titel auf.\";'),('de','messages:apihelp-query+protectedtitles-param-end','s:55:\"de:Stoppt die Auflistung bei diesem Schutz-Zeitstempel.\";'),('de','messages:apihelp-query+protectedtitles-param-level','s:48:\"de:Listet nur Titel mit diesen Schutzstufen auf.\";'),('de','messages:apihelp-query+protectedtitles-param-limit','s:59:\"de:Wie viele Seiten insgesamt zurückgegeben werden sollen.\";'),('de','messages:apihelp-query+protectedtitles-param-namespace','s:48:\"de:Listet nur Titel in diesen Namensräumen auf.\";'),('de','messages:apihelp-query+protectedtitles-param-prop','s:34:\"de:Zurückzugebende Eigenschaften:\";'),('de','messages:apihelp-query+protectedtitles-param-start','s:56:\"de:Startet die Auflistung bei diesem Schutz-Zeitstempel.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-comment','s:42:\"de:Ergänzt den Kommentar für den Schutz.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-expiry','s:64:\"de:Fügt den Zeitstempel hinzu, wann der Schutz aufgehoben wird.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-level','s:29:\"de:Ergänzt den Schutzstatus.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-parsedcomment','s:52:\"de:Ergänzt den geparsten Kommentar für den Schutz.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-timestamp','s:64:\"de:Ergänzt den Zeitstempel, wann der Schutz hinzugefügt wurde.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-user','s:61:\"de:Fügt den Benutzer hinzu, der den Schutz hinzugefügt hat.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-userid','s:64:\"de:Fügt die Benutzer-ID hinzu, die den Schutz hinzugefügt hat.\";'),('de','messages:apihelp-query+protectedtitles-summary','s:67:\"de:Listet alle Titel auf, die vor einer Erstellung geschützt sind.\";'),('de','messages:apihelp-query+querypage-example-ancientpages','s:56:\"de:Gibt Ergebnisse von [[Special:Ancientpages]] zurück.\";'),('de','messages:apihelp-query+querypage-param-limit','s:43:\"de:Anzahl der zurückzugebenden Ergebnisse.\";'),('de','messages:apihelp-query+querypage-param-page','s:80:\"de:Der Name der Spezialseite. Hinweis: Groß- und Kleinschreibung wird beachtet.\";'),('de','messages:apihelp-query+querypage-summary','s:57:\"en:Get a list provided by a QueryPage-based special page.\";'),('de','messages:apihelp-query+random-example-generator','s:90:\"de:Gibt Seiteninformationen über zwei zufällige Seiten aus dem Haupt-Namensraum zurück.\";'),('de','messages:apihelp-query+random-example-simple','s:63:\"de:Gibt zwei zufällige Seiten aus dem Haupt-Namespace zurück.\";'),('de','messages:apihelp-query+random-extended-description','s:301:\"en:Pages are listed in a fixed sequence, only the starting point is random. This means that if, for example, <samp>Main Page</samp> is the first random page in the list, <samp>List of fictional monkeys</samp> will <em>always</em> be second, <samp>List of people on stamps of Vanuatu</samp> third, etc.\";'),('de','messages:apihelp-query+random-param-filterredir','s:50:\"de:Wie nach Weiterleitungen gefiltert werden soll.\";'),('de','messages:apihelp-query+random-param-limit','s:75:\"de:Begrenzung der Anzahl der zufälligen Seiten, die zurückgegeben werden.\";'),('de','messages:apihelp-query+random-param-namespace','s:51:\"de:Gibt nur Seiten in diesen Namensräumen zurück.\";'),('de','messages:apihelp-query+random-param-redirect','s:59:\"de:Verwende stattdessen <kbd>$1filterredir=redirects</kbd>.\";'),('de','messages:apihelp-query+random-summary','s:44:\"de:Ruft einen Satz an zufälligen Seiten ab.\";'),('de','messages:apihelp-query+recentchanges-example-generator','s:50:\"en:Get page info about recent unpatrolled changes.\";'),('de','messages:apihelp-query+recentchanges-example-simple','s:38:\"de:Listet die letzten Änderungen auf.\";'),('de','messages:apihelp-query+recentchanges-param-end','s:55:\"de:Der Zeitstempel, bei dem die Aufzählung enden soll.\";'),('de','messages:apihelp-query+recentchanges-param-excludeuser','s:52:\"de:Listet keine Änderungen von diesem Benutzer auf.\";'),('de','messages:apihelp-query+recentchanges-param-generaterevisions','s:177:\"en:When being used as a generator, generate revision IDs rather than titles. Recent change entries without associated revision IDs (e.g. most log entries) will generate nothing.\";'),('de','messages:apihelp-query+recentchanges-param-limit','s:64:\"de:Wie viele Änderungen insgesamt zurückgegeben werden sollen.\";'),('de','messages:apihelp-query+recentchanges-param-namespace','s:43:\"en:Filter changes to only these namespaces.\";'),('de','messages:apihelp-query+recentchanges-param-prop','s:46:\"de:Bezieht zusätzliche Informationen mit ein:\";'),('de','messages:apihelp-query+recentchanges-param-show','s:130:\"en:Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('de','messages:apihelp-query+recentchanges-param-slot','s:64:\"de:Listet nur Änderungen auf, die den genannten Slot betreffen.\";'),('de','messages:apihelp-query+recentchanges-param-start','s:58:\"de:Der Zeitstempel, bei dem die Aufzählung beginnen soll.\";'),('de','messages:apihelp-query+recentchanges-param-tag','s:71:\"de:Listet nur Änderungen auf, die mit dieser Markierung markiert sind.\";'),('de','messages:apihelp-query+recentchanges-param-title','s:45:\"en:Filter entries to those related to a page.\";'),('de','messages:apihelp-query+recentchanges-param-toponly','s:51:\"en:Only list changes which are the latest revision.\";'),('de','messages:apihelp-query+recentchanges-param-type','s:56:\"de:Welche Typen von Änderungen angezeigt werden sollen.\";'),('de','messages:apihelp-query+recentchanges-param-user','s:50:\"de:Listet nur Änderungen von diesem Benutzer auf.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-autopatrolled','s:82:\"de:Markiert kontrollierbare Bearbeitungen als automatisch kontrolliert oder nicht.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-comment','s:158:\"de:Fügt den Kommentar für die Bearbeitung hinzu. Wenn der Kommentar versionsgelöscht wurde, wird die Eigenschaft <samp>commenthidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-flags','s:46:\"de:Ergänzt Markierungen für die Bearbeitung.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-ids','s:71:\"en:Adds the page ID, recent changes ID and the new and old revision ID.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-loginfo','s:63:\"en:Adds log information (log ID, log type, etc) to log entries.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment','s:138:\"en:Adds the parsed comment for the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-patrolled','s:60:\"en:Tags patrollable edits as being patrolled or unpatrolled.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-redirect','s:35:\"en:Tags edit if page is a redirect.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-sha1','s:163:\"en:Adds the content checksum for entries associated with a revision. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-sizes','s:45:\"en:Adds the new and old page length in bytes.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-tags','s:44:\"de:Listet Markierungen für den Eintrag auf.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-timestamp','s:49:\"de:Ergänzt den Zeitstempel für die Bearbeitung.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-title','s:44:\"de:Ergänzt den Seitentitel der Bearbeitung.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-user','s:161:\"en:Adds the user responsible for the edit and tags if they are an IP. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('de','messages:apihelp-query+recentchanges-paramvalue-prop-userid','s:137:\"en:Adds the user ID responsible for the edit. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('de','messages:apihelp-query+recentchanges-summary','s:38:\"de:Listet die letzten Änderungen auf.\";'),('de','messages:apihelp-query+redirects-example-generator','s:73:\"en:Get information about all redirects to the [[{{MediaWiki:Mainpage}}]].\";'),('de','messages:apihelp-query+redirects-example-simple','s:61:\"en:Get a list of redirects to the [[{{MediaWiki:Mainpage}}]].\";'),('de','messages:apihelp-query+redirects-param-limit','s:58:\"de:Wie viele Weiterleitungen zurückgegeben werden sollen.\";'),('de','messages:apihelp-query+redirects-param-namespace','s:52:\"de:Schließt nur Seiten in diesen Namensräumen ein.\";'),('de','messages:apihelp-query+redirects-param-prop','s:34:\"de:Zurückzugebende Eigenschaften:\";'),('de','messages:apihelp-query+redirects-param-show','s:44:\"en:Show only items that meet these criteria:\";'),('de','messages:apihelp-query+redirects-paramvalue-prop-fragment','s:51:\"de:Teil einer jeden Weiterleitung, falls vorhanden.\";'),('de','messages:apihelp-query+redirects-paramvalue-prop-pageid','s:43:\"de:Seitenkennung einer jeden Weiterleitung.\";'),('de','messages:apihelp-query+redirects-paramvalue-prop-title','s:35:\"de:Titel einer jeden Weiterleitung.\";'),('de','messages:apihelp-query+redirects-paramvalue-show-!fragment','s:42:\"en:Only show redirects without a fragment.\";'),('de','messages:apihelp-query+redirects-paramvalue-show-fragment','s:39:\"en:Only show redirects with a fragment.\";'),('de','messages:apihelp-query+redirects-summary','s:44:\"en:Returns all redirects to the given pages.\";'),('de','messages:apihelp-query+revisions+base-param-contentformat','s:92:\"en:Serialization format used for <var>$1difftotext</var> and expected for output of content.\";'),('de','messages:apihelp-query+revisions+base-param-contentformat-slot','s:82:\"de:Inhaltsserialisierungsformat, das für die Ausgabe von Inhalten verwendet wird.\";'),('de','messages:apihelp-query+revisions+base-param-diffto','s:221:\"en:Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Revision ID to diff each revision to. Use <kbd>prev</kbd>, <kbd>next</kbd> and <kbd>cur</kbd> for the previous, next and current revision respectively.\";'),('de','messages:apihelp-query+revisions+base-param-difftotext','s:257:\"en:Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Text to diff each revision to. Only diffs a limited number of revisions. Overrides <var>$1diffto</var>. If <var>$1section</var> is set, only that section will be diffed against this text.\";'),('de','messages:apihelp-query+revisions+base-param-difftotextpst','s:180:\"en:Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Perform a pre-save transform on the text before diffing it. Only valid when used with <var>$1difftotext</var>.\";'),('de','messages:apihelp-query+revisions+base-param-expandtemplates','s:149:\"en:Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> instead. Expand templates in revision content (requires $1prop=content).\";'),('de','messages:apihelp-query+revisions+base-param-generatexml','s:210:\"en:Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Generate XML parse tree for revision content (requires $1prop=content).\";'),('de','messages:apihelp-query+revisions+base-param-limit','s:45:\"en:Limit how many revisions will be returned.\";'),('de','messages:apihelp-query+revisions+base-param-parse','s:190:\"en:Use <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Parse revision content (requires $1prop=content). For performance reasons, if this option is used, $1limit is enforced to 1.\";'),('de','messages:apihelp-query+revisions+base-param-prop','s:48:\"de:Zurückzugebende Eigenschaften jeder Version:\";'),('de','messages:apihelp-query+revisions+base-param-section','s:65:\"en:Only retrieve the content of the section with this identifier.\";'),('de','messages:apihelp-query+revisions+base-param-slots','s:206:\"en:Which revision slots to return data for, when slot-related properties are included in <var>$1props</var>. If omitted, data from the <kbd>main</kbd> slot will be returned in a backwards-compatible format.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-comment','s:152:\"de:Kommentar des Benutzers für die Version. Wenn der Kommentar versionsgelöscht wurde, wird die Eigenschaft <samp>commenthidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-content','s:142:\"de:Inhalt eines jeden Versionsschlitzes. Wenn der Inhalt versionsgelöscht wurde, wird die Eigenschaft <samp>texthidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-contentmodel','s:55:\"de:Inhaltsmodell-Kennung eines jeden Versionsschlitzes.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-flags','s:32:\"de:Versionsmarkierungen (klein).\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-ids','s:27:\"de:Die Kennung der Version.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-parsedcomment','s:145:\"en:Parsed comment by the user for the revision. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-parsetree','s:219:\"en:Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. The XML parse tree of revision content (requires content model <code>$1</code>).\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-roles','s:71:\"de:Die Liste enthält Schlitzregeln, die in der Version vorhanden sind.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-sha1','s:145:\"de:SHA-1-Prüfsumme (Basis 16) der Version. Wenn der Inhalt versionsgelöscht wurde, wird die Eigenschaft <samp>sha1hidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-size','s:31:\"de:Länge in Bytes der Version.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-slotsha1','s:152:\"de:SHA-1 (Basis 16) eines jeden Versionsschlitzes. Wenn der Inhalt versionsgelöscht wurde, wird die Eigenschaft <samp>sha1hidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-slotsize','s:48:\"de:Länge (Bytes) eines jeden Versionsschlitzes.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-tags','s:33:\"de:Markierungen für die Version.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-timestamp','s:31:\"de:Der Zeitstempel der Version.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-user','s:146:\"de:Benutzer, der die Version erstellt hat. Wenn der Benutzer versionsgelöscht wurde, wird die Eigenschaft <samp>userhidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+revisions+base-paramvalue-prop-userid','s:146:\"de:Benutzerkennung des Versionserstellers. Wenn der Benutzer versionsgelöscht wurde, wird die Eigenschaft <samp>userhidden</samp> zurückgegeben.\";'),('de','messages:apihelp-query+revisions-example-content','s:103:\"en:Get data with content for the last revision of titles <kbd>API</kbd> and [[{{MediaWiki:Mainpage}}]].\";'),('de','messages:apihelp-query+revisions-example-first5','s:59:\"en:Get first 5 revisions of the [[{{MediaWiki:Mainpage}}]].\";'),('de','messages:apihelp-query+revisions-example-first5-after','s:81:\"en:Get first 5 revisions of the [[{{MediaWiki:Mainpage}}]] made after 2006-05-01.\";'),('de','messages:apihelp-query+revisions-example-first5-not-localhost','s:117:\"en:Get first 5 revisions of the [[{{MediaWiki:Mainpage}}]] that were not made by anonymous user <kbd>127.0.0.1</kbd>.\";'),('de','messages:apihelp-query+revisions-example-first5-user','s:115:\"en:Get first 5 revisions of the [[{{MediaWiki:Mainpage}}]] that were made by the user <kbd>MediaWiki default</kbd>.\";'),('de','messages:apihelp-query+revisions-example-last5','s:58:\"en:Get last 5 revisions of the [[{{MediaWiki:Mainpage}}]].\";'),('de','messages:apihelp-query+revisions-extended-description','s:270:\"en:May be used in several ways:\n# Get data about a set of pages (last revision), by setting titles or pageids.\n# Get revisions for one given page, by using titles or pageids with start, end, or limit.\n# Get data about a set of revisions by setting their IDs with revids.\";'),('de','messages:apihelp-query+revisions-param-end','s:42:\"de:Durchzählen bis zu diesem Zeitstempel.\";'),('de','messages:apihelp-query+revisions-param-endid','s:108:\"en:Stop enumeration at this revision\'s timestamp. The revision must exist, but need not belong to this page.\";'),('de','messages:apihelp-query+revisions-param-excludeuser','s:41:\"de:Schließt Versionen nach Benutzer aus.\";'),('de','messages:apihelp-query+revisions-param-start','s:54:\"en:From which revision timestamp to start enumeration.\";'),('de','messages:apihelp-query+revisions-param-startid','s:111:\"en:Start enumeration from this revision\'s timestamp. The revision must exist, but need not belong to this page.\";'),('de','messages:apihelp-query+revisions-param-tag','s:69:\"de:Listet nur Versionen auf, die mit dieser Markierung markiert sind.\";'),('de','messages:apihelp-query+revisions-param-user','s:66:\"de:Nur vom Benutzer vorgenommene Versionen werden berücksichtigt.\";'),('de','messages:apihelp-query+revisions-paraminfo-singlepageonly','s:49:\"en:May only be used with a single page (mode #2).\";'),('de','messages:apihelp-query+revisions-summary','s:38:\"de:Ruft Informationen zu Versionen ab.\";'),('de','messages:apihelp-query+search-example-generator','s:78:\"en:Get page info about the pages returned for a search for <kbd>meaning</kbd>.\";'),('de','messages:apihelp-query+search-example-simple','s:34:\"de:Nach <kbd>meaning</kbd> suchen.\";'),('de','messages:apihelp-query+search-example-text','s:45:\"de:Texte nach <kbd>meaning</kbd> durchsuchen.\";'),('de','messages:apihelp-query+search-param-backend','s:51:\"en:Which search backend to use, if not the default.\";'),('de','messages:apihelp-query+search-param-enablerewrites','s:179:\"en:Enable internal query rewriting. Some search backends can rewrite the query into another which is thought to provide better results, for instance by correcting spelling errors.\";'),('de','messages:apihelp-query+search-param-info','s:49:\"de:Welche Metadaten zurückgegeben werden sollen.\";'),('de','messages:apihelp-query+search-param-interwiki','s:57:\"en:Include interwiki results in the search, if available.\";'),('de','messages:apihelp-query+search-param-limit','s:59:\"de:Wie viele Seiten insgesamt zurückgegeben werden sollen.\";'),('de','messages:apihelp-query+search-param-namespace','s:39:\"en:Search only within these namespaces.\";'),('de','messages:apihelp-query+search-param-prop','s:31:\"de:Eigenschaften zur Rückgabe:\";'),('de','messages:apihelp-query+search-param-qiprofile','s:92:\"de:Zu verwendendes anfrageunabhängiges Profil (wirkt sich auf den Ranking-Algorithmus aus).\";'),('de','messages:apihelp-query+search-param-search','s:178:\"en:Search for page titles or content matching this value. You can use the search string to invoke special search features, depending on what the wiki\'s search backend implements.\";'),('de','messages:apihelp-query+search-param-sort','s:68:\"de:Legt die Sortierreihenfolge der zurückgegebenen Ergebnisse fest.\";'),('de','messages:apihelp-query+search-param-what','s:43:\"de:Welcher Suchtyp ausgeführt werden soll.\";'),('de','messages:apihelp-query+search-paramvalue-prop-categorysnippet','s:72:\"en:Adds the matching category name, with query term highlighting markup.\";'),('de','messages:apihelp-query+search-paramvalue-prop-extensiondata','s:58:\"de:Ergänzt zusätzliche von Erweiterungen erzeugte Daten.\";'),('de','messages:apihelp-query+search-paramvalue-prop-hasrelated','s:13:\"de:Ignoriert.\";'),('de','messages:apihelp-query+search-paramvalue-prop-isfilematch','s:64:\"en:Adds a boolean indicating if the search matched file content.\";'),('de','messages:apihelp-query+search-paramvalue-prop-redirectsnippet','s:80:\"en:Adds the title of the matching redirect, with query term highlighting markup.\";'),('de','messages:apihelp-query+search-paramvalue-prop-redirecttitle','s:43:\"en:Adds the title of the matching redirect.\";'),('de','messages:apihelp-query+search-paramvalue-prop-score','s:13:\"de:Ignoriert.\";'),('de','messages:apihelp-query+search-paramvalue-prop-sectionsnippet','s:79:\"en:Adds the title of the matching section, with query term highlighting markup.\";'),('de','messages:apihelp-query+search-paramvalue-prop-sectiontitle','s:42:\"en:Adds the title of the matching section.\";'),('de','messages:apihelp-query+search-paramvalue-prop-size','s:46:\"de:Fügt die Größe der Seite in Bytes hinzu.\";'),('de','messages:apihelp-query+search-paramvalue-prop-snippet','s:67:\"en:Adds a snippet of the page, with query term highlighting markup.\";'),('de','messages:apihelp-query+search-paramvalue-prop-timestamp','s:55:\"en:Adds the timestamp of when the pa