ung.\";'),('de','messages:apihelp-tag-param-remove','s:101:\"en:Tags to remove. Only tags that are either manually defined or completely undefined can be removed.\";'),('de','messages:apihelp-tag-param-revid','s:64:\"en:One or more revision IDs from which to add or remove the tag.\";'),('de','messages:apihelp-tag-param-tags','s:100:\"de:Auf den Logbucheintrag anzuwendende Markierungen, die als Ergebnis dieser Aktion erstellt wurden.\";'),('de','messages:apihelp-tag-summary','s:70:\"en:Add or remove change tags from individual revisions or log entries.\";'),('de','messages:apihelp-unblock-example-id','s:42:\"de:Sperrkennung #<kbd>105</kbd> freigeben.\";'),('de','messages:apihelp-unblock-example-user','s:79:\"de:Benutzer <kbd>Bob</kbd> mit der Begründung <kbd>Sorry Bob</kbd> entsperren.\";'),('de','messages:apihelp-unblock-param-id','s:136:\"de:Kennung der Sperre zur Freigabe (abgerufen durch <kbd>list=blocks</kbd>). Kann nicht zusammen mit <var>$1user</var> verwendet werden.\";'),('de','messages:apihelp-unblock-param-reason','s:27:\"de:Grund für die Freigabe.\";'),('de','messages:apihelp-unblock-param-tags','s:77:\"de:Auf den Benutzersperr-Logbuch-Eintrag anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-unblock-param-user','s:99:\"de:Benutzer, der freigegeben werden soll. Kann nicht zusammen mit <var>$1id</var> verwendet werden.\";'),('de','messages:apihelp-unblock-param-userid','s:52:\"en:Specify <kbd>$1user=#<var>ID</var></kbd> instead.\";'),('de','messages:apihelp-unblock-param-watchlistexpiry','s:132:\"de:Ablaufzeitstempel der Beobachtungsliste. Lasse diesen Parameter vollständig weg, um den aktuellen Ablauf unverändert zu lassen.\";'),('de','messages:apihelp-unblock-param-watchuser','s:80:\"de:Benutzer- und Diskussionsseiten des Benutzers oder der IP-Adresse beobachten.\";'),('de','messages:apihelp-unblock-summary','s:28:\"de:Einen Benutzer freigeben.\";'),('de','messages:apihelp-undelete-example-page','s:53:\"de:Seite [[{{MediaWiki:Mainpage}}]] wiederherstellen.\";'),('de','messages:apihelp-undelete-example-revisions','s:61:\"en:Undelete two revisions of page [[{{MediaWiki:Mainpage}}]].\";'),('de','messages:apihelp-undelete-extended-description','s:256:\"en:A list of deleted revisions (including timestamps) can be retrieved through [[Special:ApiHelp/query+deletedrevisions|prop=deletedrevisions]], and a list of deleted file IDs can be retrieved through [[Special:ApiHelp/query+filearchive|list=filearchive]].\";'),('de','messages:apihelp-undelete-param-fileids','s:130:\"en:IDs of the file revisions to restore. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be restored.\";'),('de','messages:apihelp-undelete-param-reason','s:36:\"de:Grund für die Wiederherstellung.\";'),('de','messages:apihelp-undelete-param-tags','s:70:\"de:Auf den Lösch-Logbuch-Eintrag anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-undelete-param-timestamps','s:134:\"en:Timestamps of the revisions to undelete. If both <var>$1timestamps</var> and <var>$1fileids</var> are empty, all will be undeleted.\";'),('de','messages:apihelp-undelete-param-title','s:41:\"de:Titel der wiederherzustellenden Seite.\";'),('de','messages:apihelp-undelete-param-undeletetalk','s:87:\"de:Stellt alle Versionen der zugehörigen Diskussionsseite wieder her, falls vorhanden.\";'),('de','messages:apihelp-undelete-param-watchlist','s:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('de','messages:apihelp-undelete-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('de','messages:apihelp-undelete-summary','s:40:\"en:Undelete revisions of a deleted page.\";'),('de','messages:apihelp-unlinkaccount-example-simple','s:114:\"en:Attempt to remove the current user\'s link for the provider associated with <kbd>FooAuthenticationRequest</kbd>.\";'),('de','messages:apihelp-unlinkaccount-summary','s:61:\"en:Remove a linked third-party account from the current user.\";'),('de','messages:apihelp-upload-example-filekey','s:80:\"de:Vervollständigt einen Upload, der aufgrund von Warnungen fehlgeschlagen ist.\";'),('de','messages:apihelp-upload-example-url','s:26:\"de:Von einer URL hochladen\";'),('de','messages:apihelp-upload-extended-description','s:550:\"en:Several methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.\n* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),('de','messages:apihelp-upload-param-async','s:69:\"en:Make potentially large file operations asynchronous when possible.\";'),('de','messages:apihelp-upload-param-checkstatus','s:71:\"de:Ruft nur den Hochladestatus für den angegebenen Dateischlüssel ab.\";'),('de','messages:apihelp-upload-param-chunk','s:18:\"en:Chunk contents.\";'),('de','messages:apihelp-upload-param-comment','s:106:\"en:Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('de','messages:apihelp-upload-param-file','s:16:\"de:Dateiinhalte.\";'),('de','messages:apihelp-upload-param-filekey','s:70:\"en:Key that identifies a previous upload that was stashed temporarily.\";'),('de','messages:apihelp-upload-param-filename','s:18:\"de:Ziel-Dateiname.\";'),('de','messages:apihelp-upload-param-filesize','s:37:\"de:Dateigröße des gesamten Uploads.\";'),('de','messages:apihelp-upload-param-ignorewarnings','s:23:\"de:Ignoriert Warnungen.\";'),('de','messages:apihelp-upload-param-offset','s:28:\"en:Offset of chunk in bytes.\";'),('de','messages:apihelp-upload-param-sessionkey','s:60:\"en:Same as $1filekey, maintained for backward compatibility.\";'),('de','messages:apihelp-upload-param-stash','s:93:\"en:If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('de','messages:apihelp-upload-param-tags','s:96:\"de:Auf den Datei-Logbuch-Eintrag und die Dateiseitenversion anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-upload-param-text','s:39:\"de:Erster Seitentext für neue Dateien.\";'),('de','messages:apihelp-upload-param-url','s:48:\"de:URL, von der die Datei abgerufen werden soll.\";'),('de','messages:apihelp-upload-param-watch','s:24:\"de:Die Seite beobachten.\";'),('de','messages:apihelp-upload-param-watchlist','s:140:\"en:Unconditionally add or remove the page from the current user\'s watchlist, use preferences (ignored for bot users) or do not change watch.\";'),('de','messages:apihelp-upload-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('de','messages:apihelp-upload-summary','s:55:\"en:Upload a file, or get the status of pending uploads.\";'),('de','messages:apihelp-userrights-example-expiry','s:75:\"en:Add user <kbd>SometimeSysop</kbd> to group <kbd>sysop</kbd> for 1 month.\";'),('de','messages:apihelp-userrights-example-user','s:121:\"en:Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('de','messages:apihelp-userrights-example-userid','s:130:\"en:Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('de','messages:apihelp-userrights-param-add','s:145:\"de:Fügt den Benutzer zu diesen Gruppen hinzu bzw. aktualisiert den Ablauf seiner Mitgliedschaft in dieser Gruppe, falls er bereits Mitglied ist.\";'),('de','messages:apihelp-userrights-param-expiry','s:363:\"en:Expiry timestamps. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If only one timestamp is set, it will be used for all groups passed to the <var>$1add</var> parameter. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd> for a never-expiring user group.\";'),('de','messages:apihelp-userrights-param-reason','s:28:\"de:Grund für die Änderung.\";'),('de','messages:apihelp-userrights-param-remove','s:44:\"de:Entfernt den Benutzer aus diesen Gruppen.\";'),('de','messages:apihelp-userrights-param-tags','s:81:\"de:Auf den Eintrag im Benutzerrechte-Logbuch anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-userrights-param-user','s:12:\"de:Benutzer.\";'),('de','messages:apihelp-userrights-param-userid','s:56:\"de:Stattdessen <kbd>$1user=#<var>ID</var></kbd> angeben.\";'),('de','messages:apihelp-userrights-param-watchlistexpiry','s:98:\"en:Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('de','messages:apihelp-userrights-param-watchuser','s:66:\"de:Beobachten der Benutzer- und Diskussionseiten dieses Benutzters\";'),('de','messages:apihelp-userrights-summary','s:53:\"de:Ändert die Gruppenzugehörigkeit eines Benutzers.\";'),('de','messages:apihelp-validatepassword-example-1','s:72:\"de:Validiert das Passwort <kbd>foobar</kbd> für den aktuellen Benutzer.\";'),('de','messages:apihelp-validatepassword-example-2','s:92:\"de:Validiert das Passwort <kbd>qwerty</kbd> zum Erstellen des Benutzers <kbd>Beispiel</kbd>.\";'),('de','messages:apihelp-validatepassword-extended-description','s:263:\"de:Die Validität wird als <samp>Good</samp> gemeldet, falls das Passwort akzeptabel ist, <samp>Change</samp>, falls das Passwort zur Anmeldung verwendet werden kann, jedoch geändert werden muss oder <samp>Invalid</samp>, falls das Passwort nicht verwendbar ist.\";'),('de','messages:apihelp-validatepassword-param-email','s:77:\"de:Die beim Austesten der Benutzerkontenerstellung verwendete E-Mail-Adresse.\";'),('de','messages:apihelp-validatepassword-param-password','s:29:\"de:Zu validierendes Passwort.\";'),('de','messages:apihelp-validatepassword-param-realname','s:80:\"de:Der beim Austesten der Benutzerkontenerstellung verwendete bürgerliche Name.\";'),('de','messages:apihelp-validatepassword-param-user','s:126:\"de:Der beim Austesten der Benutzerkontenerstellung verwendete Benutzername. Der angegebene Benutzer darf nicht vorhanden sein.\";'),('de','messages:apihelp-validatepassword-summary','s:66:\"de:Validiert ein Passwort gegen die Passwortrichtlinien des Wikis.\";'),('de','messages:apihelp-watch-example-generator','s:51:\"en:Watch the first few pages in the main namespace.\";'),('de','messages:apihelp-watch-example-unwatch','s:57:\"de:Die Seite [[{{MediaWiki:Mainpage}}]] nicht beobachten.\";'),('de','messages:apihelp-watch-example-watch','s:51:\"de:Die Seite [[{{MediaWiki:Mainpage}}]] beobachten.\";'),('de','messages:apihelp-watch-example-watch-expiry','s:103:\"de:Beobachte die Seiten [[{{MediaWiki:Mainpage}}]], <kbd>Foo</kbd> und <kbd>Bar</kbd> für einen Monat.\";'),('de','messages:apihelp-watch-param-expiry','s:123:\"en:Expiry timestamp to be applied to all given pages. Omit this parameter entirely to leave any current expiries unchanged.\";'),('de','messages:apihelp-watch-param-title','s:58:\"en:The page to (un)watch. Use <var>$1titles</var> instead.\";'),('de','messages:apihelp-watch-param-unwatch','s:57:\"en:If set the page will be unwatched rather than watched.\";'),('de','messages:apihelp-watch-summary','s:57:\"en:Add or remove pages from the current user\'s watchlist.\";'),('de','messages:apihelp-xml-param-includexmlnamespace','s:50:\"de:Falls angegeben, ergänzt einen XML-Namensraum.\";'),('de','messages:apihelp-xml-param-xslt','s:169:\"de:Falls angegeben, fügt die benannte Seite als XSL-Stylesheet hinzu. Der Wert muss ein Titel im Namensraum „{{ns:MediaWiki}}“ sein und mit <code>.xsl</code> enden.\";'),('de','messages:apihelp-xml-summary','s:32:\"de:Daten im XML-Format ausgeben.\";'),('de','messages:apihelp-xmlfm-summary','s:57:\"de:Daten im XML-Format ausgeben (schöngedruckt in HTML).\";'),('de','messages:apisandbox','s:17:\"de:API-Spielwiese\";'),('de','messages:apisandbox-add-multi','s:14:\"de:Hinzufügen\";'),('de','messages:apisandbox-alert-field','s:44:\"de:Der Wert dieses Feldes ist nicht gültig.\";'),('de','messages:apisandbox-alert-page','s:46:\"de:Felder auf dieser Seite sind nicht gültig.\";'),('de','messages:apisandbox-continue','s:13:\"de:Fortfahren\";'),('de','messages:apisandbox-continue-clear','s:11:\"de:Löschen\";'),('de','messages:apisandbox-continue-help','s:241:\"de:Mit „{{int:apisandbox-continue}}“ kann man die letzte Anfrage [https://www.mediawiki.org/wiki/Special:MyLanguage/API:Query#Continuing_queries fortfahren]; „{{int:apisandbox-continue-clear}}“ löscht fortsetzungsbezogene Parameter.\";'),('de','messages:apisandbox-deprecated-parameters','s:22:\"de:Veraltete Parameter\";'),('de','messages:apisandbox-dynamic-error-exists','s:62:\"de:Ein Parameter mit dem Namen „$1“ ist bereits vorhanden.\";'),('de','messages:apisandbox-dynamic-parameters','s:25:\"de:Zusätzliche Parameter\";'),('de','messages:apisandbox-dynamic-parameters-add-label','s:25:\"de:Parameter hinzufügen:\";'),('de','messages:apisandbox-dynamic-parameters-add-placeholder','s:22:\"de:Name des Parameters\";'),('de','messages:apisandbox-examples','s:12:\"de:Beispiele\";'),('de','messages:apisandbox-fetch-token','s:35:\"de:Den Token automatisch ausfüllen\";'),('de','messages:apisandbox-helpurls','s:14:\"de:Hilfe-Links\";'),('de','messages:apisandbox-intro','s:569:\"de:Diese Seite kannst du für Versuche mit der <strong>MediaWiki-API</strong> verwenden.\nDie [https://www.mediawiki.org/wiki/Special:MyLanguage/API:Main_page Dokumentation zur API] enthält weitere Hinweise zu ihrer Nutzung. Beispiel: [https://www.mediawiki.org/wiki/Special:MyLanguage/API:Main_page/de#Ein_einfaches_Beispiel Suche nach Seitennamen, die ein bestimmtes Stichwort enthalten]. Wähle für weitere Beispiele eine der verfügbaren Aktionen.\n\nObwohl dies eine Spielwiese ist, bedenke, dass Aktionen, die du auf dieser Seite durchführst, das Wiki verändern.\";'),('de','messages:apisandbox-jsonly','s:62:\"de:Zur Nutzung der API-Spielwiese ist JavaScript erforderlich.\";'),('de','messages:apisandbox-load-error','s:90:\"de:Beim Laden von Informationen für das API-Modul „$1“ ist ein Fehler aufgetreten: $2\";'),('de','messages:apisandbox-loading','s:53:\"de:Lade Informationen für das API-Modul „$1“ …\";'),('de','messages:apisandbox-loading-results','s:29:\"de:Rufe API-Ergebnisse ab …\";'),('de','messages:apisandbox-multivalue-all-namespaces','s:25:\"de:$1 (Alle Namensräume)\";'),('de','messages:apisandbox-multivalue-all-values','s:18:\"de:$1 (Alle Werte)\";'),('de','messages:apisandbox-no-parameters','s:40:\"de:Dieses API-Modul hat keine Parameter.\";'),('de','messages:apisandbox-param-limit','s:62:\"de:Gib <kbd>max</kbd> ein, um das maximale Limit zu verwenden.\";'),('de','messages:apisandbox-request-format-json-label','s:7:\"en:JSON\";'),('de','messages:apisandbox-request-format-php-label','s:12:\"de:PHP-Array\";'),('de','messages:apisandbox-request-format-url-label','s:27:\"de:URL-Abfrage-Zeichenfolge\";'),('de','messages:apisandbox-request-json-label','s:17:\"de:Anfragen-JSON:\";'),('de','messages:apisandbox-request-php-label','s:23:\"de:PHP-Array anfordern:\";'),('de','messages:apisandbox-request-selectformat-label','s:29:\"de:Anfragedaten anzeigen als:\";'),('de','messages:apisandbox-request-time','s:70:\"de:Dauer der Anfrage: {{PLURAL:$1|Eine Millisekunde|$1 Millisekunden}}\";'),('de','messages:apisandbox-request-url-label','s:20:\"de:Anforderungs-URL:\";'),('de','messages:apisandbox-reset','s:9:\"de:Leeren\";'),('de','messages:apisandbox-results','s:13:\"de:Ergebnisse\";'),('de','messages:apisandbox-results-error','s:69:\"de:Beim Laden der API-Anf