s:32:\"de:Eine Version wiederherstellen\";'),('de','messages:confirm-mcrundo-title','s:37:\"de:Eine Änderung rückgängig machen\";'),('de','messages:confirm-purge-bottom','s:78:\"de:Leert den Cache einer Seite und erzwingt die Anzeige der aktuellen Version.\";'),('de','messages:confirm-purge-title','s:28:\"de:Diese Seite aktualisieren\";'),('de','messages:confirm-purge-top','s:38:\"de:Diese Seite aus dem Cache löschen?\";'),('de','messages:confirm-rollback-bottom','s:88:\"de:Diese Aktion wird sofort die ausgewählten Änderungen an dieser Seite zurücksetzen.\";'),('de','messages:confirm-rollback-button','s:7:\"de:Okay\";'),('de','messages:confirm-rollback-top','s:47:\"de:Bearbeitungen an dieser Seite zurücksetzen?\";'),('de','messages:confirm-unwatch-button','s:5:\"de:OK\";'),('de','messages:confirm-unwatch-top','s:65:\"de:Diese Seite von der persönlichen Beobachtungsliste entfernen?\";'),('de','messages:confirm-watch-button','s:5:\"de:OK\";'),('de','messages:confirm-watch-button-expiry','s:13:\"de:Beobachten\";'),('de','messages:confirm-watch-label','s:30:\"de:Beobachtungslisten-Zeitraum\";'),('de','messages:confirm-watch-top','s:63:\"de:Diese Seite zur persönlichen Beobachtungsliste hinzufügen?\";'),('de','messages:confirm_purge_button','s:5:\"de:OK\";'),('de','messages:confirmable-confirm','s:32:\"de:Bist {{GENDER:$1|du}} sicher?\";'),('de','messages:confirmable-no','s:7:\"de:Nein\";'),('de','messages:confirmable-yes','s:5:\"de:Ja\";'),('de','messages:confirmdeletetext','s:240:\"de:Du bist dabei, eine Seite mit allen zugehörigen älteren Versionen zu löschen. Bitte bestätige dazu, dass du dir der Konsequenzen bewusst bist, und dass du in Übereinstimmung mit den [[{{MediaWiki:Policy-url}}|Richtlinien]] handelst.\";'),('de','messages:confirmedittext','s:183:\"de:Du musst deine E-Mail-Adresse erst bestätigen, bevor du Bearbeitungen durchführen kannst. Bitte ergänze und bestätige deine E-Mail in den [[Special:Preferences|Einstellungen]].\";'),('de','messages:confirmemail','s:49:\"de:E-Mail-Adresse bestätigen (Authentifizierung)\";'),('de','messages:confirmemail_body','s:537:\"de:Hallo,\n\njemand mit der IP-Adresse $1, wahrscheinlich du selbst, hat das Benutzerkonto „$2“ bei {{SITENAME}} registriert.\n\nUm die E-Mail-Funktionen von {{SITENAME}} (wieder) zu aktivieren und um zu bestätigen,\ndass dieses Benutzerkonto wirklich zu deiner E-Mail-Adresse und damit zu dir gehört, öffne bitte folgenden Link in deinem Browser:\n\n$3\n\nWenn du das genannte Benutzerkonto *nicht* registriert hast, folge diesem Link, um den Bestätigungsprozess abzubrechen:\n\n$5\n\nDieser Bestätigungscode ist gültig bis zum $6, $7 Uhr.\";'),('de','messages:confirmemail_body_changed','s:472:\"de:Jemand mit der IP-Adresse $1, wahrscheinlich du selbst,\nhat die E-Mail-Adresse des Benutzerkontos „$2“ in diese Adresse bei {{SITENAME}} geändert.\n\nUm zu bestätigen, dass dieses Benutzerkonto wirklich dir gehört,\nund um die E-Mail-Features bei {{SITENAME}} zu reaktivieren, öffne diesen Link in deinem Browser:\n\n$3\n\nFalls das Konto *nicht* dir gehört, folge diesem Link,\num die E-Mail-Bestätigung abzubrechen:\n\n$5\n\nDieser Bestätigungscode ist gültig bis $4.\";'),('de','messages:confirmemail_body_set','s:531:\"de:Jemand mit der IP-Adresse $1, wahrscheinlich du selbst,\nhat die E-Mail-Adresse des Benutzerkontos „$2“ auf {{SITENAME}} in diese E-Mail-Adresse abgeändert.\n\nUm zu bestätigen, dass dieses Benutzerkonto wirklich zu dir gehört,\nund um die E-Mail-Funktionen auf {{SITENAME}} zu aktivieren, öffne bitte den folgenden Link in deinem Browser:\n\n$3\n\nFalls das Konto *nicht* zu dir gehört, bitte den nachfolgenden Link öffnen,\num die Bestätigung der E-Mail-Adresse abzubrechen:\n\n$5\n\nDieser Bestätigungscode ist gültig bis $4.\";'),('de','messages:confirmemail_invalid','s:141:\"de:Ungültiger Bestätigungscode. Möglicherweise ist der Bestätigungszeitraum verstrichen. Versuche bitte, die Bestätigung zu wiederholen.\";'),('de','messages:confirmemail_invalid_format','s:145:\"de:Ungültiger Bestätigungscode.\nÜberprüfe deine E-Mail; der Bestätigungslink wurde möglicherweise von deinem E-Mail-Programm abgeschnitten.\";'),('de','messages:confirmemail_invalidated','s:51:\"de:Die E-Mail-Adressbestätigung wurde abgebrochen.\";'),('de','messages:confirmemail_loggedin','s:53:\"de:Deine E-Mail-Adresse wurde erfolgreich bestätigt.\";'),('de','messages:confirmemail_needlogin','s:60:\"de:Du musst dich $1, um deine E-Mail-Adresse zu bestätigen.\";'),('de','messages:confirmemail_noemail','s:115:\"de:Du hast keine gültige E-Mail-Adresse in deinen [[Special:Preferences|persönlichen Einstellungen]] eingetragen.\";'),('de','messages:confirmemail_oncreate','s:201:\"de:Ein Bestätigungs-Code wurde an deine E-Mail-Adresse gesandt. Dieser Code wird für die Anmeldung nicht benötigt, jedoch wird er zur Aktivierung der E-Mail-Funktionen innerhalb des Wikis gebraucht.\";'),('de','messages:confirmemail_pending','s:215:\"de:Es wurde dir bereits ein Bestätigungscode per E-Mail zugeschickt.\nWenn du dein Benutzerkonto erst vor kurzem erstellt hast, warte bitte noch ein paar Minuten auf die E-Mail, bevor du einen neuen Code anforderst.\";'),('de','messages:confirmemail_send','s:31:\"de:Bestätigungscode zuschicken\";'),('de','messages:confirmemail_sendfailed','s:162:\"de:{{SITENAME}} konnte die Bestätigungs-E-Mail nicht an dich versenden.\nBitte prüfe die E-Mail-Adresse auf ungültige Zeichen.\n\nRückmeldung des Mailservers: $1\";'),('de','messages:confirmemail_sent','s:45:\"de:Die Bestätigungs-E-Mail wurde verschickt.\";'),('de','messages:confirmemail_subject','s:49:\"de:[{{SITENAME}}] Bestätigung der E-Mail-Adresse\";'),('de','messages:confirmemail_success','s:106:\"de:Deine E-Mail-Adresse wurde erfolgreich bestätigt. Du kannst dich jetzt [[Special:UserLogin|anmelden]].\";'),('de','messages:confirmemail_text','s:532:\"de:{{SITENAME}} erfordert, dass du deine E-Mail-Adresse bestätigst (authentifizieren), bevor du die erweiterten E-Mail-Funktionen benutzen kannst. Klicke bitte auf die unten stehende, mit „Bestätigungscode zuschicken“ beschriftete Schaltfläche, damit eine automatisch erstellte E-Mail an die angegebene Adresse geschickt wird. Diese E-Mail enthält eine Web-Adresse mit einem Bestätigungscode. Indem du diese Webseite in deinem Webbrowser öffnest, bestätigst du, dass die angegebene E-Mail-Adresse korrekt und gültig ist.\";'),('de','messages:confirmleave-warning','s:90:\"de:Das Verlassen dieser Seite kann dazu führen, dass du alle deine Änderungen verlierst.\";'),('de','messages:confirmrecreate','s:274:\"de:{{GENDER:$1|Der Benutzer|Die Benutzerin}} [[User:$1|$1]] ([[User talk:$1|Diskussion]]) hat diese Seite gelöscht, nachdem du angefangen hast, sie zu bearbeiten. Die Begründung lautete:\n: <em>$2</em>\nBitte bestätige, dass du diese Seite wirklich neu erstellen möchtest.\";'),('de','messages:confirmrecreate-noreason','s:235:\"de:{{GENDER:$1|Der Benutzer|Die Benutzerin}} [[User:$1|$1]] ([[User talk:$1|Diskussion]]) hat diese Seite gelöscht, nachdem du mit der Bearbeitung begonnen hast. Bitte bestätige, dass du die Seite wirklich erneut erstellen möchtest.\";'),('de','messages:content-failed-to-parse','s:58:\"de:Parsen des Inhalts $2 für Modell $1 fehlgeschlagen: $3\";'),('de','messages:content-json-empty-array','s:15:\"de:Leeres Array\";'),('de','messages:content-json-empty-object','s:16:\"de:Leeres Objekt\";'),('de','messages:content-model-css','s:6:\"en:CSS\";'),('de','messages:content-model-javascript','s:13:\"en:JavaScript\";'),('de','messages:content-model-json','s:7:\"en:JSON\";'),('de','messages:content-model-text','s:11:\"de:Klartext\";'),('de','messages:content-model-wikitext','s:11:\"de:Wikitext\";'),('de','messages:content-not-allowed-here','s:82:\"de:Der Inhalt „$1“ ist auf der Seite [[:$2]] im Schlitz „$3“ nicht erlaubt\";'),('de','messages:contentmodelediterror','s:145:\"de:Du kannst diese Version nicht bearbeiten, da das Inhaltsmodell <code>$1</code> vom aktuellen Inhaltsmodell der Seite <code>$2</code> abweicht.\";'),('de','messages:continue-editing','s:29:\"de:Zum Bearbeitungsfeld gehen\";'),('de','messages:contribslink','s:12:\"de:Beiträge\";'),('de','messages:contribsub2','s:28:\"de:Von {{GENDER:$3|$1}} ($2)\";'),('de','messages:contribute','s:12:\"de:Beitragen\";'),('de','messages:contribute-title','s:20:\"de:Benutzerbeiträge\";'),('de','messages:contributions','s:20:\"de:Benutzerbeiträge\";'),('de','messages:contributions-account-creation-date','s:34:\"de:Das Konto wurde am $1 erstellt.\";'),('de','messages:contributions-edit-count','s:93:\"de:{{GENDER:$1|Ein Benutzer|Eine Benutzerin}} mit $2 {{PLURAL:$2|Bearbeitung|Bearbeitungen}}.\";'),('de','messages:contributions-subtitle','s:24:\"de:Für {{GENDER:$2|$1}}\";'),('de','messages:contributions-summary','s:3:\"en:\";'),('de','messages:contributions-title','s:33:\"de:Benutzerbeiträge von „$1“\";'),('de','messages:contributions-userdoesnotexist','s:50:\"de:Das Benutzerkonto „$1“ ist nicht vorhanden.\";'),('de','messages:converter-manual-rule-error','s:73:\"de:Bei der manuellen Sprachkonvertierungsregel wurde ein Fehler entdeckt.\";'),('de','messages:copyright','s:80:\"de:Der Inhalt ist verfügbar unter der Lizenz $1, sofern nicht anders angegeben.\";'),('de','messages:copyrightpage','s:31:\"de:{{ns:project}}:Urheberrechte\";'),('de','messages:copyrightwarning','s:730:\"de:<strong>Bitte kopiere keine Webseiten, die nicht deine eigenen sind, benutze keine urheberrechtlich geschützten Werke ohne Erlaubnis des Urhebers!</strong><br />\nDu gibst uns hiermit deine Zusage, dass du den Text \'\'\'selbst verfasst\'\'\' hast, dass der Text Allgemeingut \'\'\'(public domain)\'\'\' ist oder dass der \'\'\'Urheber\'\'\' seine \'\'\'Zustimmung\'\'\' gegeben hat. Falls dieser Text bereits woanders veröffentlicht wurde, weise bitte auf der Diskussionsseite darauf hin.\n<i>Bitte beachte, dass alle {{SITENAME}}-Beiträge automatisch unter der „$2“ stehen (siehe $1 für Einzelheiten). Falls du nicht möchtest, dass deine Arbe