erst,\n:* die [https://www.mediawiki.org/wiki/Special:MyLanguage/Download Dateiveröffentlichung von MediaWiki] herunterlädst, die verschiedene Benutzeroberflächen sowie Erweiterungen enthält. Du kannst das dort enthaltene Verzeichnis <code>skins/</code> Verzeichnis nutzen und in das Verzeichnis <code dir=\"ltr\">skins/</code> deiner MediaWiki-Installation kopieren.\n\n; Sofern du MediaWiki gerade aktualisiert hast\n: Bei MediaWiki 1.24 und neueren Versionen werden die installierten Benutzeroberflächen nicht mehr automatisch aktiviert (siehe das [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery Benutzerhandbuch]). Du kannst die {{PLURAL:$5|folgende Zeile|folgenden Zeilen}} in die Datei <code>LocalSettings.php</code> einfügen, um {{PLURAL:$5|die installierte Benutzeroberfläche|alle installierten Benutzeroberflächen}} zu aktivieren:\n\n<pre dir=\"ltr\">$3</pre>\n\n; Falls du gerade die Datei <code>LocalSettings.php</code> geändert hast\n: Überprüfe die Namen der Benutzeroberflächen auf Tippfehler.\";'),('de','messages:default-skin-not-found-no-skins','s:1622:\"de:Hoppla! Die mit <code>$wgDefaultSkin</code> als <code>$1</code>&nbsp;für dein Wiki definierte Standardbenutzeroberfläche ist nicht verfügbar.\n\nDu hast keine Benutzeroberfläche installiert.\n\n; Sofern du MediaWiki gerade installiert oder aktualisiert hast:\n: Du hast MediaWiki vermutlich mit Hilfe von Git oder den Quellcode direkt anhand einer anderen Methode installiert. Das aktuelle Problem war deshalb zu erwarten, da MediaWiki 1.24 und neuere Versionen keine Benutzeroberflächen im Hauptrepositorium enthalten. Installiere zumindest eine im [https://www.mediawiki.org/wiki/Category:All_skins Verzeichnis der Benutzeroberflächen] enthaltene Benutzeroberfläche indem du:\n:* [https://www.mediawiki.org/wiki/Special:MyLanguage/Download_from_Git#Using_Git_to_download_MediaWiki_skins Git zum Herunterladen von Benutzeroberflächen verwendest].\n:* die Dateiveröffentlichungen einzelner Benutzeroberflächen aus [https://www.mediawiki.org/wiki/Special:SkinDistributor MediaWiki.org] herunterlädst und in das Verzeichnis <code dir=\"ltr\">skins/</code> deiner MediaWiki-Installation kopierst,\n:* die [https://www.mediawiki.org/wiki/Special:MyLanguage/Download Dateiveröffentlichung von MediaWiki] herunterlädst, die verschiedene Benutzeroberflächen sowie Erweiterungen enthält. Du kannst das dort enthaltene Verzeichnis <code>skins/</code> Verzeichnis nutzen und in das Verzeichnis <code dir=\"ltr\">skins/</code> deiner MediaWiki-Installation kopieren.\n: Siehe hierzu das [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Skin_configuration/de Benutzerhandbuch zur Konfiguration von Benutzeroberflächen].\";'),('de','messages:default-skin-not-found-row-disabled','s:56:\"de:* <code>$1</code> / $2 (<strong>deaktiviert</strong>)\";'),('de','messages:default-skin-not-found-row-enabled','s:37:\"de:* <code>$1</code> / $2 (aktiviert)\";'),('de','messages:defaultmessagetext','s:15:\"de:Standardtext\";'),('de','messages:defemailsubject','s:73:\"de:{{SITENAME}} – E-Mail von {{GENDER:$1|Benutzer|Benutzerin}} „$1“\";'),('de','messages:deflate-invaliddeflate','s:62:\"de:Der angegebene Inhalt ist nicht ordnungsgemäß komprimiert\";'),('de','messages:delete','s:11:\"de:Löschen\";'),('de','messages:delete-confirm','s:24:\"de:Löschen von „$1“\";'),('de','messages:delete-edit-reasonlist','s:27:\"de:Löschgründe bearbeiten\";'),('de','messages:delete-edit-reasonlist-suppress','s:30:\"de:Oversightgründe bearbeiten\";'),('de','messages:delete-error-associated-alreadytalk','s:87:\"de:Die zugehörige Diskussionsseite einer Diskussionsseite kann nicht gelöscht werden.\";'),('de','messages:delete-error-associated-doesnotexist','s:84:\"de:Eine nicht existierende zugehörige Diskussionsseite kann nicht gelöscht werden.\";'),('de','messages:delete-hook-aborted','s:120:\"de:Die Löschung wurde von einer Programmerweiterung zu MediaWiki verhindert.\nEs ist hierzu keine Erklärung verfügbar.\";'),('de','messages:de