 wie\n<code><nowiki>{{</nowiki>#language:…}}</code> und Variablen wie\n<code><nowiki>{{</nowiki>CURRENTDAY}}</code> werden ausgewertet –\nfaktisch alles, was in doppelten geschweiften Klammern enthalten ist.\";'),('de','messages:expand_templates_ok','s:22:\"de:Vorlage expandieren\";'),('de','messages:expand_templates_output','s:11:\"de:Ergebnis\";'),('de','messages:expand_templates_preview','s:11:\"de:Vorschau\";'),('de','messages:expand_templates_preview_fail_html','s:458:\"de:<em>Da {{SITENAME}} rohes HTML aktiviert hat und es einen Verlust deiner Sitzungsdaten gab, ist die Vorschau als Vorsichtsmaßnahme gegen JavaScript-Angriffe versteckt.</em>\n\n<strong>Falls dies ein zulässiger Vorschauversuch ist, versuche es bitte erneut.</strong>\nFalls dieses Problem weiterhin bestehen bleibt, versuche dich [[Special:UserLogout|abzumelden]] und erneut anzumelden und überprüfe, ob dein Browser Cookies von dieser Website akzeptiert.\";'),('de','messages:expand_templates_preview_fail_html_anon','s:291:\"de:<em>Da {{SITENAME}} rohes HTML aktiviert hat und du nicht angemeldet bist, ist die Vorschau als Vorsichtsmaßnahme gegen JavaScript-Angriffe versteckt.</em>\n\n<strong>Falls dies ein zulässiger Vorschauversuch ist, [[Special:UserLogin|melde dich bitte an]] und versuche es erneut.</strong>\";'),('de','messages:expand_templates_remove_comments','s:23:\"de:Kommentare entfernen\";'),('de','messages:expand_templates_remove_nowiki','s:45:\"de:<nowiki>-Tags in der Ausgabe unterdrücken\";'),('de','messages:expand_templates_title','s:53:\"de:Kontexttitel für beispielsweise {{FULLPAGENAME}}:\";'),('de','messages:expand_templates_xml_output','s:14:\"de:XML-Ausgabe\";'),('de','messages:expandtemplates','s:23:\"de:Vorlagen expandieren\";'),('de','messages:expansion-depth-exceeded-category','s:55:\"de:Seiten, die die Expansionstiefe überschritten haben\";'),('de','messages:expansion-depth-exceeded-category-desc','s:60:\"de:Die Seite überschreitet die maximale Expandierungstiefe.\";'),('de','messages:expansion-depth-exceeded-warning','s:52:\"de:Die Seite hat die Expansionstiefe überschritten.\";'),('de','messages:expensive-parserfunction-category','s:59:\"de:Seiten, die aufwändige Parserfunktionen zu oft aufrufen\";'),('de','messages:expensive-parserfunction-category-desc','s:208:\"de:Die Seite verwendet zu viele aufwändige Parserfunktionen (wie <code>#ifexist</code>). Siehe das [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgExpensiveParserFunctionLimit Benutzerhandbuch].\";'),('de','messages:expensive-parserfunction-warning','s:214:\"de:\'\'\'Achtung:\'\'\' Diese Seite enthält zu viele Aufrufe aufwändiger Parserfunktionen.\n\nSie darf nicht mehr als $2 {{PLURAL:$2|Aufruf|Aufrufe}} haben, es {{PLURAL:$1|ist aktuell $1 Aufruf|sind aktuell $1 Aufrufe}}.\";'),('de','messages:explainconflict','s:372:\"de:Jemand anders hat diese Seite geändert, nachdem du angefangen hast, sie zu bearbeiten.\nDas obere Textfeld enthält den aktuellen Bearbeitungsstand der Seite.\nDas untere Textfeld enthält deine Änderungen.\nBitte füge deine Änderungen in das obere Textfeld ein.\n<strong>Nur</strong> der Inhalt des oberen Textfeldes wird veröffentlicht, wenn du auf „$1“ klickst.\";'),('de','messages:export','s:21:\"de:Seiten exportieren\";'),('de','messages:export-addcat','s:14:\"de:Hinzufügen\";'),('de','messages:export-addcattext','s:46:\"de:Seiten aus folgender Kategorie hinzufügen:\";'),('de','messages:export-addns','s:14:\"de:Hinzufügen\";'),('de','messages:export-addnstext','s:47:\"de:Seiten aus folgendem Namensraum hinzufügen:\";'),('de','messages:export-download','s:26:\"de:Als XML-Datei speichern\";'),('de','messages:export-manual','s:30:\"de:Seiten manuell hinzufügen:\";'),('de','messages:export-pagelinks','s:77:\"de:Verlinkte Seiten automatisch mit exportieren, bis zur Rekursionstiefe von:\";'),('de','messages:export-submit','s:21:\"de:Seiten exportieren\";'),('de','messages:export-summary','s:3:\"en:\";'),('de','messages:export-templates','s:21:\"de:Inklusive Vorlagen\";'),('de','messages:exportall','s:26:\"de:Alle Seiten exportieren\";'),('de','messages:exportcuronly','s:49:\"de:Nur die aktuelle Version der Seite exportieren\";'),('de','messages:exportlistauthors','s:77:\"de:Für jede Seite die jeweils vollständige Liste der Bearbeiter einbeziehen\";'),('de','messages:exportnohistory','s:133:\"de:----\n\'\'\'Hinweis:\'\'\' Der Export kompletter Versionsgeschichten ist aus Gründen der Systemleistung bis auf Weiteres nicht möglich.\";'),('de','messages:exporttext','s:503:\"de:Mit dieser Spezialseite kannst du den Text inklusive der Versionsgeschichte einzelner Seiten in eine XML-Datei exportieren.\nDie Datei kann in ein anderes MediaWiki-Wiki über die [[Special:Import|Importfunktion]] eingespielt werden.\n\nTrage den oder die entsprechenden Seitentitel in das folgende Textfeld ein (pro Zeile jeweils nur eine Seite).\n\nAlternativ ist der Export auch mit der Syntax [[{{#Special:Export}}/{{MediaWiki:Mainpage}}]] möglich, beispielsweise für die [[{{MediaWiki:Mainpage}}]].\";'),('de','messages:external_image_whitelist','s:549:\"de: #Diese Zeile nicht verändern.<pre>\n#Untenstehend können Fragmente regulärer Ausdrücke (der Teil zwischen den //) eingegeben werden.\n#Diese werden mit den URLs von Bildern aus externen Quellen verglichen.\n#Ein positiver Vergleich führt zur Anzeige des Bildes, andernfalls wird das Bild nur als Link angezeigt.\n#Zeilen, die mit einem # beginnen, werden als Kommentar behandelt.\n#Es wird nicht zwischen Groß- und Kleinschreibung unterschieden.\n\n#Fragmente regulärer Ausdrücke nach dieser Zeile eintragen. Diese Zeile nicht verändern.</pre>\";'),('de','messages:externaldberror','s:131:\"de:Entweder liegt ein Fehler bei der externen Authentifizierung vor oder du darfst dein externes Benutzerkonto nicht aktualisieren.\";'),('de','messages:faq','s:27:\"de:Häufig gestellte Fragen\";'),('de','messages:fatalpassworderror','s:148:\"de:$1\n\nAus Sicherheitsgründen kannst du dich mit diesem Passwor