Hashwertes.\";'),('de','messages:fileexists','s:183:\"de:Eine Datei dieses Namens ist bereits vorhanden. Bitte prüfe <strong>[[:$1]]</strong>, sofern {{GENDER:|du}} dir nicht sicher bist, ob du sie überschreiben möchtest.\n[[$1|thumb]]\";'),('de','messages:fileexists-duplicate-version','s:140:\"de:Die hochgeladene Datei ist ein exaktes Duplikat {{PLURAL:$2|einer älteren Version|von älteren Versionen}} von <strong>[[:$1]]</strong>.\";'),('de','messages:fileexists-extension','s:249:\"de:Eine Datei ähnlichen Namens ist bereits vorhanden: [[$2|thumb]]\n* Name der hochzuladenden Datei: <strong>[[:$1]]</strong>\n* Name der bereits vorhandenen Datei: <strong>[[:$2]]</strong>\nMöchtest du vielleicht einen eindeutigeren Namen verwenden?\";'),('de','messages:fileexists-forbidden','s:190:\"de:Unter diesem Namen existiert bereits eine Datei und sie kann nicht überschrieben werden. Bitte gehe zurück und lade die Datei unter einem anderen Namen hoch. [[File:$1|thumb|center|$1]]\";'),('de','messages:fileexists-no-change','s:102:\"de:Die hochgeladene Datei ist ein exaktes Duplikat der aktuellen Version von <strong>[[:$1]]</strong>.\";'),('de','messages:fileexists-shared-forbidden','s:197:\"de:Unter diesem Namen existiert bereits eine Datei im zentralen Medienarchiv.\nWenn du diese Datei trotzdem hochladen möchtest, gehe bitte zurück und ändere den Namen.\n[[File:$1|thumb|center|$1]]\";'),('de','messages:fileexists-thumbnail-yes','s:269:\"de:Bei der Datei scheint es sich um ein Bild verringerter Größe \'\'(Miniatur)\'\' zu handeln. [[$1|thumb]]\nBitte prüfe die Datei <strong>[[:$1]]</strong>.\nWenn es sich um das Bild in Originalgröße handelt, so braucht kein separates Vorschaubild hochgeladen zu werden.\";'),('de','messages:filehist','s:17:\"de:Dateiversionen\";'),('de','messages:filehist-comment','s:12:\"de:Kommentar\";'),('de','messages:filehist-current','s:10:\"de:aktuell\";'),('de','messages:filehist-datetime','s:14:\"de:Version vom\";'),('de','messages:filehist-deleteall','s:2