51:\"de:Diese Seite enthält momentan noch keinen Text.\nDu kannst sie <span class=\"plainlinks\">[{{fullurl:{{FULLPAGENAME}}|action=edit}} erstellen]</span>,\nihren Titel auf anderen Seiten [[Special:Search/{{PAGENAME}}|suchen]]\noder die zugehörigen <span class=\"plainlinks\">[{{fullurl:{{#special:Log}}|page={{FULLPAGENAMEE}}}} Logbücher betrachten]</span>.\";'),('de','messages:noarticletext-nopermission','s:326:\"de:Diese Seite enthält momentan noch keinen Text und du bist auch nicht dazu berechtigt, diese Seite zu erstellen.\nDu kannst ihren Titel auf anderen Seiten [[Special:Search/{{PAGENAME}}|suchen]] oder die zugehörigen <span class=\"plainlinks\">[{{fullurl:{{#special:Log}}|page={{FULLPAGENAMEE}}}} Logbücher betrachten].</span>\";'),('de','messages:noarticletextanon','s:24:\"en:{{int:noarticletext}}\";'),('de','messages:noautoblockblock','s:24:\"de:Autoblock deaktiviert\";'),('de','messages:nocontribs','s:67:\"de:Es wurden keine Benutzerbeiträge mit diesen Kriterien gefunden.\";'),('de','messages:nocookiesforlogin','s:25:\"en:{{int:nocookieslogin}}\";'),('de','messages:nocookiesfornew','s:207:\"de:Das Benutzerkonto wurde nicht erstellt, da die Datenherkunft nicht ermittelt werden konnte.\nBitte stelle sicher, dass du Cookies aktiviert hast. Lade diese Seite danach erneut und versuche es noch einmal.\";'),('de','messages:nocookieslogin','s:134:\"de:{{SITENAME}} benutzt Cookies zur Anmeldung der Benutzer. Du hast Cookies deaktiviert, bitte aktiviere diese und versuche es erneut.\";'),('de','messages:nocookiesnew','s:227:\"de:Der Benutzerzugang wurde erstellt, aber du bist nicht angemeldet. {{SITENAME}} benötigt für diese Funktion Cookies, bitte aktiviere diese und melde dich dann mit deinem neuen Benutzernamen und dem zugehörigen Passwort an.\";'),('de','messages:nocreate-loggedin','s:85:\"de:Du hast nicht die erforderliche Berechtigung, um neue Seiten erstellen zu können.\";'),('de','messages:nocreatetext','s:146:\"de:Auf {{SITENAME}} wurde das Erstellen neue