\"en:<span class=\"passwordpolicies-policy\">$1 <code>($2)</code></span> <span class=\"passwordpolicies-policy-flags\">($3)</span>\";'),('de','messages:passwordpolicies-policy-maximalpasswordlength','s:71:\"de:Ein Passwort muss weniger als {{PLURAL:$1|ein|$1}} Zeichen lang sein\";'),('de','messages:passwordpolicies-policy-minimalpasswordlength','s:70:\"de:Ein Passwort muss mindestens {{PLURAL:$1|ein|$1}} Zeichen lang sein\";'),('de','messages:passwordpolicies-policy-minimumpasswordlengthtologin','s:94:\"de:Für die Anmeldung muss das Passwort muss mindestens {{PLURAL:$1|ein|$1}} Zeichen lang sein\";'),('de','messages:passwordpolicies-policy-passwordcannotbesubstringinusername','s:67:\"de:Das Passwort darf keine Teilzeichenfolge des Benutzernamens sein\";'),('de','messages:passwordpolicies-policy-passwordcannotmatchdefaults','s:94:\"de:Das Passwort darf nicht mit einer bestimmten Liste von Standardpasswörtern übereinstimmen\";'),('de','messages:passwordpolicies-policy-passwordnotincommonlist','s:98:\"de:Das Passwort darf nicht in der Liste der 100.000 am häufigsten verwendeten Passwörter stehen.\";'),('de','messages:passwordpolicies-policyflag-forcechange','s:42:\"de:muss bei der Anmeldung geändert werden\";'),('de','messages:passwordpolicies-policyflag-suggestchangeonlogin','s:42:\"de:Änderung bei der Anmeldung vorschlagen\";'),('de','messages:passwordpolicies-summary','s:109:\"de:Dies ist eine Liste der wirksamen Passwortrichtlinien für die in diesem Wiki definierten Benutzergruppen.\";'),('de','messages:passwordremindertext','s:464:\"de:Jemand mit der IP-Adresse $1 hat ein neues Passwort für die Anmeldung bei {{SITENAME}} ($4) angefordert.\n\nDas automatisch generierte Passwort für Benutzer „$2“ lautet nun: $3\n\nFalls du dies wirklich gewünscht hast, solltest du dich jetzt anmelden und das Passwort ändern.\nDas neue Passwort ist {{PLURAL:$5|einen Tag|$5 Tage}} gültig.\n\nBitte ignoriere diese E-Mail, falls du sie nicht selbst angefordert hast. Das alte Passwort bleibt weiterhin gültig.\";'),('de','messages:passwordremindertitle','s:66:\"de:Neues temporäres Passwort für dein {{SITENAME}}-Benutzerkonto\";'),('de','messages:passwordreset','s:25:\"de:Passwort zurücksetzen\";'),('de','messages:passwordreset-disabled','s:71:\"de:Das Zurücksetzen von Passwörtern wurde in diesem Wiki deaktiviert.\";'),('de','messages:passwordreset-domain','s:10:\"de:Domain:\";'),('de','messages:passwordreset-email','s:18:\"de:E-Mail-Adresse:\";'),('de','messages:passwordreset-emaildisabled','s:60:\"de:Die E-Mail-Funktionen wurden auf diesem Wiki deaktiviert.\";'),('de','messages:passwordreset-emailelement','s:47:\"de:Benutzername: \n$1\n\nTemporäres Passwort: \n$2\";'),('de','messages:passwordreset-emailtext-ip','s:691:\"de:Jemand mit der IP-Adresse $1, wahrscheinlich du selbst, hat eine Zurücksetzung deines Passworts bei {{SITENAME}} angefordert ($4). {{PLURAL:$3|Das folgende Benutzerkonto ist|Die folgenden Benutzerkonten sind}} mit dieser E-Mail-Adresse verknüpft:\n\n$2\n\n{{PLURAL:$3|Dieses temporäre Passwort läuft|Diese temporären Passwörter laufen}} innerhalb von {{PLURAL:$5|einem Tag|$5 Tagen}} ab.\n\nDu solltest dich anmelden und ein neues Passwort vergeben. Falls jemand anderes diese Anfrage getätigt hat oder du dich wieder an dein ursprüngliches Passwort erinnern kannst und es nicht länger ändern möchtest, kannst du diese Nachricht ignorieren und weiterhin dein altes Passwort benutzen.\";'),('de','messages:passwordreset-emailtext-require-email','s:348:\"de:Wenn du diese Anfrage jedoch nicht generiert hast und unerwünschte E-Mails verhindern möchtest, kannst du deine E-Mail-Optionen über\n$1\naktualisieren.\nDu kannst festlegen, dass sowohl Benutzername als auch E-Mail-Adresse benötigt werden, um die Passwort-Zurücksetzen-E-Mail zu veranlassen. Dies kann die Anzahl solcher Vorfälle verringern.\";'),('de','messages:passwordreset-emailtext-user','s:655:\"de:Benutzer $1 bei {{SITENAME}} hat eine Zurücksetzung deines Passworts bei {{SITENAME}} angefordert ($4). {{PLURAL:$3|Das folgende Benutzerkonto ist|Die folgenden Benutzerkonten sind}} mit dieser E-Mail-Adresse verknüpft:\n\n$2\n\n{{PLURAL:$3|Dieses temporäre Passwort läuft|Diese temporären Passwörter laufen}} innerhalb von {{PLURAL:$5|einem Tag|$5 Tagen}} ab. Du solltest dich anmelden und ein neues Passwort vergeben. Falls jemand anderes diese Anfrage getätigt hat oder du dich wieder an dein ursprüngliches Passwort erinnern kannst und es nicht ändern möchtest, kannst du diese Nachricht ignorieren und weiterhin dein altes Passwort benutzen.\";'),('de','messages:passwordreset-emailtitle','s:46:\"de:Benutzerkontoinformationen auf {{SITENAME}}\";'),('de','messages:passwordreset-ignored','s:113:\"de:Die Passwortzurücksetzung konnte nicht verarbeitet werden. Vielleicht wurde kein Dienstanbieter konfiguriert?\";'),('de','messages:passwordreset-nocaller','s:37:\"de:Es muss ein Rufer angegeben werden\";'),('de','messages:passwordreset-nodata','s:66:\"de:Weder ein Benutzername noch eine E-Mail-Adresse wurde angegeben\";'),('de','messages:passwordreset-nosuchcaller','s:32:\"de:Rufer ist nicht vorhanden: $1\";'),('de','messages:passwordreset-success','s:55:\"de:Du hast das Zurücksetzen des Passworts angefordert.\";'),('de','messages:passwordreset-success-details-generic','s:604:\"de:Wenn die eingereichten Informationen gültig sind, wird eine E-Mail zum Zurücksetzen des Passworts gesendet. Wenn du keine E-Mail erhalten hast, empfehlen wir dir, die [[mw:Special:MyLanguage/Help:Reset_password|Hilfeseite zum Zurücksetzen des Passworts]] zu besuchen oder es später nochmal zu versuchen. Du kannst nur <strong>eine begrenzte Anzahl von Passwortzurücksetzungen innerhalb einer kurzen Zeitspanne anfordern. Beachte, dass nur eine E-Mail zum Zurücksetzen des Passworts pro gültiges Konto {{PLURAL:$1|pro Stunde|alle $1 Stunden}}</strong> gesendet wird, um Missbrauch zu verhindern.\";'),('de','messages:passwordreset-success-info','s:46:\"de:Die von dir übermittelten Details sind: $1\";'),('de','messages:passwordreset-text-many','s:107:\"de:{{PLURAL:$1|Fülle eines der Felder aus, um ein temporäres Passwort per E-Mail zugesandt zu bekommen.}}\";'),('de','messages:passwordreset-text-one','s:82:\"de:Fülle dieses Formular aus, um ein temporäres Passwort per E-Mail zu erhalten.\";'),('de','messages:passwordreset-username','s:16:\"de:Benutzername:\";'),('de','messages:passwordsent','s:192:\"de:Ein neues, temporäres Passwort wurde an die E-Mail-Adresse von Benutzer „$1“ gesandt.\nBitte melde dich damit an, sobald du es erhalten hast. Das alte Passwort bleibt weiterhin gültig.\";'),('de','messages:passwordtoolong','s:75:\"de:Passwörter können nicht länger als {{PLURAL:$1|ein|$1}} Zeichen sein.\";'),('de','messages:passwordtooshort','s:79:\"de:Passwörter müssen mindestens {{PLURAL:$1|1 Zeichen|$1 Zeichen}} lang sein.\";'),('de','messages:patrol-log-auto','s:14:\"en:(automatic)\";'),('de','messages:patrol-log-diff','s:14:\"en:revision $1\";'),('de','messages:patrol-log-header','s:33:\"de:Dies ist das Kontroll-Logbuch.\";'),('de','messages:patrol-log-line','s:31:\"en:marked $1 of $2 patrolled $3\";'),('de','messages:patrol-log-page','s:19:\"de:Kontroll-Logbuch\";'),('de','messages:pear-mail-error','s:5:\"en:$1\";'),('de','messages:percent','s:12:\"de:$1&#160;%\";'),('de','messages:perfcached','s:163:\"de:Die folgenden Daten stammen aus dem Cache und sind möglicherweise nicht aktuell. Maximal {{PLURAL:$1|ein Ergebnis ist|$1 Ergebnisse sind}} im Cache verfügbar.\";'),('de','messages:perfcachedts','s:170:\"de:Diese Daten stammen aus dem Cache. Der Zeitpunkt der letzten Aktualisierung: $2, $3 Uhr. Maximal {{PLURAL:$4|ein Ergebnis ist|$4 Ergebnisse sind}} im Cache verfügbar.\";'),('de','messages:period-am','s:5:\"de:AM\";'),('de','messages:period-pm','s:5:\"de:PM\";'),('de','messages:permalink','s:19:\"de:Permanenter Link\";'),('de','messages:permanentlink','s:19:\"de:Permanenter Link\";'),('de','messages:permanentlink-revid','s:18:\"de:Versionskennung\";')