ehen/wiederherstellen\";'),('de','messages:undeletepage','s:50:\"de:Gelöschte Seiten anzeigen und wiederherstellen\";'),('de','messages:undeletepagetext','s:155:\"de:Die {{PLURAL:$1|folgende Seite wurde gelöscht und kann|folgenden $1 Seiten wurden gelöscht und können}} von Administratoren wiederhergestellt werden:\";'),('de','messages:undeletepagetitle','s:77:\"de:\'\'\'Die folgende Ausgabe zeigt die gelöschten Versionen von [[:$1|$1]]\'\'\'.\";'),('de','messages:undeleterevdel','s:259:\"de:Die Wiederherstellung wird nicht durchgeführt, wenn die aktuellste Version versteckt ist oder versteckte Teile enthält.\nIn diesem Fall darf die aktuellste Version nicht markiert werden oder ihr Status muss auf den einer normalen Version geändert werden.\";'),('de','messages:undeleterevision-missing','s:136:\"de:Ungültige oder fehlende Version. Entweder ist der Link falsch oder die Version wurde aus dem Archiv wiederhergestellt oder entfernt.\";'),('de','messages:undeleterevisions','s:52:\"de:{{PLURAL:$1|Eine Version|$1 Versionen}} gelöscht\";'),('de','messages:undeleteviewlink','s:10:\"de:ansehen\";'),('de','messages:underline-always','s:8:\"de:immer\";'),('de','messages:underline-default','s:64:\"de:abhängig von der Benutzeroberfläche oder Browsereinstellung\";'),('de','messages:underline-never','s:6:\"de:nie\";'),('de','messages:undo-failure','s:121:\"de:Die Änderung konnte nicht rückgängig gemacht werden, da der betroffene Abschnitt zwischenzeitlich verändert wurde.\";'),('de','messages:undo-main-slot-only','s:112:\"de:Die Bearbeitung konnte nicht rückgängig gemacht werden, da sie Inhalte außerhalb der Hauptspalte enthält.\";'),('de','messages:undo-nochange','s:68:\"de:Anscheinend wurde diese Bearbeitung bereits rückgängig gemacht.\";'),('de','messages:undo-norev','s:109:\"de:Die Bearbeitung konnte nicht rückgängig gemacht werden, da sie nicht vorhanden ist oder gelöscht wurde.\";'),('de','messages:undo-success','s:227:\"de:Die Bearbeitung kann rückgängig gemacht werden.\nBit