ner SVG-Datei Bilder einzubinden. <code>&lt;$1 $2=\"$3\"&gt;</code> gefunden.\";'),('de','messages:uploaded-href-unsafe-target-svg','s:110:\"de:href zu unsicheren Daten gefunden: URI-Ziel <code>&lt;$1 $2=\"$3\"&gt;</code> in der hochgeladenen SVG-Datei.\";'),('de','messages:uploaded-image-filter-svg','s:98:\"de:Bildfilter mit der URL <code>&lt;$1 $2=\"$3\"&gt;</code> in der hochgeladenen SVG-Datei gefunden.\";'),('de','messages:uploaded-remote-url-svg','s:148:\"de:SVG, das ein beliebiges Style-Attribut mit einer Remote-URL festlegt, ist gesperrt. <code>$1=\"$2\"</code> in der hochgeladenen SVG-Datei gefunden.\";'),('de','messages:uploaded-script-svg','s:66:\"de:Skriptelement „$1“ in der hochgeladenen SVG-Datei gefunden.\";'),('de','messages:uploaded-setting-event-handler-svg','s:135:\"de:Das Festlegen von Ereignis-Handler-Attributen ist gesperrt. <code>&lt;$1 $2=\"$3\"&gt;</code> in der hochgeladenen SVG-Datei gefunden.\";'),('de','messages:uploaded-setting-handler-svg','s:148:\"de:SVG, das das Attribut „handler“ mit Remote/Daten/Skript festlegt, ist gesperrt. <code>$1=\"$2\"</code> in der hochgeladenen SVG-Datei gefunden.\";'),('de','messages:uploaded-setting-href-svg','s:119:\"de:Die Verwendung des Tags „set“ zum Hinzufügen des Attributs „href“ zum übergeordneten Element ist gesperrt.\";'),('de','messages:uploaded-wrong-setting-svg','s:202:\"de:Die Verwendung des Tags „set“ zum Hinzufügen eines Remote-/Daten-/Skriptziels zu einem beliebigen Attribut ist gesperrt. <code>&lt;set to=\"$1\"&gt;</code> in der hochgeladenen SVG-Datei gefunden.\";'),('de','messages:uploadedimage','s:20:\"en:uploaded \"[[$1]]\"\";'),('de','messages:uploaderror','s:24:\"de:Fehler beim Hochladen\";'),('de','messages:uploadfooter','s:4:\"en:-\";'),('de','messages:uploadinvalidxml','s:66:\"de:Das XML in der hochgeladenen Datei konnte nicht geparst werden.\";'),('de','messages:uploadlogpage','s:16:\"de:Datei-Logbuch\";'),('de','messages:uploadlogpagetext','s:141:\"de:Dies ist das Logbuch der h