erden auch im [[Special:Log/upload|Datei-Logbuch]] eingetragen. Löschungen werden im [[Special:Log/delete|Lösch-Logbuch]] eingetragen.\n\nUm eine \'\'\'Datei\'\'\' in einer Seite zu verwenden, nutze einen Link in der folgenden Form:\n* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:Datei.jpg]]</nowiki></code></strong> – für ein Vollbild\n* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:Datei.png|200px|thumb|left|Alternativer Text]]</nowiki></code></strong> – für ein 200px breites Bild innerhalb einer Box, mit „Alternativer Text“ als Bildbeschreibung\n* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:Datei.pdf]]</nowiki></code></strong> – für einen direkten Link auf die Datei, ohne Darstellung der Datei\";'),('de','messages:uploadvirus','s:48:\"de:Diese Datei enthält einen Virus! Details: $1\";'),('de','messages:uploadwarning','s:10:\"de:Warnung\";'),('de','messages:uploadwarning-text','s:68:\"de:Bitte ändere unten die Dateibeschreibung und versuche es erneut.\";'),('de','messages:uploadwarning-text-nostash','s:91:\"de:Bitte lade die Datei erneut hoch, ändere unten die Beschreibung und versuche es erneut.\";'),('de','messages:user-mail-no-addy','s:80:\"de:Es wurde versucht, eine E-Mail ohne Angabe einer E-Mail-Adresse zu versenden.\";'),('de','messages:user-mail-no-body','s:91:\"de:Es wurde versucht, eine E-Mail mit einem leeren oder zu kurzen Textkörper zu versenden.\";'),('de','messages:usercreated','s:41:\"de:{{GENDER:$3|Erstellt}} am $1 um $2 Uhr\";'),('de','messages:usercssispublic','s:135:\"de:Bitte beachten: CSS-Unterseiten sollten keine vertraulichen Daten enthalten, da sie von anderen Benutzern eingesehen werden können.\";'),('de','messages:usercsspreview','s:124:\"de:<strong>Beachte, dass du nur eine Vorschau deines Benutzer-CSS betrachtest.\nEs wurde noch nicht veröffentlicht!</strong>\";'),('de','messages:usercssyoucanpreview','s:125:\"de:<strong>Tipp:</strong> Benutze den „{{int:showpreview}}“-Button, um dein neues CSS vor dem Veröffent