Special:Contributions/$2|{{int:contribslink}}]]).\nSomeone else has edited or rolled back the page already.\n\nThe last edit to the page was by [[User:$3|$3]] ([[User talk:$3|talk]]{{int:pipe-separator}}[[Special:Contributions/$3|{{int:contribslink}}]]).\";'),('en','messages:ancientpages','s:15:\"en:Oldest pages\";'),('en','messages:ancientpages-summary','s:3:\"en:\";'),('en','messages:and','s:11:\"en:&#32;and\";'),('en','messages:anoncontribs','s:16:\"en:Contributions\";'),('en','messages:anoneditwarning','s:270:\"en:<strong>Warning:</strong> You are not logged in. Your IP address will be publicly visible if you make any edits. If you <strong>[$1 log in]</strong> or <strong>[$2 create an account]</strong>, your edits will be attributed to your username, along with other benefits.\";'),('en','messages:anonnotice','s:4:\"en:-\";'),('en','messages:anononlyblock','s:13:\"en:anon. only\";'),('en','messages:anonpreviewwarning','s:102:\"en:<em>You are not logged in. Publishing will record your IP address in this page\'s edit history.</em>\";'),('en','messages:anontalk','s:7:\"en:Talk\";'),('en','messages:anontalkpagetext','s:472:\"en:----\n<em>This is the discussion page for an anonymous user who has not created an account yet, or who does not use it.</em>\nWe therefore have to use the numerical IP address to identify them.\nSuch an IP address can be shared by several users.\nIf you are an anonymous user and feel that irrelevant comments have been directed at you, please [[Special:CreateAccount|create an account]] or [[Special:UserLogin|log in]] to avoid future confusion with other anonymous users.\";'),('en','messages:anonuser','s:33:\"en:{{SITENAME}} anonymous user $1\";'),('en','messages:anonusers','s:53:\"en:{{SITENAME}} anonymous {{PLURAL:$2|user|users}} $1\";'),('en','messages:anonymous','s:53:\"en:Anonymous {{PLURAL:$1|user|users}} of {{SITENAME}}\";'),('en','messages:api-clientside-error-aborted','s:27:\"en:The request was aborted.\";'),('en','messages:api-clientside-error-http','s:34:\"en:Server returned error: HTTP $1.\";'),('en','messages:api-clientside-error-invalidresponse','s:32:\"en:Invalid response from server.\";'),('en','messages:api-clientside-error-noconnect','s:99:\"en:Could not connect to the server. Make sure you have a working internet connection and try again.\";'),('en','messages:api-clientside-error-timeout','s:55:\"en:The server did not respond within the expected time.\";'),('en','messages:api-credits','s:370:\"en:API developers:\n* Yuri Astrakhan (creator, lead developer Sep 2006–Sep 2007)\n* Roan Kattouw (lead developer Sep 2007–2009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Brad Jorsch (lead developer 2013–2020)\n\nPlease send your comments, suggestions and questions to mediawiki-api@lists.wikimedia.org\nor file a bug report at https://phabricator.wikimedia.org/.\";'),('en','messages:api-credits-header','s:10:\"en:Credits\";'),('en','messages:api-error-badtoken','s:29:\"en:Internal error: Bad token.\";'),('en','messages:api-error-emptypage','s:44:\"en:Creating new, empty pages is not allowed.\";'),('en','messages:api-error-publishfailed','s:59:\"en:Internal error: Server failed to publish temporary file.\";'),('en','messages:api-error-stashfailed','s:57:\"en:Internal error: Server failed to store temporary file.\";'),('en','messages:api-error-unknown-warning','s:25:\"en:Unknown warning: \"$1\".\";'),('en','messages:api-error-unknownerror','s:23:\"en:Unknown error: \"$1\".\";'),('en','messages:api-exception-trace','s:18:\"en:$1 at $2($3)\n$4\";'),('en','messages:api-feed-error-title','s:13:\"en:Error ($1)\";'),('en','messages:api-format-prettyprint-header','s:394:\"en:This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set <kbd>format=$2</kbd>.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('en','messages:api-format-prettyprint-header-hyperlinked','s:380:\"en:This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set [$3 <kbd>format=$2</kbd>].\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('en','messages:api-format-prettyprint-header-only-html','s:222:\"en:This is an HTML representation intended for debugging, and is unsuitable for application use.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('en','messages:api-format-prettyprint-status','s:58:\"en:This response would be returned with HTTP status $1 $2.\";'),('en','messages:api-format-title','s:23:\"en:MediaWiki API result\";'),('en','messages:api-help-authmanager-general-usage','s:1254:\"en:The general procedure to use this module is:\n# Fetch the fields available from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$4</kbd>, and a <kbd>$5</kbd> token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Present the fields to the user, and obtain their submission.\n# Post to this module, supplying <var>$1returnurl</var> and any relevant fields.\n# Check the <samp>status</samp> in the response.\n#* If you received <samp>PASS</samp> or <samp>FAIL</samp>, you\'re done. The operation either succeeded or it didn\'t.\n#* If you received <samp>UI</samp>, present the new fields to the user and obtain their submission. Then post to this module with <var>$1continue</var> and the relevant fields set, and repeat step 4.\n#* If you received <samp>REDIRECT</samp>, direct the user to the <samp>redirecttarget</samp> and wait for the return to <var>$1returnurl</var>. Then post to this module with <var>$1continue</var> and any fields passed to the return URL, and repeat step 4.\n#* If you received <samp>RESTART</samp>, that means the authentication worked but we don\'t have a linked user account. You might treat this as <samp>UI</samp> or as <samp>FAIL</samp>.\";'),('en','messages:api-help-authmanagerhelper-additional-params','s:344:\"en:This module accepts additional parameters depending on the available authentication requests. Use <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> (or a previous response from this module, if applicable) to determine the requests available and the fields that they use.\";'),('en','messages:api-help-authmanagerhelper-continue','s:152:\"en:This request is a continuation after an earlier <samp>UI</samp> or <samp>REDIRECT</samp> response. Either this or <var>$1returnurl</var> is required.\";'),('en','messages:api-help-authmanagerhelper-mergerequestfields','s:74:\"en:Merge field information for all authentication requests into one array.\";'),('en','messages:api-help-authmanagerhelper-messageformat','s:40:\"en:Format to use for returning messages.\";'),('en','messages:api-help-authmanagerhelper-preservestate','s:68:\"en:Preserve state from a previous failed login attempt, if possible.\";'),('en','messages:api-help-authmanagerhelper-request','s:194:\"en:Use this authentication request, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd>.\";'),('en','messages:api-help-authmanagerhelper-requests','s:246:\"en:Only use these authentication requests, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> or from a previous response from this module.\";'),('en','messages:api-help-authmanagerhelper-returnurl','s:517:\"en:Return URL for third-party authentication flows, must be absolute. Either this or <var>$1continue</var> is required.\n\nUpon receiving a <samp>REDIRECT</samp> response, you will typically open a browser or web view to the specified <samp>redirecttarget</samp> URL for a third-party authentication flow. When that completes, the third party will send the browser or web view to this URL. You should extract any query or POST parameters from the URL and pass them as a <var>$1continue</var> request to this API module.\";'),('en','messages:api-help-datatype-boolean','s:171:\"en:Boolean parameters work like HTML checkboxes: if the parameter is specified, regardless of value, it is considered true. For a false value, omit the parameter entirely.\";'),('en','messages:api-help-datatype-expiry','s:237:\"en:Expiry values may be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). For no expiry, use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> or <kbd>never</kbd>.\";'),('en','messages:api-help-datatype-timestamp','s:391:\"en:Timestamps may be specified in several formats, see [[mw:Special:MyLanguage/Timestamp|the Timestamp library input formats documented on mediawiki.org]] for details. ISO 8601 date and time is recommended: <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd>. Additionally, the string <kbd>now</kbd> may be used to specify the current timestamp.\";'),('en','messages:api-help-datatypes-header','s:13:\"en:Data types\";'),('en','messages:api-help-datatypes-top','s:619:\"en:Input to MediaWiki should be NFC-normalized UTF-8. MediaWiki may attempt to convert other input, but this may cause some operations (such as [[Special:ApiHelp/edit|edits]] with MD5 checks) to fail.\n\nParameters that take multiple values are normally submitted with the values separated using the pipe character, e.g. <kbd>param=value1|value2</kbd> or <kbd>param=value1%7Cvalue2</kbd>. If a value must contain the pipe character, use U+001F (Unit Separator) as the separator \'\'and\'\' prefix the value with U+001F, e.g. <kbd>param=%1Fvalue1%1Fvalue2</kbd>.\n\nSome parameter types in API requests need further explanation:\";'),('en','messages:api-help-examples','s:34:\"en:{{PLURAL:$1|Example|Examples}}:\";'),('en','messages:api-help-flag-deprecated','s:29:\"en:This module is deprecated.\";'),('en','messages:api-help-flag-generator','s:42:\"en:This module can be used as a generator.\";'),('en','messages:api-help-flag-internal','s:97:\"en:<strong>This module is internal or unstable.</strong> Its operation may change without notice.\";'),('en','messages:api-help-flag-mustbeposted','s:42:\"en:This module only accepts POST requests.\";'),('en','messages:api-help-flag-readrights','s:36:\"en:This module requires read rights.\";'),('en','messages:api-help-flag-writerights','s:37:\"en:This module requires write rights.\";'),('en','messages:api-help-flags','s:3:\"en:\";'),('en','messages:api-help-help-urls','s:3:\"en:\";'),('en','messages:api-help-lead','s:155:\"en:This is an auto-generated MediaWiki API documentation page.\n\nDocumentation and examples: https://www.mediawiki.org/wiki/Special:MyLanguage/API:Main_page\";'),('en','messages:api-help-license','s:21:\"en:License: [[$1|$2]]\";'),('en','messages:api-help-license-noname','s:27:\"en:License: [[$1|See link]]\";'),('en','messages:api-help-license-unknown','s:56:\"en:License: <span class=\"apihelp-unknown\">unknown</span>\";'),('en','messages:api-help-main-header','s:14:\"en:Main module\";'),('en','messages:api-help-no-extended-description','s:3:\"en:\";'),('en','messages:api-help-open-in-apisandbox','s:35:\"en:<small>[open in sandbox]</small>\";'),('en','messages:api-help-param-continue','s:180:\"en:When more results are available, use this to continue. More detailed information on how to continue queries [[mw:Special:MyLanguage/API:Continue|can be found on mediawiki.org]].\";'),('en','messages:api-help-param-default-empty','s:54:\"en:Default: <span class=\"apihelp-empty\">(empty)</span>\";'),('en','messages:api-help-param-deprecated','s:14:\"en:Deprecated.\";'),('en','messages:api-help-param-deprecated-label','s:13:\"en:deprecated\";'),('en','messages:api-help-param-direction','s:35:\"en:In which direction to enumerate:\";'),('en','messages:api-help-param-disabled-in-miser-mode','s:76:\"en:Disabled due to [[mw:Special:MyLanguage/Manual:$wgMiserMode|miser mode]].\";'),('en','messages:api-help-param-internal','s:12:\"en:Internal.\";'),('en','messages:api-help-param-internal-label','s:11:\"en:internal\";'),('en','messages:api-help-param-limited-in-miser-mode','s:229:\"en:<strong>Note:</strong> Due to [[mw:Special:MyLanguage/Manual:$wgMiserMode|miser mode]], using this may result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases, zero results may be returned.\";'),('en','messages:api-help-param-multi-all','s:44:\"en:To specify all values, use <kbd>$1</kbd>.\";'),('en','messages:api-help-param-multi-separate','s:92:\"en:Separate values with <kbd>|</kbd> or [[Special:ApiHelp/main#main/datatypes|alternative]].\";'),('en','messages:api-help-param-no-description','s:54:\"en:<span class=\"apihelp-empty\">(no description)</span>\";'),('en','messages:api-help-param-templated','s:108:\"en:This is a [[Special:ApiHelp/main#main/templatedparams|templated parameter]]. When making the request, $2.\";'),('en','messages:api-help-param-templated-var','s:57:\"en:<var>&#x7B;$1&#x7D;</var> with values of <var>$2</var>\";'),('en','messages:api-help-param-templated-var-first','s:100:\"en:<var>&#x7B;$1&#x7D;</var> in the parameter\'s name should be replaced with values of <var>$2</var>\";'),('en','messages:api-help-param-token','s:88:\"en:A \"$1\" token retrieved from [[Special:ApiHelp/query+tokens|action=query&meta=tokens]]\";'),('en','messages:api-help-param-token-webui','s:68:\"en:For compatibility, the token use