itcount','s:35:\"en:Adds the edit count of the user.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-groups','s:113:\"en:Lists groups that the user is in. This uses more server resources and may return fewer results than the limit.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-implicitgroups','s:53:\"en:Lists all the groups the user is automatically in.\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-registration','s:78:\"en:Adds the timestamp of when the user registered if available (may be blank).\";'),('en','messages:apihelp-query+allusers-paramvalue-prop-rights','s:34:\"en:Lists rights that the user has.\";'),('en','messages:apihelp-query+allusers-summary','s:34:\"en:Enumerate all registered users.\";'),('en','messages:apihelp-query+authmanagerinfo-example-login','s:62:\"en:Fetch the requests that may be used when beginning a login.\";'),('en','messages:apihelp-query+authmanagerinfo-example-login-merged','s:87:\"en:Fetch the requests that may be used when beginning a login, with form fields merged.\";'),('en','messages:apihelp-query+authmanagerinfo-example-securitysensitiveoperation','s:71:\"en:Test whether authentication is sufficient for action <kbd>foo</kbd>.\";'),('en','messages:apihelp-query+authmanagerinfo-param-requestsfor','s:102:\"en:Fetch information about the authentication requests needed for the specified authentication action.\";'),('en','messages:apihelp-query+authmanagerinfo-param-securitysensitiveoperation','s:118:\"en:Test whether the user\'s current authentication status is sufficient for the specified security-sensitive operation.\";'),('en','messages:apihelp-query+authmanagerinfo-summary','s:64:\"en:Retrieve information about the current authentication status.\";'),('en','messages:apihelp-query+backlinks-example-generator','s:69:\"en:Get information about pages linking to [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+backlinks-example-simple','s:44:\"en:Show links to [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+backlinks-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+backlinks-param-filterredir','s:146:\"en:How to filter for redirects. If set to <kbd>nonredirects</kbd> when <var>$1redirect</var> is enabled, this is only applied to the second level.\";'),('en','messages:apihelp-query+backlinks-param-limit','s:182:\"en:How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+backlinks-param-namespace','s:30:\"en:The namespace to enumerate.\";'),('en','messages:apihelp-query+backlinks-param-pageid','s:70:\"en:Page ID to search. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+backlinks-param-redirect','s:109:\"en:If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+backlinks-param-title','s:69:\"en:Title to search. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+backlinks-summary','s:46:\"en:Find all pages that link to the given page.\";'),('en','messages:apihelp-query+blocks-example-simple','s:15:\"en:List blocks.\";'),('en','messages:apihelp-query+blocks-example-users','s:60:\"en:List blocks of users <kbd>Alice</kbd> and <kbd>Bob</kbd>.\";'),('en','messages:apihelp-query+blocks-param-end','s:40:\"en:The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+blocks-param-ids','s:40:\"en:List of block IDs to list (optional).\";'),('en','messages:apihelp-query+blocks-param-ip','s:195:\"en:Get all blocks applying to this IP address or CIDR range, including range blocks.\nCannot be used together with <var>$3users</var>. CIDR ranges broader than IPv4/$1 or IPv6/$2 are not accepted.\";'),('en','messages:apihelp-query+blocks-param-limit','s:40:\"en:The maximum number of blocks to list.\";'),('en','messages:apihelp-query+blocks-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+blocks-param-show','s:136:\"en:Show only items that meet these criteria.\nFor example, to see only indefinite blocks on IP addresses, set <kbd>$1show=ip|!temp</kbd>.\";'),('en','messages:apihelp-query+blocks-param-start','s:43:\"en:The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+blocks-param-users','s:42:\"en:List of users to search for (optional).\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-by','s:42:\"en:Adds the username of the blocking user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-byid','s:41:\"en:Adds the user ID of the blocking user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-expiry','s:48:\"en:Adds the timestamp of when the block expires.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-flags','s:49:\"en:Tags the ban with (autoblock, anononly, etc.).\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-id','s:28:\"en:Adds the ID of the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-range','s:56:\"en:Adds the range of IP addresses affected by the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-reason','s:39:\"en:Adds the reason given for the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-restrictions','s:68:\"en:Adds the partial block restrictions if the block is not sitewide.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-timestamp','s:50:\"en:Adds the timestamp of when the block was given.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-user','s:41:\"en:Adds the username of the blocked user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-userid','s:40:\"en:Adds the user ID of the blocked user.\";'),('en','messages:apihelp-query+blocks-summary','s:43:\"en:List all blocked users and IP addresses.\";'),('en','messages:apihelp-query+categories-example-generator','s:84:\"en:Get information about all categories used in the page <kbd>Albert Einstein</kbd>.\";'),('en','messages:apihelp-query+categories-example-simple','s:75:\"en:Get a list of categories the page <kbd>Albert Einstein</kbd> belongs to.\";'),('en','messages:apihelp-query+categories-param-categories','s:99:\"en:Only list these categories. Useful for checking whether a certain page is in a certain category.\";'),('en','messages:apihelp-query+categories-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+categories-param-limit','s:33:\"en:How many categories to return.\";'),('en','messages:apihelp-query+categories-param-prop','s:56:\"en:Which additional properties to get for each category:\";'),('en','messages:apihelp-query+categories-param-show','s:36:\"en:Which kind of categories to show.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-hidden','s:75:\"en:Tags categories that are hidden with <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-sortkey','s:99:\"en:Adds the sortkey (hexadecimal string) and sortkey prefix (human-readable part) for the category.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-timestamp','s:49:\"en:Adds timestamp of when the category was added.\";'),('en','messages:apihelp-query+categories-summary','s:43:\"en:List all categories the pages belong to.\";'),('en','messages:apihelp-query+categoryinfo-example-simple','s:77:\"en:Get information about <kbd>Category:Foo</kbd> and <kbd>Category:Bar</kbd>.\";'),('en','messages:apihelp-query+categoryinfo-summary','s:50:\"en:Returns information about the given categories.\";'),('en','messages:apihelp-query+categorymembers-example-generator','s:69:\"en:Get page info about first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+categorymembers-example-simple','s:53:\"en:Get first 10 pages in <kbd>Category:Physics</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-dir','s:30:\"en:In which direction to sort.\";'),('en','messages:apihelp-query+categorymembers-param-end','s:82:\"en:Timestamp to end listing at. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-endhexsortkey','s:120:\"en:Sortkey to end listing at, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkey','s:31:\"en:Use $1endhexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-param-endsortkeyprefix','s:195:\"en:Sortkey prefix to end listing <strong>before</strong> (not <strong>at</strong>; if this value occurs it will not be included!). Can only be used with $1sort=sortkey. Overrides $1endhexsortkey.\";'),('en','messages:apihelp-query+categorymembers-param-limit','s:41:\"en:The maximum number of pages to return.\";'),('en','messages:apihelp-query+categorymembers-param-namespace','s:169:\"en:Only include pages in these namespaces. Note that <kbd>$1type=subcat</kbd> or <kbd>$1type=file</kbd> may be used instead of <kbd>$1namespace=14</kbd> or <kbd>6</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-pageid','s:89:\"en:Page ID of the category to enumerate. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-query+categorymembers-param-prop','s:42:\"en:Which pieces of information to include:\";'),('en','messages:apihelp-query+categorymembers-param-sort','s:23:\"en:Property to sort by.\";'),('en','messages:apihelp-query+categorymembers-param-start','s:86:\"en:Timestamp to start listing from. Can only be used with <kbd>$1sort=timestamp</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-starthexsortkey','s:124:\"en:Sortkey to start listing from, as returned by <kbd>$1prop=sortkey</kbd>. Can only be used with <kbd>$1sort=sortkey</kbd>.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkey','s:33:\"en:Use $1starthexsortkey instead.\";'),('en','messages:apihelp-query+categorymembers-param-startsortkeyprefix','s:129:\"en:Sortkey prefix to start listing from. Can only be used with <kbd>$1sort=sortkey</kbd>. Overrides <var>$1starthexsortkey</var>.\";'),('en','messages:apihelp-query+categorymembers-param-title','s:145:\"en:Which category to enumerate (required). Must include the <kbd>{{ns:category}}:</kbd> prefix. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-query+categorymembers-param-type','s:94:\"en:Which type of category members to include. Ignored when <kbd>$1sort=timestamp</kbd> is set.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-ids','s:20:\"en:Adds the page ID.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-sortkey','s:74:\"en:Adds the sortkey used for sorting in the category (hexadecimal string).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-sortkeyprefix','s:97:\"en:Adds the sortkey prefix used for sorting in the category (human-readable part of the sortkey).\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-timestamp','s:52:\"en:Adds the timestamp of when the page was included.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-title','s:47:\"en:Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+categorymembers-paramvalue-prop-type','s:117:\"en:Adds the type that the page has been categorised as (<samp>page</samp>, <samp>subcat</samp> or <samp>file</samp>).\";'),('en','messages:apihelp-query+categorymembers-summary','s:38:\"en:List all pages in a given category.\";'),('en','messages:apihelp-query+contributors-example-simple','s:60:\"en:Show contributors to the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+contributors-param-excludegroup','s:119:\"en:Exclude users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-excluderights','s:141:\"en:Exclude users having the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-group','s:124:\"en:Only include users in the given groups. Does not include implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-param-limit','s:35:\"en:How many contributors to return.\";'),('en','messages:apihelp-query+contributors-param-rights','s:146:\"en:Only include users having the given rights. Does not include rights granted by implicit or auto-promoted groups like *, user, or autoconfirmed.\";'),('en','messages:apihelp-query+contributors-summary','s:92:\"en:Get the list of logged-in contributors and the count of anonymous contributors to a page.\";'),('en','messages:apihelp-query+deletedrevisions-example-revids','s:63:\"en:List the information for deleted revision <kbd>123456</kbd>.\";'),('en','messages:apihelp-query+deletedrevisions-example-titles','s:101:\"en:List the deleted revisions of the pages [[{{MediaWiki:Mainpage}}]] and its talk page with content.\";'),('en','messages:apihelp-query+deletedrevisions-extended-description','s:239:\"en:May be used in several ways:\n# Get deleted revisions for a set of pages, by setting titles or pageids. Ordered by title and timestamp.\n# Get data about a set of deleted revisions by setting their IDs with revids. Ordered by revision ID.\";'),('en','messages:apihelp-query+deletedrevisions-param-end','s:88:\"en:The timestamp to stop enumerating at. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-excludeuser','s:37:\"en:Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-param-start','s:91:\"en:The timestamp to start enumerating from. Ignored when processing a list of revision IDs.\";'),('en','messages:apihelp-query+deletedrevisions-param-tag','s:44:\"en:Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevisions-param-user','s:36:\"en:Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevisions-summary','s:36:\"en:Get deleted revision information.\";'),('en','messages:apihelp-query+deletedrevs-example-mode1','s:128:\"en:List the last deleted revisions of the pages [[{{MediaWiki:Mainpage}}]] and <kbd>Talk:Main Page</kbd>, with content (mode 1).\";'),('en','messages:apihelp-query+deletedrevs-example-mode2','s:69:\"en:List the last 50 deleted contributions by <kbd>Bob</kbd> (mode 2).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-main','s:70:\"en:List the first 50 deleted revisions in the main namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-example-mode3-talk','s:73:\"en:List the first 50 deleted pages in the {{ns:talk}} namespace (mode 3).\";'),('en','messages:apihelp-query+deletedrevs-extended-description','s:381:\"en:Operates in three modes:\n# List deleted revisions for the given titles, sorted by timestamp.\n# List deleted contributions for the given user, sorted by timestamp (no titles specified).\n# List all deleted revisions in the given namespace, sorted by title and timestamp (no titles specified, $1user not set).\n\nCertain parameters only apply to some modes and are ignored in others.\";'),('en','messages:apihelp-query+deletedrevs-param-end','s:40:\"en:The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+deletedrevs-param-excludeuser','s:37:\"en:Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-param-from','s:31:\"en:Start listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-limit','s:43:\"en:The maximum amount of revisions to list.\";'),('en','messages:apihelp-query+deletedrevs-param-namespace','s:37:\"en:Only list pages in this namespace.\";'),('en','messages:apihelp-query+deletedrevs-param-prefix','s:57:\"en:Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+deletedrevs-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+deletedrevs-param-start','s:43:\"en:The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+deletedrevs-param-tag','s:44:\"en:Only list revisions tagged with this tag.\";'),('en','messages:apihelp-query+deletedrevs-param-to','s:30:\"en:Stop listing at this title.\";'),('en','messages:apihelp-query+deletedrevs-param-unique','s:40:\"en:List only one revision for each page.\";'),('en','messages:apihelp-query+deletedrevs-param-user','s:36:\"en:Only list revisions by this user.\";'),('en','messages:apihelp-query+deletedrevs-paraminfo-modes','s:31:\"en:{{PLURAL:$1|Mode|Modes}}: $2\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-comment','s:36:\"en:Adds the comment of the revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-content','s:36:\"en:Adds the content of the revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-len','s:43:\"en:Adds the length (bytes) of the revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-minor','s:33:\"en:Tags if the revision is minor.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-parentid','s:61:\"en:Adds the revision ID of the previous revision to the page.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-parsedcomment','s:43:\"en:Adds the parsed comment of the revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-revid','s:48:\"en:Adds the revision ID of the deleted revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-sha1','s:44:\"en:Adds the SHA-1 (base 16) of the revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-tags','s:25:\"en:Tags for the revision.\";'),('en','messages:apihelp-query+deletedrevs-paramvalue-prop-token','s:24:\"en:Gives the edit token.\";'),('en','messag