n-param-title','s:58:\"en:Title to search. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-query+embeddedin-summary','s:58:\"en:Find all pages that embed (transclude) the given title.\";'),('en','messages:apihelp-query+extlinks-example-simple','s:71:\"en:Get a list of external links on the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+extlinks-param-expandurl','s:61:\"en:Expand protocol-relative URLs with the canonical protocol.\";'),('en','messages:apihelp-query+extlinks-param-limit','s:28:\"en:How many links to return.\";'),('en','messages:apihelp-query+extlinks-param-protocol','s:190:\"en:Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd> and <kbd>https</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('en','messages:apihelp-query+extlinks-param-query','s:110:\"en:Search string without protocol. Useful for checking whether a certain page contains a certain external url.\";'),('en','messages:apihelp-query+extlinks-summary','s:67:\"en:Returns all external URLs (not interwikis) from the given pages.\";'),('en','messages:apihelp-query+exturlusage-example-simple','s:62:\"en:Show pages linking to <kbd>https://www.mediawiki.org</kbd>.\";'),('en','messages:apihelp-query+exturlusage-param-expandurl','s:61:\"en:Expand protocol-relative URLs with the canonical protocol.\";'),('en','messages:apihelp-query+exturlusage-param-limit','s:28:\"en:How many pages to return.\";'),('en','messages:apihelp-query+exturlusage-param-namespace','s:36:\"en:The page namespaces to enumerate.\";'),('en','messages:apihelp-query+exturlusage-param-prop','s:42:\"en:Which pieces of information to include:\";'),('en','messages:apihelp-query+exturlusage-param-protocol','s:190:\"en:Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd> and <kbd>https</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('en','messages:apihelp-query+exturlusage-param-query','s:102:\"en:Search string without protocol. See [[Special:LinkSearch]]. Leave empty to list all external links.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-ids','s:23:\"en:Adds the ID of page.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-title','s:47:\"en:Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+exturlusage-paramvalue-prop-url','s:33:\"en:Adds the URL used in the page.\";'),('en','messages:apihelp-query+exturlusage-summary','s:44:\"en:Enumerate pages that contain a given URL.\";'),('en','messages:apihelp-query+filearchive-example-simple','s:36:\"en:Show a list of all deleted files.\";'),('en','messages:apihelp-query+filearchive-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+filearchive-param-from','s:45:\"en:The image title to start enumerating from.\";'),('en','messages:apihelp-query+filearchive-param-limit','s:38:\"en:How many images to return in total.\";'),('en','messages:apihelp-query+filearchive-param-prefix','s:58:\"en:Search for all image titles that begin with this value.\";'),('en','messages:apihelp-query+filearchive-param-prop','s:34:\"en:Which image information to get:\";'),('en','messages:apihelp-query+filearchive-param-sha1','s:46:\"en:SHA1 hash of image. Overrides $1sha1base36.\";'),('en','messages:apihelp-query+filearchive-param-sha1base36','s:53:\"en:SHA1 hash of image in base 36 (used in MediaWiki).\";'),('en','messages:apihelp-query+filearchive-param-to','s:42:\"en:The image title to stop enumerating at.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-archivename','s:68:\"en:Adds the filename of the archive version for non-latest versions.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-bitdepth','s:37:\"en:Adds the bit depth of the version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-description','s:41:\"en:Adds description of the image version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-dimensions','s:18:\"en:Alias for size.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-mediatype','s:36:\"en:Adds the media type of the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-metadata','s:52:\"en:Lists Exif metadata for the version of the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-mime','s:26:\"en:Adds MIME of the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-parseddescription','s:40:\"en:Parse the description of the version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-sha1','s:33:\"en:Adds SHA-1 hash for the image.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-size','s:92:\"en:Adds the size of the image in bytes and the height, width and page count (if applicable).\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-timestamp','s:43:\"en:Adds timestamp for the uploaded version.\";'),('en','messages:apihelp-query+filearchive-paramvalue-prop-user','s:44:\"en:Adds user who uploaded the image version.\";'),('en','messages:apihelp-query+filearchive-summary','s:44:\"en:Enumerate all deleted files sequentially.\";'),('en','messages:apihelp-query+filerepoinfo-example-simple','s:43:\"en:Get information about file repositories.\";'),('en','messages:apihelp-query+filerepoinfo-param-prop','s:85:\"en:Which repository properties to get (properties available may vary on other wikis).\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-apiurl','s:76:\"en:URL to the repository API - helpful for getting image info from the host.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-articlepath','s:109:\"en:Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgArticlePath|$wgArticlePath]]</var> or equivalent.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-canUpload','s:93:\"en:Whether files can be uploaded to this repository, e.g. via CORS and shared authentication.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-displayname','s:50:\"en:The human-readable name of the repository wiki.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-favicon','s:105:\"en:Repository wiki\'s favicon URL, from <var>[[mw:Special:MyLanguage/Manual:$wgFavicon|$wgFavicon]]</var>.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-fetchDescription','s:109:\"en:Whether file description pages are fetched from this repository when viewing local file description pages.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-initialCapital','s:61:\"en:Whether file names implicitly start with a capital letter.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-local','s:51:\"en:Whether that repository is the local one or not.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-name','s:192:\"en:The key of the repository - used in e.g. <var>[[mw:Special:MyLanguage/Manual:$wgForeignFileRepos|$wgForeignFileRepos]]</var> and [[Special:ApiHelp/query+imageinfo|imageinfo]] return values.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-rootUrl','s:33:\"en:Root URL path for image paths.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-scriptDirUrl','s:66:\"en:Root URL path for the repository wiki\'s MediaWiki installation.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-server','s:99:\"en:Repository wiki\'s <var>[[mw:Special:MyLanguage/Manual:$wgServer|$wgServer]]</var> or equivalent.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-thumbUrl','s:37:\"en:Root URL path for thumbnail paths.\";'),('en','messages:apihelp-query+filerepoinfo-paramvalue-prop-url','s:24:\"en:Public zone URL path.\";'),('en','messages:apihelp-query+filerepoinfo-summary','s:75:\"en:Return meta information about image repositories configured on the wiki.\";'),('en','messages:apihelp-query+fileusage-example-generator','s:59:\"en:Get information about pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-example-simple','s:51:\"en:Get a list of pages using [[:File:Example.jpg]].\";'),('en','messages:apihelp-query+fileusage-param-limit','s:22:\"en:How many to return.\";'),('en','messages:apihelp-query+fileusage-param-namespace','s:42:\"en:Only include pages in these namespaces.\";'),('en','messages:apihelp-query+fileusage-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+fileusage-param-show','s:44:\"en:Show only items that meet these criteria:\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-pageid','s:24:\"en:Page ID of each page.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-redirect','s:34:\"en:Flag if the page is a redirect.\";'),('en','messages:apihelp-query+fileusage-paramvalue-prop-title','s:22:\"en:Title of each page.\";'),('en','messages:apihelp-query+fileusage-paramvalue-show-!redirect','s:27:\"en:Only show non-redirects.\";'),('en','messages:apihelp-query+fileusage-paramvalue-show-redirect','s:23:\"en:Only show redirects.\";'),('en','messages:apihelp-query+fileusage-summary','s:43:\"en:Find all pages that use the given files.\";'),('en','messages:apihelp-query+imageinfo-example-dated','s:78:\"en:Fetch information about versions of [[:File:Test.jpg]] from 2008 and later.\";'),('en','messages:apihelp-query+imageinfo-example-simple','s:85:\"en:Fetch information about the current version of [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageinfo-param-badfilecontexttitle','s:116:\"en:If <kbd>$2prop=badfile</kbd> is set, this is the page title used when evaluating the [[MediaWiki:Bad image list]]\";'),('en','messages:apihelp-query+imageinfo-param-end','s:32:\"en:Timestamp to stop listing at.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatafilter','s:87:\"en:If specified and non-empty, only these keys will be returned for $1prop=extmetadata.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatalanguage','s:183:\"en:What language to fetch extmetadata in. This affects both which translation to fetch, if multiple are available, as well as how things like numbers and various values are formatted.\";'),('en','messages:apihelp-query+imageinfo-param-extmetadatamultilang','s:77:\"en:If translations for extmetadata property are available, fetch all of them.\";'),('en','messages:apihelp-query+imageinfo-param-limit','s:46:\"en:How many file revisions to return per file.\";'),('en','messages:apihelp-query+imageinfo-param-localonly','s:47:\"en:Look only for files in the local repository.\";'),('en','messages:apihelp-query+imageinfo-param-metadataversion','s:139:\"en:Version of metadata to use. If <kbd>latest</kbd> is specified, use latest version. Defaults to <kbd>1</kbd> for backwards compatibility.\";'),('en','messages:apihelp-query+imageinfo-param-prop','s:33:\"en:Which file information to get:\";'),('en','messages:apihelp-query+imageinfo-param-start','s:35:\"en:Timestamp to start listing from.\";'),('en','messages:apihelp-query+imageinfo-param-urlheight','s:25:\"en:Similar to $1urlwidth.\";'),('en','messages:apihelp-query+imageinfo-param-urlparam','s:173:\"en:A handler specific parameter string. For example, PDFs might use <kbd>page15-100px</kbd>. <var>$1urlwidth</var> must be used and be consistent with <var>$1urlparam</var>.\";'),('en','messages:apihelp-query+imageinfo-param-urlwidth','s:177:\"en:If $2prop=url is set, a URL to an image scaled to this width will be returned.\nFor performance reasons if this option is used, no more than $1 scaled images will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-archivename','s:160:\"en:Adds the filename of the archive version for non-latest versions. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-badfile','s:63:\"en:Adds whether the file is on the [[MediaWiki:Bad image list]]\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-bitdepth','s:129:\"en:Adds the bit depth of the version. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-canonicaltitle','s:132:\"en:Adds the canonical title of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-comment','s:124:\"en:Comment on the version. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-commonmetadata','s:158:\"en:Lists file format generic metadata for the version of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-dimensions','s:18:\"en:Alias for size.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-extmetadata','s:179:\"en:Lists formatted metadata combined from multiple sources. Results are HTML formatted. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-mediatype','s:127:\"en:Adds the media type of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-metadata','s:143:\"en:Lists Exif metadata for the version of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-mime','s:122:\"en:Adds MIME type of the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-parsedcomment','s:134:\"en:Parse the comment on the version. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-sha1','s:124:\"en:Adds SHA-1 hash for the file. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-size','s:91:\"en:Adds the size of the file in bytes and the height, width and page count (if applicable).\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-thumbmime','s:169:\"en:Adds MIME type of the image thumbnail (requires url and param $1urlwidth). If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-timestamp','s:43:\"en:Adds timestamp for the uploaded version.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-uploadwarning','s:122:\"en:Used by the Special:Upload page to get information about an existing file. Not intended for use outside MediaWiki core.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-url','s:142:\"en:Gives URL to the file and the description page. If the file has been revision deleted, a <samp>filehidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-user','s:140:\"en:Adds the user who uploaded each file version. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-paramvalue-prop-userid','s:150:\"en:Add the ID of the user that uploaded each file version. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+imageinfo-summary','s:47:\"en:Returns file information and upload history.\";'),('en','messages:apihelp-query+images-example-generator','s:79:\"en:Get information about all files used on the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+images-example-simple','s:67:\"en:Get a list of files used on the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+images-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+images-param-images','s:88:\"en:Only list these files. Useful for checking whether a certain page has a certain file.\";'),('en','messages:apihelp-query+images-param-limit','s:28:\"en:How many files to return.\";'),('en','messages:apihelp-query+images-summary','s:50:\"en:Returns all files contained on the given pages.\";'),('en','messages:apihelp-query+imageusage-example-generator','s:72:\"en:Get information about pages using [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageusage-example-simple','s:55:\"en:Show pages using [[:File:Albert Einstein Head.jpg]].\";'),('en','messages:apihelp-query+imageusage-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+imageusage-param-filterredir','s:124:\"en:How to filter for redirects. If set to nonredirects when $1redirect is enabled, this is only applied to the second level.\";'),('en','messages:apihelp-query+imageusage-param-limit','s:182:\"en:How many total pages to return. If <var>$1redirect</var> is enabled, the limit applies to each level separately (which means up to 2 * <var>$1limit</var> results may be returned).\";'),('en','messages:apihelp-query+imageusage-param-namespace','s:30:\"en:The namespace to enumerate.\";'),('en','messages:apihelp-query+imageusage-param-pageid','s:59:\"en:Page ID to search. Cannot be used together with $1title.\";'),('en','messages:apihelp-query+imageusage-param-redirect','s:109:\"en:If linking page is a redirect, find all pages that link to that redirect as well. Maximum limit is halved.\";'),('en','messages:apihelp-query+imageusage-param-title','s:58:\"en:Title to search. Cannot be used together with $1pageid.\";'),('en','messages:apihelp-query+imageusage-summary','s:49:\"en:Find all pages that use the given image title.\";'),('en','messages:apihelp-query+info-example-protection','s:84:\"en:Get general and protection information about the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+info-example-simple','s:61:\"en:Get information about the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+info-param-editintrocustom','s:64:\"en:Title of a custom page to use as an additional intro message.\";'),('en','messages:apihelp-query+info-param-editintroskip','s:169:\"en:List of intro messages to remove from the response. Use this if a specific message is not relevant to your tool, or if the information is conveyed in a different way.\";'),('en','messages:apihelp-query+info-param-editintrostyle','s:138:\"en:Some intro messages come with optional wrapper frames. Use <kbd>moreframes</kbd> to include them or <kbd>lessframes</kbd> to omit them.\";'),('en','messages:apihelp-query+info-param-linkcontext','s:137:\"en:The context title to use when determining extra CSS classes (e.g. link colors) when <var>$1prop</var> contains <var>linkclasses</var>.\";'),('en','messages:apihelp-query+info-param-preloadcustom','s:54:\"en:Title of a custom page to use as preloaded content.\";'),('en','messages:apihelp-query+info-param-preloadnewsection','s:82:\"en:Return preloaded content for a new section on the page, rather than a new page.\";'),('en','messages:apihelp-query+info-param-preloadparams','s:66:\"en:Parameters for the custom page being used as preloaded content.\";'),('en','messages:apihelp-query+info-param-prop','s:38:\"en:Which additional properties to get:\";'),('en','messages:apihelp-query+info-param-testactions','s:73:\"en:Test whether the current user can perform certain actions on the page.\";'),('en','messages:apihelp-query+info-param-testactionsautocreate','s:99:\"en:Test whether performing <var>$1testactions</var> would automatically create a temporary account.\";'),('en','messages:apihelp-query+info-param-testactionsdetail','s:199:\"en:Detail level for <var>$1testactions</var>. Use the [[Special:ApiHelp/main|main module]]\'s <var>errorformat</var> and <var>errorlang</var> parameters to control the format of the messages returned.\";'),('en','messages:apihelp-query+info-paraminfo-editintroonly','s:66:\"en:Only used when <var>$3prop</var> contains <var>editintro</var>.\";'),('en','messages:apihelp-query+info-paraminfo-preloadcontentonly','s:71:\"en:Only used when <var>$3prop</var> contains <var>preloadcontent</var>.\";'),('en','messages:apihelp-query+info-paramvalue-prop-associatedpage','s:110:\"en:The prefixed title of the [[:mw:Special:MyLanguage/Help:Associated_pages|associated subject or talk page]].\";'),('en','messages:apihelp-query+info-paramvalue-prop-displaytitle','s:66:\"en:Gives the manner in which the page title is actually displayed.\";'),('en','messages:apihelp-query+info-paramvalue-prop-editintro','s:106:\"en:Gives the intro messages that should be shown to the user while editing this page or revision, as HTML.\";'),('en','messages:apihelp-query+info-paramvalue-prop-linkclasses','s:152:\"en:Gives the additional CSS classes (e.g. link colors) used for links to this page if they were to appear on the page named by <var>$1linkcontext</var>.\";'),('en','messages:apihelp-query+info-paramvalue-prop-notificationtimestamp','s:53:\"en:The watchlist notification timestamp of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-preload','s:139:\"en:Gives the text returned by EditFormPreloadText. Use <kbd>preloadcontent</kbd> instead, which supports other kinds of preloaded text too.\";'),('en','messages:apihelp-query+info-paramvalue-prop-preloadcontent','s:106:\"en:Gives the content to be shown in the editor when the page does not exist or while adding a new section.\";'),('en','messages:apihelp-query+info-paramvalue-prop-protection','s:42:\"en:List the protection level of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-readable','s:82:\"en:Whether the user can read this page. Use <kbd>intestactions=read</kbd> instead.\";'),('en','messages:apihelp-query+info-paramvalue-prop-subjectid','s:53:\"en:The page ID of the parent page for each talk page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-talkid','s:55:\"en:The page ID of the talk page for each non-talk page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-url','s:70:\"en:Gives a full URL, an edit URL, and the canonical URL for each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-varianttitles','s:72:\"en:Gives the display title in all variants of the site content language.\";'),('en','messages:apihelp-query+info-paramvalue-prop-visitingwatchers','s:94:\"en:The number of watchers of each page who have visited recent edits to that page, if allowed.\";'),('en','messages:apihelp-query+info-paramvalue-prop-watched','s:40:\"en:List the watched status of each page.\";'),('en','messages:apihelp-query+info-paramvalue-prop-watchers','s:38:\"en:The number of watchers, if allowed.\";'),('en','messages:apihelp-query+info-paramvalue-testactionsdetail-boolean','s:42:\"en:Return a boolean value for each action.\";'),('en','messages:apihelp-query+info-paramvalue-testactionsdetail-full','s:95:\"en:Return messages describing why the action is disallowed, or an empty array if it is allowed.\";'),('en','messages:apihelp-query+info-paramvalue-testactionsdetail-quick','s:54:\"en:Like <kbd>full</kbd> but skipping expensive checks.\";'),('en','messages:apihelp-query+info-summary','s:30:\"en:Get basic page information.\";'),('en','messages:apihelp-query+iwbacklinks-example-generator','s:61:\"en:Get information about pages linking to [[wikibooks:Test]].\";'),('en','messages:apihelp-query+iwbacklinks-example-simple','s:43:\"en:Get pages linking to [[wikibooks:Test]].\";'),('en','messages:apihelp-query+iwbacklinks-extended-description','s:156:\"en:Can be used to find all links with a prefix, or all links to a title (with a given prefix). Using neither parameter is effectively \"all interwiki links\".\";'),('en','messages:apihelp-query+iwbacklinks-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+iwbacklinks-param-limit','s:34:\"en:How many total pages to return.\";'),('en','messages:apihelp-query+iwbacklinks-param-prefix','s:28:\"en:Prefix for the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+iwbacklinks-param-title','s:73:\"en:Interwiki link to search for. Must be used with <var>$1blprefix</var>.\";'),('en','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwprefix','s:36:\"en:Adds the prefix of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-paramvalue-prop-iwtitle','s:35:\"en:Adds the title of the interwiki.\";'),('en','messages:apihelp-query+iwbacklinks-summary','s:56:\"en:Find all pages that link to the given interwiki link.\";'),('en','messages:apihelp-query+iwlinks-example-simple','s:64:\"en:Get interwiki links from the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+iwlinks-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+iwlinks-param-limit','s:38:\"en:How many interwiki links to return.\";'),('en','messages:apihelp-query+iwlinks-param-prefix','s:48:\"en:Only return interwiki links with this prefix.\";'),('en','messages:apihelp-query+iwlinks-param-prop','s:62:\"en:Which additional properties to get for each interwiki link:\";'),('en','messages:apihelp-query+iwlinks-param-title','s:71:\"en:Interwiki link to search for. Must be used with <var>$1prefix</var>.\";'),('en','messages:apihelp-query+iwlinks-param-url','s:60:\"en:Whether to get the full URL (cannot be used with $1prop).\";'),('en','messages:apihelp-query+iwlinks-paramvalue-prop-url','s:21:\"en:Adds the full URL.\";'),('en','messages:apihelp-query+iwlinks-summary','s:52:\"en:Returns all interwiki links from the given pages.\";'),('en','messages:apihelp-query+langbacklinks-example-generator','s:55:\"en:Get information about pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langbacklinks-example-simple','s:37:\"en:Get pages linking to [[:fr:Test]].\";'),('en','messages:apihelp-query+langbacklinks-extended-description','s:233:\"en:Can be used to find all links with a language code, or all links to a title (with a given language). Using neither parameter is effectively \"all language links\".\n\nNote that this may not consider language links added by extensions.\";'),('en','messages:apihelp-query+langbacklinks-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+langbacklinks-param-lang','s:34:\"en:Language for the language link.\";'),('en','messages:apihelp-query+langbacklinks-param-limit','s:34:\"en:How many total pages to return.\";'),('en','messages:apihelp-query+langbacklinks-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+langbacklinks-param-title','s:57:\"en:Language link to search for. Must be used with $1lang.\";'),('en','messages:apihelp-query+langbacklinks-paramvalue-prop-lllang','s:47:\"en:Adds the language code of the language link.\";'),('en','messages:apihelp-query+langbacklinks-paramvalue-prop-lltitle','s:39:\"en:Adds the title of the language link.\";'),('en','messages:apihelp-query+langbacklinks-summary','s:55:\"en:Find all pages that link to the given language link.\";'),('en','messages:apihelp-query+langlinks-example-simple','s:68:\"en:Get interlanguage links from the page [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+langlinks-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+langlinks-param-inlanguagecode','s:46:\"en:Language code for localised language names.\";'),('en','messages:apihelp-query+langlinks-param-lang','s:54:\"en:Only return language links with this language code.\";'),('en','messages:apihelp-query+langlinks-param-limit','s:32:\"en:How many langlinks to return.\";'),('en','messages:apihelp-query+langlinks-param-prop','s:66:\"en:Which additional properties to get for each interlanguage link:\";'),('en','messages:apihelp-query+langlinks-param-title','s:59:\"en:Link to search for. Must be used with <var>$1lang</var>.\";'),('en','messages:apihelp-query+langlinks-param-url','s:71:\"en:Whether to get the full URL (cannot be used with <var>$1prop</var>).\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-autonym','s:33:\"en:Adds the native language name.\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-langname','s:107:\"en:Adds the localised language name (best effort). Use <var>$1inlanguagecode</var> to control the language.\";'),('en','messages:apihelp-query+langlinks-paramvalue-prop-url','s:21:\"en:Adds the full URL.\";'),('en','messages:apihelp-query+langlinks-summary','s:56:\"en:Returns all interlanguage links from the given pages.\";'),('en','messages:apihelp-query+languageinfo-example-autonym-name-de','s:64:\"en:Get the autonyms and German names of all supported languages.\";'),('en','messages:apihelp-query+languageinfo-example-bcp47-dir','s:73:\"en:Get the BCP-47 language code and direction of all supported languages.\";'),('en','messages:apihelp-query+languageinfo-example-fallbacks-variants-oc','s:54:\"en:Get the fallback languages and variants of Occitan.\";'),('en','messages:apihelp-query+languageinfo-example-simple','s:53:\"en:Get the language codes of all supported languages.\";'),('en','messages:apihelp-query+languageinfo-extended-description','s:131:\"en:[[mw:Special:MyLanguage/API:Continue|Continuation]] may be applied if retrieving the information takes too long for one request.\";'),('en','messages:apihelp-query+languageinfo-param-code','s:96:\"en:Language codes of the languages that should be returned, or <code>*</code> for all languages.\";'),('en','messages:apihelp-query+languageinfo-param-prop','s:46:\"en:Which information to get for each 