-query+links-param-dir','s:34:\"en:The direction in which to list.\";'),('en','messages:apihelp-query+links-param-limit','s:28:\"en:How many links to return.\";'),('en','messages:apihelp-query+links-param-namespace','s:39:\"en:Show links in these namespaces only.\";'),('en','messages:apihelp-query+links-param-titles','s:104:\"en:Only list links to these titles. Useful for checking whether a certain page links to a certain title.\";'),('en','messages:apihelp-query+links-summary','s:42:\"en:Returns all links from the given pages.\";'),('en','messages:apihelp-query+linkshere-example-generator','s:73:\"en:Get information about pages linking to the [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+linkshere-example-simple','s:65:\"en:Get a list of pages linking to the [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+linkshere-param-limit','s:22:\"en:How many to return.\";'),('en','messages:apihelp-query+linkshere-param-namespace','s:42:\"en:Only include pages in these namespaces.\";'),('en','messages:apihelp-query+linkshere-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+linkshere-param-show','s:44:\"en:Show only items that meet these criteria:\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-pageid','s:24:\"en:Page ID of each page.\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-redirect','s:34:\"en:Flag if the page is a redirect.\";'),('en','messages:apihelp-query+linkshere-paramvalue-prop-title','s:22:\"en:Title of each page.\";'),('en','messages:apihelp-query+linkshere-paramvalue-show-!redirect','s:27:\"en:Only show non-redirects.\";'),('en','messages:apihelp-query+linkshere-paramvalue-show-redirect','s:23:\"en:Only show redirects.\";'),('en','messages:apihelp-query+linkshere-summary','s:47:\"en:Find all pages that link to the given pages.\";'),('en','messages:apihelp-query+logevents-example-simple','s:26:\"en:List recent log events.\";'),('en','messages:apihelp-query+logevents-param-action','s:213:\"en:Filter log actions to only this action. Overrides <var>$1type</var>. In the list of possible values, values with the asterisk wildcard such as <kbd>action/*</kbd> can have different strings after the slash (/).\";'),('en','messages:apihelp-query+logevents-param-end','s:36:\"en:The timestamp to end enumerating.\";'),('en','messages:apihelp-query+logevents-param-limit','s:42:\"en:How many total event entries to return.\";'),('en','messages:apihelp-query+logevents-param-namespace','s:50:\"en:Filter entries to those in the given namespace.\";'),('en','messages:apihelp-query+logevents-param-prefix','s:46:\"en:Filter entries that start with this prefix.\";'),('en','messages:apihelp-query+logevents-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+logevents-param-start','s:43:\"en:The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+logevents-param-tag','s:48:\"en:Only list event entries tagged with this tag.\";'),('en','messages:apihelp-query+logevents-param-title','s:45:\"en:Filter entries to those related to a page.\";'),('en','messages:apihelp-query+logevents-param-type','s:40:\"en:Filter log entries to only this type.\";'),('en','messages:apihelp-query+logevents-param-user','s:50:\"en:Filter entries to those made by the given user.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-comment','s:135:\"en:Adds the comment of the log event. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-details','s:148:\"en:Lists additional details about the log event. If the log event has been revision deleted, an <samp>actionhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-ids','s:32:\"en:Adds the ID of the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-parsedcomment','s:142:\"en:Adds the parsed comment of the log event. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-tags','s:32:\"en:Lists tags for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-timestamp','s:40:\"en:Adds the timestamp for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-title','s:48:\"en:Adds the title of the page for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-type','s:30:\"en:Adds the type of log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-user','s:139:\"en:Adds the user responsible for the log event. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-userid','s:150:\"en:Adds the user ID who was responsible for the log event. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+logevents-summary','s:24:\"en:Get events from logs.\";'),('en','messages:apihelp-query+mystashedfiles-example-simple','s:90:\"en:Get the filekey, file size, and pixel size of files in the current user\'s upload stash.\";'),('en','messages:apihelp-query+mystashedfiles-param-limit','s:25:\"en:How many files to get.\";'),('en','messages:apihelp-query+mystashedfiles-param-prop','s:43:\"en:Which properties to fetch for the files.\";'),('en','messages:apihelp-query+mystashedfiles-paramvalue-prop-size','s:44:\"en:Fetch the file size and image dimensions.\";'),('en','messages:apihelp-query+mystashedfiles-paramvalue-prop-type','s:45:\"en:Fetch the file\'s MIME type and media type.\";'),('en','messages:apihelp-query+mystashedfiles-summary','s:58:\"en:Get a list of files in the current user\'s upload stash.\";'),('en','messages:apihelp-query+pagepropnames-example-simple','s:31:\"en:Get first 10 property names.\";'),('en','messages:apihelp-query+pagepropnames-param-limit','s:41:\"en:The maximum number of names to return.\";'),('en','messages:apihelp-query+pagepropnames-summary','s:51:\"en:List all page property names in use on the wiki.\";'),('en','messages:apihelp-query+pageprops-example-simple','s:91:\"en:Get properties for the pages <kbd>{{MediaWiki:Mainpage}}</kbd> and <kbd>MediaWiki</kbd>.\";'),('en','messages:apihelp-query+pageprops-param-prop','s:218:\"en:Only list these page properties (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use). Useful for checking whether pages use a certain page property.\";'),('en','messages:apihelp-query+pageprops-summary','s:59:\"en:Get various page properties defined in the page content.\";'),('en','messages:apihelp-query+pageswithprop-example-generator','s:92:\"en:Get additional information about the first 10 pages using <code>_&#95;NOTOC_&#95;</code>.\";'),('en','messages:apihelp-query+pageswithprop-example-simple','s:84:\"en:List the first 10 pages using <code>&#123;&#123;DISPLAYTITLE:&#125;&#125;</code>.\";'),('en','messages:apihelp-query+pageswithprop-param-dir','s:30:\"en:In which direction to sort.\";'),('en','messages:apihelp-query+pageswithprop-param-limit','s:41:\"en:The maximum number of pages to return.\";'),('en','messages:apihelp-query+pageswithprop-param-prop','s:42:\"en:Which pieces of information to include:\";'),('en','messages:apihelp-query+pageswithprop-param-propname','s:166:\"en:Page property for which to enumerate pages (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use).\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-ids','s:20:\"en:Adds the page ID.\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-title','s:47:\"en:Adds the title and namespace ID of the page.\";'),('en','messages:apihelp-query+pageswithprop-paramvalue-prop-value','s:39:\"en:Adds the value of the page property.\";'),('en','messages:apihelp-query+pageswithprop-summary','s:46:\"en:List all pages using a given page property.\";'),('en','messages:apihelp-query+prefixsearch-example-simple','s:60:\"en:Search for page titles beginning with <kbd>meaning</kbd>.\";'),('en','messages:apihelp-query+prefixsearch-extended-description','s:511:\"en:Despite the similarity in names, this module is not intended to be equivalent to [[Special:PrefixIndex]]; for that, see <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd> with the <kbd>apprefix</kbd> parameter. The purpose of this module is similar to <kbd>[[Special:ApiHelp/opensearch|action=opensearch]]</kbd>: to take user input and provide the best-matching titles. Depending on the search engine backend, this might include typo correction, redirect avoidance, or other heuristics.\";'),('en','messages:apihelp-query+prefixsearch-param-limit','s:39:\"en:Maximum number of results to return.\";'),('en','messages:apihelp-query+prefixsearch-param-namespace','s:93:\"en:Namespaces to search. Ignored if <var>$1search</var> begins with a valid namespace prefix.\";'),('en','messages:apihelp-query+prefixsearch-param-offset','s:29:\"en:Number of results to skip.\";'),('en','messages:apihelp-query+prefixsearch-param-profile','s:25:\"en:Search profile to use.\";'),('en','messages:apihelp-query+prefixsearch-param-search','s:17:\"en:Search string.\";'),('en','messages:apihelp-query+prefixsearch-summary','s:43:\"en:Perform a prefix search for page titles.\";'),('en','messages:apihelp-query+protectedtitles-example-generator','s:56:\"en:Find links to protected titles in the main namespace.\";'),('en','messages:apihelp-query+protectedtitles-example-simple','s:25:\"en:List protected titles.\";'),('en','messages:apihelp-query+protectedtitles-param-end','s:45:\"en:Stop listing at this protection timestamp.\";'),('en','messages:apihelp-query+protectedtitles-param-level','s:49:\"en:Only list titles with these protection levels.\";'),('en','messages:apihelp-query+protectedtitles-param-limit','s:34:\"en:How many total pages to return.\";'),('en','messages:apihelp-query+protectedtitles-param-namespace','s:40:\"en:Only list titles in these namespaces.\";'),('en','messages:apihelp-query+protectedtitles-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+protectedtitles-param-start','s:46:\"en:Start listing at this protection timestamp.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-comment','s:39:\"en:Adds the comment for the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-expiry','s:60:\"en:Adds the timestamp of when the protection will be lifted.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-level','s:29:\"en:Adds the protection level.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-parsedcomment','s:46:\"en:Adds the parsed comment for the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-timestamp','s:51:\"en:Adds the timestamp of when protection was added.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-user','s:43:\"en:Adds the user that added the protection.\";'),('en','messages:apihelp-query+protectedtitles-paramvalue-prop-userid','s:46:\"en:Adds the user ID that added the protection.\";'),('en','messages:apihelp-query+protectedtitles-summary','s:43:\"en:List all titles protected from creation.\";'),('en','messages:apihelp-query+querypage-example-ancientpages','s:48:\"en:Return results from [[Special:Ancientpages]].\";'),('en','messages:apihelp-query+querypage-param-limit','s:31:\"en:Number of results to return.\";'),('en','messages:apihelp-query+querypage-param-page','s:62:\"en:The name of the special page. Note, this is case-sensitive.\";'),('en','messages:apihelp-query+querypage-summary','s:57:\"en:Get a list provided by a QueryPage-based special page.\";'),('en','messages:apihelp-query+random-example-generator','s:67:\"en:Return page info 