),('en','messages:apihelp-query+recentchanges-param-prop','s:44:\"en:Include additional pieces of information:\";'),('en','messages:apihelp-query+recentchanges-param-show','s:130:\"en:Show only items that meet these criteria. For example, to see only minor edits done by logged-in users, set $1show=minor|!anon.\";'),('en','messages:apihelp-query+recentchanges-param-slot','s:47:\"en:Only list changes that touch the named slot.\";'),('en','messages:apihelp-query+recentchanges-param-start','s:43:\"en:The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+recentchanges-param-tag','s:42:\"en:Only list changes tagged with this tag.\";'),('en','messages:apihelp-query+recentchanges-param-title','s:45:\"en:Filter entries to those related to a page.\";'),('en','messages:apihelp-query+recentchanges-param-toponly','s:51:\"en:Only list changes which are the latest revision.\";'),('en','messages:apihelp-query+recentchanges-param-type','s:34:\"en:Which types of changes to show.\";'),('en','messages:apihelp-query+recentchanges-param-user','s:34:\"en:Only list changes by this user.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-autopatrolled','s:56:\"en:Tags patrollable edits as being autopatrolled or not.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-comment','s:131:\"en:Adds the comment for the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-flags','s:27:\"en:Adds flags for the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-ids','s:71:\"en:Adds the page ID, recent changes ID and the new and old revision ID.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-loginfo','s:63:\"en:Adds log information (log ID, log type, etc) to log entries.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-parsedcomment','s:138:\"en:Adds the parsed comment for the edit. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-patrolled','s:60:\"en:Tags patrollable edits as being patrolled or unpatrolled.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-redirect','s:35:\"en:Tags edit if page is a redirect.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-sha1','s:163:\"en:Adds the content checksum for entries associated with a revision. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-sizes','s:45:\"en:Adds the new and old page length in bytes.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-tags','s:28:\"en:Lists tags for the entry.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-timestamp','s:30:\"en:Adds timestamp of the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-title','s:35:\"en:Adds the page title of the edit.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-user','s:161:\"en:Adds the user responsible for the edit and tags if they are an IP. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-paramvalue-prop-userid','s:137:\"en:Adds the user ID responsible for the edit. If the user has been revision deleted, a <samp>userhidden</samp> property will be returned.\";'),('en','messages:apihelp-query+recentchanges-summary','s:28:\"en:Enumerate recent changes.\";'),('en','messages:apihelp-query+redirects-example-generator','s:73:\"en:Get information about all redirects to the [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+redirects-example-simple','s:61:\"en:Get a list of redirects to the [[{{MediaWiki:Mainpage}}]].\";'),('en','messages:apihelp-query+redirects-param-limit','s:32:\"en:How many redirects to return.\";'),('en','messages:apihelp-query+redirects-param-namespace','s:42:\"en:Only include pages in these namespaces.\";'),('en','messages:apihelp-query+redirects-param-prop','s:27:\"en:Which properties to get:\";'),('en','messages:apihelp-query+redirects-param-show','s:44:\"en:Show only items that meet these criteria:\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-fragment','s:37:\"en:Fragment of each redirect, if any.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-pageid','s:28:\"en:Page ID of each redirect.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-title','s:26:\"en:Title of each redirect.\";'),('en','messages:apihelp-query+redirects-paramvalue-show-!fragment','s:42:\"en:Only show redirects without a fragment.\";'),('en','messages:apihelp-query+redirects-paramvalue-show-fragment','s:39:\"en:Only show redirects with a fragment.\";'),('en','messages:apihelp-query+redirects-summary','s:44:\"en:Returns all redirects to the given pages.\";'),('en','messages:apihelp-query+revisions+base-param-contentformat','s:92:\"en:Serialization format used for <var>$1difftotext</var> and expected for output of content.\";'),('en','messages:apihelp-query+revisions+base-param-contentformat-slot','s:59:\"en:Content serialization format used for output of content.\";'),('en','messages:apihelp-query+revisions+base-param-diffto','s:221:\"en:Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Revision ID to diff each revision to. Use <kbd>prev</kbd>, <kbd>next</kbd> and <kbd>cur</kbd> for the previous, next and current revision respectively.\";'),('en','messages:apihelp-query+revisions+base-param-difftotext','s:257:\"en:Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Text to diff each revision to. Only diffs a limited number of revisions. Overrides <var>$1diffto</var>. If <var>$1section</var> is set, only that section will be diffed against this text.\";'),('en','messages:apihelp-query+revisions+base-param-difftotextpst','s:180:\"en:Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Perform a pre-save transform on the text before diffing it. Only valid when used with <var>$1difftotext</var>.\";'),('en','messages:apihelp-query+revisions+base-param-expandtemplates','s:149:\"en:Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> instead. Expand templates in revision content (requires $1prop=content).\";'),('en','messages:apihelp-query+revisions+base-param-generatexml','s:210:\"en:Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Generate XML parse tree for revision content (requires $1prop=content).\";'),('en','messages:apihelp-query+revisions+base-param-limit','s:45:\"en:Limit how many revisions will be returned.\";'),('en','messages:apihelp-query+revisions+base-param-parse','s:190:\"en:Use <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. Parse revision content (requires $1prop=content). For performance reasons, if this option is used, $1limit is enforced to 1.\";'),('en','messages:apihelp-query+revisions+base-param-prop','s:45:\"en:Which properties to get for each revision:\";'),('en','messages:apihelp-query+revisions+base-param-section','s:65:\"en:Only retrieve the content of the section with this identifier.\";'),('en','messages:apihelp-query+revisions+base-param-slots','s:206:\"en:Which revision slots to return data for, when slot-related properties are included in <var>$1props</var>. If omitted, data from the <kbd>main</kbd> slot will be returned in a backwards-compatible format.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-comment','s:138:\"en:Comment by the user for the revision. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-content','s:128:\"en:Content of each revision slot. If the content has been revision deleted, a <samp>texthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-contentmodel','s:42:\"en:Content model ID of each revision slot.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-flags','s:26:\"en:Revision flags (minor).\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-ids','s:26:\"en:The ID of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-parsedcomment','s:145:\"en:Parsed comment by the user for the revision. If the comment has been revision deleted, a <samp>commenthidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-parsetree','s:219:\"en:Use <kbd>[[Special:ApiHelp/expandtemplates|action=expandtemplates]]</kbd> or <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd> instead. The XML parse tree of revision content (requires content model <code>$1</code>).\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-roles','s:54:\"en:List content slot roles that exist in the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-sha1','s:130:\"en:SHA-1 (base 16) of the revision. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-size','s:34:\"en:Length (bytes) of the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-slotsha1','s:136:\"en:SHA-1 (base 16) of each revision slot. If the content has been revision deleted, a <samp>sha1hidden</samp> property will be returned.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-slotsize','s:40:\"en:Length (bytes) of each revision slot.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-tags','s:25:\"en:Tags for the revision.\";'),('en','messages:apihelp-query+revisions+base-paramvalue-prop-timestamp','s:33:\"en:The timestamp of the revision.\";'),('en