\";'),('en','messages:apihelp-query+search-param-prop','s:30:\"en:Which properties to return:\";'),('en','messages:apihelp-query+search-param-qiprofile','s:64:\"en:Query independent profile to use (affects ranking algorithm).\";'),('en','messages:apihelp-query+search-param-search','s:178:\"en:Search for page titles or content matching this value. You can use the search string to invoke special search features, depending on what the wiki\'s search backend implements.\";'),('en','messages:apihelp-query+search-param-sort','s:42:\"en:Set the sort order of returned results.\";'),('en','messages:apihelp-query+search-param-what','s:35:\"en:Which type of search to perform.\";'),('en','messages:apihelp-query+search-paramvalue-prop-categorysnippet','s:72:\"en:Adds the matching category name, with query term highlighting markup.\";'),('en','messages:apihelp-query+search-paramvalue-prop-extensiondata','s:43:\"en:Adds extra data generated by extensions.\";'),('en','messages:apihelp-query+search-paramvalue-prop-hasrelated','s:11:\"en:Ignored.\";'),('en','messages:apihelp-query+search-paramvalue-prop-isfilematch','s:64:\"en:Adds a boolean indicating if the search matched file content.\";'),('en','messages:apihelp-query+search-paramvalue-prop-redirectsnippet','s:80:\"en:Adds the title of the matching redirect, with query term highlighting markup.\";'),('en','messages:apihelp-query+search-paramvalue-prop-redirecttitle','s:43:\"en:Adds the title of the matching redirect.\";'),('en','messages:apihelp-query+search-paramvalue-prop-score','s:11:\"en:Ignored.\";'),('en','messages:apihelp-query+search-paramvalue-prop-sectionsnippet','s:79:\"en:Adds the title of the matching section, with query term highlighting markup.\";'),('en','messages:apihelp-query+search-paramvalue-prop-sectiontitle','s:42:\"en:Adds the title of the matching section.\";'),('en','messages:apihelp-query+search-paramvalue-prop-size','s:38:\"en:Adds the size of the page in bytes.\";'),('en','messages:apihelp-query+search-paramvalue-prop-snippet','s:67:\"en:Adds a snippet of the page, with query term highlighting markup.\";'),('en','messages:apihelp-query+search-paramvalue-prop-timestamp','s:55:\"en:Adds the timestamp of when the page was last edited.\";'),('en','messages:apihelp-query+search-paramvalue-prop-titlesnippet','s:60:\"en:Adds the page title, with query term highlighting markup.\";'),('en','messages:apihelp-query+search-paramvalue-prop-wordcount','s:35:\"en:Adds the word count of the page.\";'),('en','messages:apihelp-query+search-summary','s:30:\"en:Perform a full text search.\";'),('en','messages:apihelp-query+siteinfo-example-interwiki','s:44:\"en:Fetch a list of local interwiki prefixes.\";'),('en','messages:apihelp-query+siteinfo-example-replag','s:37:\"en:Check the current replication lag.\";'),('en','messages:apihelp-query+siteinfo-example-simple','s:26:\"en:Fetch site information.\";'),('en','messages:apihelp-query+siteinfo-param-filteriw','s:67:\"en:Return only local or only nonlocal entries of the interwiki map.\";'),('en','messages:apihelp-query+siteinfo-param-inlanguagecode','s:75:\"en:Language code for localised language names (best effort) and skin names.\";'),('en','messages:apihelp-query+siteinfo-param-numberingroup','s:44:\"en:Lists the number of users in user groups.\";'),('en','messages:apihelp-query+siteinfo-param-prop','s:28:\"en:Which information to get:\";'),('en','messages:apihelp-query+siteinfo-param-showalldb','s:64:\"en:List all database servers, not just the one lagging the most.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-autocreatetempuser','s:106:\"en:Returns configuration for the automatic creation of temporary user accounts (also known as IP masking).\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-dbrepllag','s:60:\"en:Returns database server with the highest replication lag.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-defaultoptions','s:51:\"en:Returns the default values for user preferences.\"