s:67:\"en:Returns information on available restriction (protection) types.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-rightsinfo','s:58:\"en:Returns wiki rights (license) information if available.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-showhooks','s:118:\"en:Returns a list of all subscribed hooks (contents of <var>[[mw:Special:MyLanguage/Manual:$wgHooks|$wgHooks]]</var>).\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-skins','s:134:\"en:Returns a list of all enabled skins (optionally localised by using <var>$1inlanguagecode</var>, otherwise in the content language).\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-specialpagealiases','s:32:\"en:List of special page aliases.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-statistics','s:27:\"en:Returns site statistics.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-uploaddialog','s:43:\"en:Returns the upload dialog configuration.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-usergroups','s:54:\"en:Returns user groups and the associated permissions.\";'),('en','messages:apihelp-query+siteinfo-paramvalue-prop-variables','s:34:\"en:Returns a list of variable IDs.\";'),('en','messages:apihelp-query+siteinfo-summary','s:45:\"en:Return general information about the site.\";'),('en','messages:apihelp-query+stashimageinfo-example-params','s:44:\"en:Returns thumbnails for two stashed files.\";'),('en','messages:apihelp-query+stashimageinfo-example-simple','s:42:\"en:Returns information for a stashed file.\";'),('en','messages:apihelp-query+stashimageinfo-param-filekey','s:70:\"en:Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-query+stashimageinfo-param-sessionkey','s:51:\"en:Alias for $1filekey, for backward compatibility.\";'),('en','messages:apihelp-query+stashimageinfo-summary','s:46:\"en:Returns file information for stashed files.\";'),('en','messages:apihelp-query+tags-exa