rectly from the source code using some other method. This is expected. Try installing some skins from [https://www.mediawiki.org/wiki/Special:MyLanguage/Category:All_skins mediawiki.org\'s skin directory], by:\n:* Downloading the [https://www.mediawiki.org/wiki/Special:MyLanguage/Download tarball installer], which comes with several skins and extensions. You can copy and paste the <code>skins/</code> directory from it.\n:* Downloading individual skin tarballs from [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* [https://www.mediawiki.org/wiki/Special:MyLanguage/Download_from_Git#Using_Git_to_download_MediaWiki_skins Using Git to download skins].\n: Doing this should not interfere with your git repository if you\'re a MediaWiki developer.\n\n; If you have just upgraded MediaWiki:\n: MediaWiki 1.24 and newer no longer automatically enables installed skins (see [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery Manual: Skin autodiscovery]). You can paste the following {{PLURAL:$5|line|lines}} into <code>LocalSettings.php</code> to enable {{PLURAL:$5|the|all}} installed {{PLURAL:$5|skin|skins}}:\n\n<pre dir=\"ltr\">$3</pre>\n\n; If you have just modified <code>LocalSettings.php</code>:\n: Double-check the skin names for typos.\";'),('en','messages:default-skin-not-found-no-skins','s:1256:\"en:Whoops! The default skin for your wiki, defined in <code>$wgDefaultSkin</code> as <code>$1</code>, is not available.\n\nYou have no installed skins.\n\n; If you have just installed or upgraded MediaWiki:\n: You probably installed from git, or directly from the source code using some other method. This is expected. MediaWiki 1.24 and newer doesn\'t include any skins in the main repository. Try installing some skins from [https://www.mediawiki.org/wiki/Special:MyLanguage/Category:All_skins mediawiki.org\'s skin directory], by:\n:* Downloading the [https://www.mediawiki.org/wiki/Special:MyLanguage/Download tarball installer], which comes with several skins and extensions. You can copy and paste the <code>skins/</code> directory from it.\n:* Downloading individual skin tarballs from [https://www.mediawiki.org/wiki/Special:SkinDistributor mediawiki.org].\n:* [https://www.mediawiki.org/wiki/Special:MyLanguage/Download_from_Git#Using_Git_to_download_MediaWiki_skins Using Git to download skins].\n: Doing this should not interfere with your git repository if you\'re a MediaWiki developer. See [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Skin_configuration Manual: Skin configuration] for information how to enable skins and choose the default.\";'),('en','messages:default-skin-not-found-row-disabled','s:53:\"en:* <code>$1</code> / $2 (<strong>disabled</strong>)\";'),('en','messages:default-skin-not-found-row-enabled','s:35:\"en:* <code>$1</code> / $2 (enabled)\";'),('en','messages:defaultmessagetext','s:23:\"en:Default message text\";'),('en','messages:defemailsubject','s:36:\"en:{{SITENAME}} email from user \"$1\"\";'),('en','messages:deflate-invaliddeflate','s:44:\"en:Content provided is not properly deflated\";'),('en','messages:delete','s:9:\"en:Delete\";'),('en','messages:delete-confirm','s:14:\"en:Delete \"$1\"\";'),('en','messages:delete-edit-reasonlist','s:24:\"en:Edit deletion reasons\";'),('en','messages:delete-edit-reasonlist-suppress','s:24:\"en:Edit suppress reasons\";'),('en','messages:delete-error-associated-alreadytalk','s:53:\"en:Cannot delete associated talk page of a talk page.\";'),('en','messages:delete-error-associated-doesnotexist','s:53:\"en:Cannot delete a non-existing associated talk page.\";'),('en','messages:delete-hook-aborted','s:52:\"en:Deletion aborted by hook.\nIt gave no explanation.\";'),('en','messages:delete-legend','s:9:\"en:Delete\";'),('en','messages:delete-scheduled','s:62:\"en:The page \"$1\" is scheduled for deletion.\nPlease be patient.\";'),('en','messages:delete-talk-summary-prefix','s:60:\"en:Deleted together with the associated page with reason: $1\";'),('en'